1	7	BOLIVAR	El estado Bolívar se localiza en el sur de Venezuela, Su superficie corresponde a 26,2% del territorio nacional, es decir, más de 238.000 Km2.\n\nLimita al norte y noreste con el río Orinoco, que le sirve de límite a los estados Apure, Guárico, Anzoátegui, Monagas y Delta Amacuro, al este limita con el territorio en reclamación de la Guayana Esequiba, al sur con el estado Amazonas y la República Federativa del Brasil y al oeste con los estados Amazonas y Apure.\n\nSu territorio está ocupado casi en su totalidad por el macizo de las guayanas. Su superficie es en general accidentada, la altitud atenúa el clima tropical cálido.\n\nEl estado se compone de 11 municipios y 37 parroquias a lo largo y ancho del estado Bolívar	\nEn el estado Bolívar están grandes comercios (en las grandes ciudades), hay grandes fuentes energéticas muy importantes para Venezuela (la Represa Raúl Leoni, entre otros), productos agrícolas famosos (queso guayanés, entre otros), y muchos minerales de gran necesidad (petróleo, oro, bauxita, entre otros). Puedes encontrar más sobre esto en forma más detallada a continuación:\n\n Sector Primario \n\nLa agricultura no está muy desarrollada. Los cultivos más importantes son los de maíz, yuca, batata, cambur, plátano,caña de azúcar, arroz y merey. La silvicultura (cultivo y explotación racional de los bosques) tiene cierta importancia por la cantidad y calidad de los bosques.\n\nLa ganadería es importante en algunas zonas especialmente en las sabanas de Upata y Tumeremo.\n\nLa pesca fluvial se compone de zapoar, cachama, caribe, manamana, palometa, bagre, payara, doncella, dorado, laulau, rayado, tonina y tortugas arrau. También se ha extendido la siembra de cachamoto, pez producto del cruce de la cachama con el morocoto.\n\nLa minería es el gran atractivo, hierro, manganeso y níquel en el bajo Caroní; mercurio en El Manteco; vermiculita, calizas, gredas, caolín, ocre y bauxita en La Urbana; metales preciosos en la cuenca del Yuruari y la Gran Sabana; oro y trazas de platino en El Miamo; diamantes en esta región y otras cuencas fluviales.\n\n Sector Secundario \n\nLa industria siderúrgica, extractiva de hierro y bauxita, reducción de bauxita en aluminio, las represas hidroeléctricas, la industria forestal, industrias mecánicas y agroalimentarias, todo esto sería el sector secundario del estado Bolívar debido a su riqueza en minerales y otros.	1534800	sur	el estado es limitado en mayoría por el río Orinoco. Este delimita con varios estados de Venezuela y con las repúblicas de Guyana y Brasil	238000 km2
1	4	APURE	EL ESTADO APURE ESTá LOCALIZADO AL SURESTE DEL PAíS, SE UBICA ENTRE LOS 06º03’45’’, 08º04’22’’ DE LATITUD NORTE Y LOS 66º21’45’’, 72º22’30’’ DE LONGITUD OESTE.  LIMITA POR EL NORTE CON LOS ESTADOS TáCHIRA, BARINAS Y GUáRICO; POR EL ESTE Y SURESTE CON LOS ESTADOS BOLíVAR Y AMAZONAS, POR EL SUR Y OESTE CON LA REPúBLICA DE COLOMBIA, SITUACIóN FRONTERIZA QUE LE CONFIERE UNA POSICIóN ESTRATéGICA EN EL CONTEXTO NACIONAL, EN LO QUE A DEFENSA Y SEGURIDAD SE REFIERE.  DESPUéS DE LA PENETRACIóN HISPáNICA EN TERRITORIO VENEZOLANO, SE COMENZARON A CREAR LAS PRIMERAS PROVINCIAS, EL TERRITORIO APUREñO PARA ESE ENTONCES FORMABA PARTE DE LA PROVINCIA DE MéRIDA DEL ESPíRITU SANTO DE LA GRITA. \n LUEGO, CUANDO A ESTA PROVINCIA SE LE ANEXA MARACAIBO, PASA A DENOMINARSE POSTERIORMENTE PROVINCIA DE MARACAIBO, CONFORMADA POR LOS TERRITORIOS DE LOS ESTADOS MéRIDA, TáCHIRA, TRUJILLO, ZULIA, BARINAS, APURE.  A COMIENZOS DEL SIGLO XIX, SE DISGREGA ESTA PROVINCIA Y EL TERRITORIO APUREñO PASA A FORMAR PARTE DE LA PROVINCIA DE BARINAS, HASTA QUE EN LA DIVISIóN POLíTICO TERRITORIAL DE 1856 ES ERIGIDA COMO PROVINCIA, Y EN LA CONSTITUCIóN FEDERALISTA DE 1864 ADQUIERE EL RANGO DE ESTADO APURE.  EN LA DIVISIóN TERRITORIAL DE 1881, APURE Y GUAYANA FORMA UN SOLO ESTADO CON EL NOMBRE DE BOLíVAR.  QUEDANDO RESTABLECIDO RESTABLECIDO DEFINITIVAMENTE EL ESTADO APURE EN LA CONSTITUCIóN DE 1909.\n ACTUALMENTE EL ESTADO APURE, SEGúN LEY DE DIVISIóN POLíTICO TERRITORIAL DE FECHA 14 DE DICIEMBRE DE 1992 ESTá CONFORMADO POR SIETE (7) MUNICIPIOS Y VEINTISEIS (26) PARROQUIAS.\nCAPITAL:\n SAN FERNANDO DE APURE\nOTRAS POBLACIONES:\n ACHAGUAS, BIRUACA, BRUZUAL, EL AMPARO, ELORZA, GUASDUALITO, LA VICTORIA, PUERTO PáEZ Y SAN JUAN DE PAYARA.\nSUPERFICIE:\n 76500 KM2\n \nPOBLACIóN TOTAL (CENSO 1990): \n 285412 HABITANTES. \nPORCENTAJE DE LA POBLACIóN TOTAL: \n 1,6%  ES EL SEXTO ESTADO MENOS POBLADO DEL PAíS. \nDIVISIóN POLíTICO TERRITORIAL: \n SIETE MUNICIPIOS: \n ACHAGUAS, BIRUACA, MUñOZ, PáEZ, PEDRO CAMEJO, RóMULO GALLEGOS Y SAN FERNANDO.  	SUS PRINCIPALES FUENTES ECONOMICAS:\nLA CRíA DE RESES Y AVES DESPUNTA COMO ACTIVIDAD ECONóMICA RURAL, AUNQUE SOBREPASA EL SECTOR DE COMERCIO, SERVICIOS Y TRANSPORTE, GRACIAS AL AUGE QUE EXPERIMENTAN LOS CENTROS URBANOS. DE ESTA FORMA, LA PRODUCCIóN AGRíCOLA Y DE MADERA ES FUNDAMENTAL; DESTACAN EL ALGODóN Y EL CACAO, RUBROS QUE ALCANZAN EL TERCER LUGAR NACIONAL. LA EXPLOTACIóN DE ESPECIES FLUVIALES COMO LA CACHAMA, EL BOCACHICO Y BAGRE RAYADO ES MUY IMPORTANTE, HASTA EL PUNTO DE QUE EN 1996 EL VOLUMEN DE PESCA OBTENIDA EN EL ESTADO APURE FUE DE 15.000 TONELADAS, MUY SUPERIOR, INCLUSO, A LA DE MUCHOS ESTADOS COSTEROS. FINALMENTE LA EXTRACCIóN DE MINERALES E HIDROCARBUROS TAMBIéN OCUPA UN SITIO IMPORTANTE.	473900	SUROESTE	LIMITA POR EL NORTE CON LOS ESTADOS TáCHIRA, BARINAS Y GUáRICO; POR EL ESTE Y SURESTE CON LOS ESTADOS BOLíVAR Y AMAZONAS, POR EL SUR Y OESTE CON LA REPúBLICA DE COLOMBIA	76500 KM2
1	6	BARINAS	EL ESTADO BARINAS, JUNTO A LOS ESTADOS APURE, GUáRICO, COJEDES Y EL DE PORTUGUESA, FORMAN LA REGIóN CONOCIDA COMO LOS LLANOS VENEZOLANOS, AUNQUE LA PARTE QUE LIMITA CON LOS ESTADOS DE MéRIDA Y PORTUGUESA SON DE GEOGRAFíA Y CLIMA COMPLETAMENTE ANDINAS. LA SUPERFICIE DEL ESTADO BARINAS ES DE 35.200 KM², Y A LA VEZ TIENE UNA POBLACIóN ESTIMADA PARA 2006 DE 740.440 HABITANTES.\n\nEL ESTADO BARINAS, ES UNO DE LOS 23 ESTADOS DE VENEZUELA, ANTIGUAMENTE LLAMADO ESTADO ZAMORA, ES UN ESTADO EN EL CUAL SE HAN DESARROLLADO BATALLAS IMPORTANTES COMO LA DE SABANETA, EN LA GUERRA FEDERAL, ENTRE OTRAS BATALLAS. \n\nECONOMíA \nLA ECONOMíA DEL ESTADO BARINAS SE BASA EN LA AGRICULTURA, ALGUNAS DE SUS PRINCIPALES PRODUCCIONES SON FRUTAS TROPICALES Y LA GANADERíA, PERO EL SECTOR PRIMARIO TAMBIéN ES \n\nLIMITES\n- NORTE\n- SUR\n- ESTE\n- OESTE \t\nMéRIDA, TRUJILLO, COJEDES, PORTUGUESA\nAPURE\nGUáRICO\nMéRIDA Y TáCHIRA	ECONOMíA \nLA ECONOMíA DEL ESTADO BARINAS SE BASA EN LA AGRICULTURA, ALGUNAS DE SUS PRINCIPALES PRODUCCIONES SON FRUTAS TROPICALES Y LA GANADERíA, PERO EL SECTOR PRIMARIO TAMBIéN ES IMPORTANTE, DEBIDO A QUE HAY YACIMIENTOS PETROLíFEROS EN EL ESTADO, LO QUE LE DA UN CIERTO DESARROLLO AL MISMO.	756600	SUROESTE	LIMITES\n- NORTE: MéRIDA, TRUJILLO, COJEDES, PORTUGUESA\n- SUR: APURE\n- ESTE: GUáRICO\n- OESTE: MéRIDA Y TáCHIRA\t\n	35200
1	8	CARABOBO	ES UN ESTADO UBICADO EN LA REGIóN CENTRAL DE VENEZUELA. SU CAPITAL ES LA CIUDAD DE VALENCIA. TIENE UNA EXTENSIóN GEOGRáFICA DE 4650 KM² Y UNA POBLACIóN ESTIMADA PARA 2006 DE 2.400.000 HABITANTES\n\nEL ESTADO CARABOBO ESTá SITUADO EN LA REGIóN CENTRO-NORTE DE VENEZUELA Y LIMITA CON EL MAR CARIBE POR EL NORTE, CON, LOS ESTADOS COJEDES Y GUáRICO POR EL SUR, CON ARAGUA POR EL ESTE Y CON LOS ESTADOS YARACUY Y FALCóN POR EL OESTE.\n\n    * PRODUCTOS AGROPECUARIOS: MAíZ LEGUMINOSA DE GRANO, CACAO, TABACO, ALGODóN, CAñA DE AZúCAR, HORTALIZAS, COCO, PRODUCTOS PESQUEROS.\n\n    * PRODUCTOS INDUSTRIALES: INDUSTRIAS METALMECáNICA, VEHíCULOS AUTOMOTORES, PRODUCTOS QUíMICOS Y PETROQUíMICOS, COMBUSTIBLE, ASFALTO, GAS LICUADO, CERáMICAS PARA LA CONSTRUCCIóN, PAPEL BEBIDAS ALCOHóLICAS Y BEBIDAS GASEOSAS.\n\n    * RECURSOS FORESTALES: ALGARROBO, APAMATE, CAMORUCO, CAOBO, CEDRO, GUAMO SAMáN.\n\n    * RECURSOS MINERALES: ARCILLAS DE ALFARERíA, ARENA, DIATóMITAS, DOLOMITA, MáRMOL Y SERPENTINAS.\n	EL ESTADO CARABOBO ES UNO DE LOS MáS PUJANTES DE VENEZUELA Y SU INDUSTRIA ES UNA DE LAS MáS PRóSPERAS DEL PAíS Y SU PRODUCCIóN AGRíCOLA TAMBIéN SE ENCUENTRA ENTRE LAS MáS SIGNIFICATIVAS.\n\n\nINDUSTRIA \n\nENTRE LAS INDUSTRIAS MáS IMPORTANTES DE LA REGIóN SE ENCUENTRAN LAS INDUSTRIAS DE ALIMENTOS, LAS ENSAMBLADORAS DE AUTOS, TEXTILES, PLANTAS GALVANIZADORAS, CERáMICAS INDUSTRIALES, PLáSTICOS, PINTURAS, NEUMáTICOS, PAPEL, ASFALTO, PAPEL Y ARTEFACTOS ELECTRODOMéSTICOS.\n\n    * PRODUCTOS AGROPECUARIOS: MAíZ LEGUMINOSA DE GRANO, CACAO, TABACO, ALGODóN, CAñA DE AZúCAR, HORTALIZAS, COCO, PRODUCTOS PESQUEROS.\n\n    * PRODUCTOS INDUSTRIALES: INDUSTRIAS METALMECáNICA, VEHíCULOS AUTOMOTORES, PRODUCTOS QUíMICOS Y PETROQUíMICOS, COMBUSTIBLE, ASFALTO, GAS LICUADO, CERáMICAS PARA LA CONSTRUCCIóN, PAPEL BEBIDAS ALCOHóLICAS Y BEBIDAS GASEOSAS.\n\n    * RECURSOS FORESTALES: ALGARROBO, APAMATE, CAMORUCO, CAOBO, CEDRO, GUAMO SAMáN.\n\n    * RECURSOS MINERALES: ARCILLAS DE ALFARERíA, ARENA, DIATóMITAS, DOLOMITA, MáRMOL Y SERPENTINAS.\n	2227000	CENTRO NORTE	LIMITA CON EL MAR CARIBE POR EL NORTE, CON, LOS ESTADOS COJEDES Y GUáRICO POR EL SUR, CON ARAGUA POR EL ESTE Y CON LOS ESTADOS YARACUY Y FALCóN POR EL OESTE.	4650 KM2
1	20	TACHIRA	EL ESTADO TáCHIRA ES UNO DE LOS 23 ESTADOS DE VENEZUELA. SU CAPITAL ES SAN CRISTóBAL. ESTA ENTIDAD SE ENCUENTRA EN LAS COORDENADAS 7º 46 11 DE LATITUD NORTE Y 72º 14 21 DE LONGITUD OESTE Y LIMITA AL NORTE CON EL ESTADO ZULIA, AL ESTE CON LOS ESTADOS MéRIDA Y BARINAS, AL SUR CON APURE Y BARINAS Y AL OESTE CON COLOMBIA. SU TEMPERATURA PROMEDIO SE SITúA ENTRE LOS 10 Y LOS 25 ºC.\n\nLA INDUSTRIA EN ESTE ESTADO ES MUY VARIADA: LáCTEOS, TEJIDOS, MINERíA Y MATERIALES DE CONSTRUCCIóN, ENTRE OTRAS. EN EL ESTADO TáCHIRA SE ENCUENTRA LA PETRóLEA, EL PRIMER POZO DE PETRóLEO EXPLOTADO EN VENEZUELA DESDE 1878, SU EXPLOTACIóN DIO INICIO A LA FLORECIENTE INDUSTRIA PETROLERA DE VENEZUELA. SIN EMBARGO, LA EXPLOTACIóN PETROLERA HA PRáCTICAMENTE CESADO EN EL ESTADO.\n\nLA CIUDAD DE SAN CRISTóBAL, CAPITAL DEL ESTADO, SE EXTIENDE BAJO UNA SUCESIóN DE TERRAZAS FLUVIALES. SU TEMPERATURA PROMEDIO ES DE 23 ºC. HACIA LAS MONTAñAS, LA TEMPERATURA PUEDE DESCENDER HASTA LOS 0 ºC. SAN CRISTóBAL ES CENTRO UNIVERSITARIO; ES SEDE DE LA UNIVERSIDAD NACIONAL EXPERIMENTAL DEL TáCHIRA (UNET), UNIVERSIDAD DE LOS ANDES (VENEZUELA), INSTITUTO UNIVERSITARIO DE TECNOLOGíA (IUT) Y DE LA UNIVERSIDAD CATóLICA DEL TáCHIRA, PRINCIPALMENTE.\n\nTáCHIRA ES UN VOCABLO DE ORIGEN TIMOTOCUICA (CHIBCHA) PROVENIENTE DEL TéRMINO TACHURE CON QUE SE IDENTIFICA A UNA PLANTA TINTóREA DE COLOR MORADO QUE TIENE USO MEDICINAL, CONOCIDA CON EL NOMBRE DE TUN-TúA O SIBIDIGUA (JATROPA GOSSYPIFOLIA).\n\nEL ESTADO TáCHIRA, SE UBICA AL OCCIDENTE Y SUROESTE DE VENEZUELA, EN LA REGIóN DE LOS ANDES, TIENE UNA SUPERFICIE DE 11.100 KM² ES EL SEGUNDO ESTADO MáS ALTO LUEGO DEL ESTADO MéRIDA, CON EL QUE COMPARTE FRONTERA AL ESTE Y NORTE, LAS DEMáS FRONTERAS DEL ESTADO SON: NORTE: ZULIA, SUR: COLOMBIA Y APURE, ESTE BARINAS.\n\nATRAVESADA POR LA EXTENSIóN DE LA CORDILLERA DE LOS ANDES DE SUR A NOROESTE, LA MISMA DIVIDE AL ESTADO ENTRES REGIONES DIFERENCIADAS Y CON CLIMA PARTICULAR:\n\n    * CIRCUITO DE LA MONTAñA; EN ESTA REGIóN SE ENCUENTRAN LOS PRINCIPALES ASENTAMIENTOS URBANOS DEL ESTADO, EL CLIMA ES TEMPLADO DE ALTURA[1] EN LA MAYOR PARTE DE LA REGIóN Y DE PáRAMO DE ALTURA, EN LAS ELEVACIONES SUPERIORES A LOS 3.000 MSNM. CON LEVES VARIACIONES A LO LARGO DEL AñO, PRESENTA UNA CLARA éPOCA DE LLUVIAS DE MAYO A OCTUBRE. LA OROGRAFíA ES ACCIDENTADA E INFLUIDA POR EL CURSO DE NUMEROSOS RíOS Y QUEBRADAS QUE FORMAN VALLES EN LA BASE DE LAS MONTAñAS, COMO EJEMPLO LA CIUDAD CAPITAL ESTá ASENTADA SOBRE EL VALLE DEL RíO TORBES. ESTA ZONA REPRESENTA LA MAYOR PARTE DE LA SUPERFICIE DEL ESTADO.\n\nECONOMíA \n\nRECURSOS ECONóMICOS\n\n    * PESCA: BLANCO POBRE, CACHAMA, CAJARO, COPORO, PALOMETA, TORUMO, TUMARE (EN RíOS), BAGRE RAYADO.\n\n    * PRODUCTOS AGRíCOLAS: AJO, CAMBUR, CAñA DE AZúCAR, CAFé, CARAOTA, CEBOLLA, PAPA, PLáTANO Y TOMATE.\n\n    * PRODUCCIóN PECUARIA: GANADO VACUNO PRINCIPALMENTE.\n\n    * RECURSOS FORESTALES: ANIME (BALSO), BUCARE, GUAMO, LACRE, LAUREL, MANTECO, PINO LASO, QUINDU, ENTRE OTROS.\n\n    * RECURSOS MINERALES: ARCILLAS, ARENAS SILíCEAS, ASFALTO, VARITA, CARBóN, COBRE, FóSFORO, URANIO Y YESO.\n\nACTIVIDAD INDUSTRIAL [EDITAR]\n\n    * INDUSTRIA ALIMENTICIA: LáCTEOS, CONFITERíAS, CONSERVAS, CAFé, PANADERíAS TíPICAS.\n    * AUTOMOTRIZ: AUTOBUSES\n    * ARTESANíA: HAMACAS, TEXTILES, ALFARERíA, TALABARTERíA, EBANISTERíA, TENERíA (CURTIDURíA).\n    * INDUSTRIAS MINERAS: DE EXTRACCIóN DE CARBóN, ASFALTO, YESO.\n    * MANUFACTURAS: TEXTILERíAS, FáBRICAS DE CALZADO, ROPA, CUERO.\n    * ENERGíA: COMPLEJO HIDROELéCTRICO URIBANTE-CAPARO\n\nACTIVIDAD COMERCIAL [EDITAR]\n\n    * IMPORTACIóN: ADUANAS, ALMACENES.\n    * DISTRIBUIDORAS Y MAYORISTAS\n    * DETALLISTAS: RETAILERS, TIENDAS POR DEPARTAMENTO, TIENDAS DE DESCUENTO\n\nEN LA ACTUALIDAD EL NúCLEO URBANO FORMADO POR LOS CENTROS POBLADOS DE SAN CRISTóBAL, TáRIBA, BARRANCAS, LAS VEGAS, EL MIRADOR, TUCAPé, ARJONA (MUN. CáRDENAS); PALMIRA, EL ABEJAL, PATIECITOS (MUN. GUáSIMOS), CONFORMAN UNA CONURBACIóN UNITARIA DE MáS DE 847.000 HABITANTES CON UNA VIDA SOCIO-ECONóMICA COMúN, CONOCIDA COMO LA ZONA METROPOLITANA DE SAN CRISTóBAL.	ECONOMíA: \n\nRECURSOS ECONóMICOS\n\n    * PESCA: BLANCO POBRE, CACHAMA, CAJARO, COPORO, PALOMETA, TORUMO, TUMARE (EN RíOS), BAGRE RAYADO.\n\n    * PRODUCTOS AGRíCOLAS: AJO, CAMBUR, CAñA DE AZúCAR, CAFé, CARAOTA, CEBOLLA, PAPA, PLáTANO Y TOMATE.\n\n    * PRODUCCIóN PECUARIA: GANADO VACUNO PRINCIPALMENTE.\n\n    * RECURSOS FORESTALES: ANIME (BALSO), BUCARE, GUAMO, LACRE, LAUREL, MANTECO, PINO LASO, QUINDU, ENTRE OTROS.\n\n    * RECURSOS MINERALES: ARCILLAS, ARENAS SILíCEAS, ASFALTO, VARITA, CARBóN, COBRE, FóSFORO, URANIO Y YESO.\n\nACTIVIDAD INDUSTRIAL [EDITAR]\n\n    * INDUSTRIA ALIMENTICIA: LáCTEOS, CONFITERíAS, CONSERVAS, CAFé, PANADERíAS TíPICAS.\n    * AUTOMOTRIZ: AUTOBUSES\n    * ARTESANíA: HAMACAS, TEXTILES, ALFARERíA, TALABARTERíA, EBANISTERíA, TENERíA (CURTIDURíA).\n    * INDUSTRIAS MINERAS: DE EXTRACCIóN DE CARBóN, ASFALTO, YESO.\n    * MANUFACTURAS: TEXTILERíAS, FáBRICAS DE CALZADO, ROPA, CUERO.\n    * ENERGíA: COMPLEJO HIDROELéCTRICO URIBANTE-CAPARO\n\nACTIVIDAD COMERCIAL [EDITAR]\n\n    * IMPORTACIóN: ADUANAS, ALMACENES.\n    * DISTRIBUIDORAS Y MAYORISTAS\n    * DETALLISTAS: RETAILERS, TIENDAS POR DEPARTAMENTO, TIENDAS DE DESCUENTO\n\n\nEL ESTADO TáCHIRA POSEE DISTINTOS ATRACTIVOS TURíSTICOS ENTRE LOS CUALES RESALTAN LOS PASEOS DE LA RUTAS DE LA MONTAñA Y EL PáRAMO (EL ZUMBADOR, LOS ROSALES, LA NEGRA, EL TAMá), LAS ZONAS GANADERAS DE LA VíA AL LLANO Y EL SUR DEL LAGO (DE MARACAIBO), LA RUTA PANAMERICANA, LOS POBLADOS TRADICIONALES Y COSTUMBRISTAS (PERIBECA, SAN PEDRO DEL RíO, EL COBRE, PREGONERO), LA ARQUITECTURA DE SAN CRISTóBAL, LA GRITA, LOS NUMEROSOS REESTAURANTES DE COMIDA TíPICA ANDINA, LOS EVENTOS DEPORTIVOS REALIZADOS EN LA CIUDAD DE SAN CRISTóBAL (PRINCIPALMENTE LOS ENCUENTROS DEL DEPORTIVO TáCHIRA, DE LA LIGA DE PRIMERA DIVISIóN DE VENEZUELA), LAS FERIAS Y FIESTAS PATRONALES, PRINCIPALMENTE LA FERIA INTERNACIONAL DE SAN SEBASTIáN, ENTRE MUCHOS OTROS.\n\nTAMBIéN ES EL TáCHIRA CENTRO DE ACTIVIDADES DEPORTIVAS FLUVIALES, COMO LA PESCA DEPORTIVAS (DESARROLLADA EN LOS NUMEROSOS CURSOS FLUVIALES DEL ESTADO, PRINCIPALMENTE EN LOS RIOS URIBANTE, CAPARO Y DORADAS), ALGUNAS ACTIVIDADES COMO EL CANOTAJE Y OTRAS ESPECIALIDADES SE DESARROLLAN EN EL LAGO ARTIFICIAL FORMADO POR LA REPRESA URIBANTE-CAPARO, DEL COMPLEJO HIDROELéCTRICO DEL MISMO NOMBRE.\n\nLOS SITIOS DE MAYOR INTERéS, TANTO TURíSTICO COMO HISTóRICO, SE ENCUENTRAN REPRESENTADOS POR ALGUNAS EDIFICACIONES DE VALOR ARQUITECTóNICO, LAS CUALES SE ENCUENTRAN íNTIMAMENTE VINCULADAS CON LOS TACHIRENSES DEBIDO A LAS ACTIVIDADES QUE ALLí SON DESARROLLADAS TALES COMO EDIFICIOS PúBLICOS, CENTROS RELIGIOSOS, CENTROS DE ESPECTáCULOS Y DEPORTIVOS.\n\nEL ATENEO DEL TáCHIRA ES EL MáS ANTIGUO DE VENEZUELA, APARTE DE SER EL PRIMER CENTRO CULTURAL ERIGIDO EN LA MENCIONADA ENTIDAD. SU FUNDACIóN FUE LLEVADA A CABO EL 19 DE ABRIL DE 1907, AUNQUE LA CONSTRUCCIóN QUE HOY LUCE FUE INICIADA EN 1935. SE UBICA EN LA CALLE 9 CON CARRERA 6\n	1177300	SUROESTE	LIMITA AL NORTE CON EL ESTADO ZULIA, AL ESTE CON LOS ESTADOS MéRIDA Y BARINAS, AL SUR CON APURE Y BARINAS Y AL OESTE CON COLOMBIA	11100 KM2
1	1	DISTRITO FEDERAL	EN VENEZUELA, EL DISTRITO CAPITAL, ANTIGUAMENTE LLAMADO DISTRITO FEDERAL, SE ENCUENTRA EN EL CENTRO NORTE DEL PAíS Y CONTIENE LA PARTE OCCIDENTAL DEL DISTRITO METROPOLITANO DE CARACAS Y ES EL ASIENTO DE LOS PODERES PúBLICOS NACIONALES.\n\nESTá UBICADO EN UNO DE LOS PRINCIPALES VALLES DE LA CORDILLERA CENTRAL, MUY CERCA DE LAS COSTAS DEL MAR CARIBE. SE ENCUENTRA SEPARADO DE éSTAS POR EL CERRO EL ÁVILA CUYA ALTURA SE ELEVA A LOS 2.600 M.\n\nEN LA VENIDERA REFORMA CONSTITUCIONAL SE PODRíA DETERMINAR EL REGRESO DE LA ANTIGUA PERO DE UNA MANERA RENOVADA LA DIVISIóN POLíTICA DEL DISTRITO FEDERAL COMO ASCIENTO DEL PODER NACIONAL \n\nECONOMíA \n\nRECURSOS ECONóMICOS \n\nAGRíCOLAS: APIO, CAFé, CAMBUR, OCUMO Y YUCA. CRíA: AVíCOLA, BOVINO, PORCINO. PESCA: ATúN, CABAñA, CARITE, CAZóN Y PARGO. LANGOSTA. CALAMAR Y PULPO. RECURSOS FORESTALES: ACEITUNO, ARAGUANEY, CAOBA, CEIBA, CUJí, JOBO, MAHOMO. RECURSOS MINERALES: CALIZA Y CALIZAS MARMóREAS.\n\nACTIVIDADES ECONóMICAS \n\nLA CIUDAD DE CARACAS AL SER LA CAPITAL CONSTITUCIONAL DE VENEZUELA CONCENTRA LAS ACTIVIDADES ECONóMICAS QUE DERIVAN AL. CONCENTRARSE EN SU CASCO HISTóRICO CENTRAL LAS FUNCIONES BáSICAS DE LOS PODERES EJECUTIVO, LEGISLATIVO Y JUDICIAL DE LA NACIóN, A LOS QUE SE AGREGAN IMPORTANTES ACTIVIDADES EDUCACIONALES, BANCARIAS, COMERCIALES, INDUSTRIALES Y DE TODO TIPO DE SERVICIOS.\n\nUN ALTO PORCENTAJE DE SU POBLACIóN ACTIVA TRABAJA EN ACTIVIDADES DEL SECTOR PúBLICO, AL SER ASIENTO PERMANENTE DE LA PRESIDENCIA DE LA REPúBLICA, DE LA TOTALIDAD DE LOS MINISTERIOS Y ENTES ESTATALES, DE LA ASAMBLEA NACIONAL, DEL TRIBUNAL SUPREMO DE JUSTICIA, ASí COMO DEL CONTRALOR GENERAL, DEL FISCAL GENERAL, DEL PROCURADOR GENERAL DE LA REPúBLICA, ADEMáS AQUí TIENE SU SEDE EL ESTADO MAYOR CONJUNTO DE LA FUERZA ARMADA NACIONAL Y DIVERSAS INSTITUCIONES DEL EJéRCITO, MARINA, FUERZA AéREA Y GUARDIA NACIONAL.\n\nOTRO TIPO DE ACTIVIDADES SE GENERAN POR SER CARACAS LA METRóPOLI FINANCIERA NACIONAL CON LA SEDE DEL BANCO CENTRAL DE VENEZUELA, BOLSA DE VALORES, SEDE DE LA MAYORíA DE LAS CASAS MATRICES DE LOS BANCOS NACIONALES, INSTITUCIONALES FINANCIERAS, DE SEGUROS Y CAJAS DE AHORRO Y PRéSTAMO DEL PAíS. UN NúMERO GRANDE DE TRABAJADORES DE LA INDUSTRIA CULTURAL SE ENCUENTRA EN CARACAS POR SER ASIENTO DE LAS INSTITUCIONES DE MAYOR INFLUENCIA CULTURAL NACIONAL, COMO LA UNIVERSIDAD CENTRAL DE VENEZUELA, UNIVERSIDAD SIMóN BOLíVAR, UNIVERSIDAD CATóLICA ANDRéS BELLO, UNIVERSIDAD NACIONAL EXPERIMENTAL SIMóN RODRíGUEZ, UNIVERSIDAD PEDAGóGICA EXPERIMENTAL LIBERTADOR Y VARIAS OTRAS UNIVERSIDADES PRIVADAS, ACADEMIAS NACIONALES, COLEGIOS PROFESIONALES, CANALES TELEVISIVOS, PERIóDICOS DE CIRCULACIóN NACIONAL, EDITORAS. ASIMISMO LAS MANUFACTURAS INDUSTRIALES MANTIENEN UNA GRAN SIGNIFICACIóN POR SU ALTO VOLUMEN DE PRODUCCIóN, COMO TAMBIéN LAS ACTIVIDADES COMERCIALES MAYORISTAS, MINORISTAS E INFORMALES.	ECONOMíA\n\nRECURSOS ECONóMICOS \n\nAGRíCOLAS: APIO, CAFé, CAMBUR, OCUMO Y YUCA. CRíA: AVíCOLA, BOVINO, PORCINO. PESCA: ATúN, CABAñA, CARITE, CAZóN Y PARGO. LANGOSTA. CALAMAR Y PULPO. RECURSOS FORESTALES: ACEITUNO, ARAGUANEY, CAOBA, CEIBA, CUJí, JOBO, MAHOMO. RECURSOS MINERALES: CALIZA Y CALIZAS MARMóREAS.\n\nACTIVIDADES ECONóMICAS \n\nLA CIUDAD DE CARACAS AL SER LA CAPITAL CONSTITUCIONAL DE VENEZUELA CONCENTRA LAS ACTIVIDADES ECONóMICAS QUE DERIVAN AL. CONCENTRARSE EN SU CASCO HISTóRICO CENTRAL LAS FUNCIONES BáSICAS DE LOS PODERES EJECUTIVO, LEGISLATIVO Y JUDICIAL DE LA NACIóN, A LOS QUE SE AGREGAN IMPORTANTES ACTIVIDADES EDUCACIONALES, BANCARIAS, COMERCIALES, INDUSTRIALES Y DE TODO TIPO DE SERVICIOS.\n\nUN ALTO PORCENTAJE DE SU POBLACIóN ACTIVA TRABAJA EN ACTIVIDADES DEL SECTOR PúBLICO, AL SER ASIENTO PERMANENTE DE LA PRESIDENCIA DE LA REPúBLICA, DE LA TOTALIDAD DE LOS MINISTERIOS Y ENTES ESTATALES, DE LA ASAMBLEA NACIONAL, DEL TRIBUNAL SUPREMO DE JUSTICIA, ASí COMO DEL CONTRALOR GENERAL, DEL FISCAL GENERAL, DEL PROCURADOR GENERAL DE LA REPúBLICA, ADEMáS AQUí TIENE SU SEDE EL ESTADO MAYOR CONJUNTO DE LA FU