1	13	LARA	Lara es uno de los 23 estados de Venezuela. Su capital es Barquisimeto. El estado Lara tiene una superficie total de 19.800 km² y una población estimada (2007) de 1.795.100 habitantes.\n\nPredominan dos tipos de clima en el estado Lara: el tropical, seco y muy seco, y el premontano, también seco y muy seco, seguidos por el premontano húmedo. Los climas montano bajo húmedo y paramero húmedo corresponden apenas un 4,8% del área estadal. La sequedad del ambiente es típica, ya que la evaporación supera a las precipitaciones; éstas alcanzan 650 mm de promedio anual, con lluvias que caen en épocas diferentes de acuerdo con el lugar.\n\nLa temperatura media anual fluctúa entre 22 y 28ºc, con un promedio de 23,8ºc en Barquisimeto\n\n\nLa agricultura y la actividad comercial se ubican como las principales actividades económicas de la región. Lara es líder en la producción de piñas, sisal, pimentón, y cebolla; mientras que el cultivo de caña de azúcar lo ha convertido en uno de los principales y primeros estados azucareros del país. Igualmente produce café, papa, tomates, caraotas, maíz, y cambur. También la uva tiene su espacio y con ella la pujante industria del vino. Tiene una importante actividad ganadera de bovinos, porcinos, caprinos, ovinos, y aves con una buena industria quesera y lechera.\n\nCuenta también con importantes zonas industriales y capacidad de producción. Posee gran riqueza artesanal y un potencial desarrollo turístico, con bellezas naturales, y manifestaciones folklóricas y culturales.\n\nEntre los sectores industriales más importantes en el estado Lara destacan el sector metalmecánico, agroindustrial, confección de prendas de vestir, imprentas y elaboración de textiles (a base de fibra de sisal). El estado Lara sustenta su sector manufacturero en la pequeña y mediana industria, ya que, a excepción de sus centrales azucareros, prácticamente todo su parque industrial consiste en empresas de menos de doscientos trabajadores.\n\nRecursos económicos \n\n    * Ganadería: Bovinos, porcinos, caprinos, ovinos y aves.\n\n    * Productos Agrícolas: Papas, cambur, sisal, cebolla, tomate, uvas, caña de azúcar, caraotas, piña y café.\n\n    * Recursos Forestales: Cují, indio desnudo, jabillo, jobo, olivo, semeruco y vera.\n\n    * Recursos Minerales: Arcillas refractarias, arenas silícicas, caliza hierro, mercurio, pirro filitas\n\n1.556.415 habitantes para el año 2001. Los índices de población de Lara han sido durante los últimos 30 años muy superiores al promedio nacional. Más del 50% de la población se concentra en la capital (Barquisimeto) en donde se localizan las principales actividades comerciales, financieras e industriales. No obstante el dinamismo que ha alcanzado, coloca a la entidad como una de las más importantes receptoras de corrientes migratorias del país, que también ha alcanzado llegar a centros urbanos como: Carora, Quibor, El Tocuyo, Cubiro, Cabudare y Duaca; los cuales fundamentan la economía en actividades agrícolas.	La agricultura y la actividad comercial se ubican como las principales actividades económicas de la región. Lara es líder en la producción de piñas, sisal, pimentón, y cebolla; mientras que el cultivo de caña de azúcar lo ha convertido en uno de los principales y primeros estados azucareros del país. Igualmente produce café, papa, tomates, caraotas, maíz, y cambur. También la uva tiene su espacio y con ella la pujante industria del vino. Tiene una importante actividad ganadera de bovinos, porcinos, caprinos, ovinos, y aves con una buena industria quesera y lechera.\n\nCuenta también con importantes zonas industriales y capacidad de producción. Posee gran riqueza artesanal y un potencial desarrollo turístico, con bellezas naturales, y manifestaciones folklóricas y culturales.\n\nEntre los sectores industriales más importantes en el estado Lara destacan el sector metalmecánico, agroindustrial, confección de prendas de vestir, imprentas y elaboración de textiles (a base de fibra de sisa