1	14	MERIDA	El estado Mérida de Venezuela se encuentra en la región andina, al oeste del país. Ubicado dentro de la Cordillera Andina se localizan los 10 picos más altos del país, incluido el pico Bolívar que alcanza los 4.986 M.s.n.m. Su capital, la ciudad de Mérida, es un importante centro estudiantil y turístico nacional ubicada en el centro del estado entre la Sierra Nevada y la Sierra La Culata a una altura de 1.630 msnm.\n\nSu economía incluye actividades turísticas, agropecuarias y mineras. Además es hogar de la Universidad de Los Andes ULA\n\n\nLa economía del estado está basada en la agricultura, la ganadería y el turismo. En las zonas altas del páramo emeritense se cosecha cerca del 60% de la producción de papa del país además de otras legumbres y vegetales.\n\nRecursos económicos \n\n    * Cría: Avícola, bovino, ovino y porcino.\n\n    * Pesca: Trucha (cultivo en ríos.) curbina (lacustre) cangrejo (crustáceo.)\n\n    * Productos Agrícolas: ajo, apio, caraota, cacao, café, yuca, plátano,\n\nzanahoria.\n\n    * Recursos Forestales: Cedro, comino, jabillo, lacre, mijao, pardillo, saisai, entre otros.\n\n    * Recursos Minerales: Carbón, feldespato, fosfato, granito, plomo y zinc.\n\n\nlimites\n\nnorte limita con los estados trujillo y zulia\nsur limita con los estados barinas y tachira\neste limita con el estado barinas\noeste limita con los estados tachira zulia 	La economía del estado está basada en la agricultura, la ganadería y el turismo. En las zonas altas del páramo emeritense se cosecha cerca del 60% de la producción de papa del país además de otras legumbres y vegetales.\n\nRecursos económicos \n\n    * Cría: Avícola, bovino, ovino y porcino.\n\n    * Pesca: Trucha (cultivo en ríos.) curbina (lacustre) cangrejo (crustáceo.)\n\n    * Productos Agrícolas: ajo, apio, caraota, cacao, café, yuca, plátano,\n\nzanahoria.\n\n    * Recursos Forestales: Cedro, comino, jabillo, lacre, mijao, pardillo, saisai, entre otros.\n\n    * Recursos Minerales: Carbón, f