1	15	MIRANDA	El Estado Miranda está situado en la zona Litoral Central de Venezuela y constituye uno de los veintitrés Estados de la República Bolivariana de Venezuela. Forma parte de la denominada Región Capital junto con el Distrito Capital y el Estado Vargas, también limita con los estados Anzoátegui por el oeste, Aragua y Caracas por el este, Guárico por el sur, el Mar Caribe y Vargas por el norte . Debe su nombre al prócer de la independencia, el Generalísimo Francisco de Miranda, hombre universal que luchó en pro de la libertad de Venezuela y América. Su capital es la ciudad de Los Teques. Otras poblaciones importantes son la zona del Este de Caracas que pertenece por completo al Estado Miranda, Petare, Baruta, Chacao, Mariche, Charallave, Cúa, Higuerote, Río Chico, Guatire y Guarenas. Tiene una economía totalmente distribuida entre la industria, el comercio, la agricultura y el turismo.\n\nEl idioma predominante es el español, menos del 1% de los mirandinos hablan otros idiomas como idiomas de otro países o indígenas. La creencia mirandina ronda en más del 90% de católicos, el resto son judíos, musulmanes, budistas, entre otros, o grupos de no creyentes como los ateos. Miranda es el segundo Estado de Venezuela con más población, luego del Estado Zulia, ya que gran parte de Caracas se encuentra en Miranda; además el Estado Miranda es el más importante después del Zulia en la economía venezolana. Éste Estado cubre 7.950 Km², es uno de los estados más pequeños, más uno de los más poblados. Miranda contiene grandes monumentos naturales y culturales, como varias de las iglesias.\n\nEl gobierno mirandino dirigido por Diosdado Cabello ha emprendido una serie de reformas entre las que destaca el cambio de la bandera y escudo de Miranda además del nombre oficial agregando la palabra Bolivariano al Estado. En 2007 la gobernación expropió un aeropuerto, denominado Caracas, ubicado en los Valles del Tuy, han tratado resolver el asunto con los dueños de éste ex-aeropuerto privado, más aún no los convencen a todos. Se espera que este aeropuerto ayude al aeropuerto de Maiquetía en el Estado Vargas en el tráfico aéreo, a pesar de las critícas que recibe la idea por lo pequeño que es el aeropuerto para ciertos aviones comerciales. Miranda tendrá un nuevo aeropuerto próximamente, supuestamente el más grande de Venezuela según fuentes gubernamentales.\n\nEn transporte, el Estado Miranda tiene un tren de Caracas al Tuy medio, es decir Cúa-Caracas, próximamente éste tren se expandirá. Los Teques, la capital de Miranda, recién en 2006 inauguró su propio metro, el Metro de Los Teques, el cual tiene pensado una próxima línea para el 2010, y éste metro está conectado a Caracas mediante la línea 1 de Los Adjuntas y la línea 2 del Metro de Caracas. Además el Estado Miranda cuenta con la Linea 1 del Metro de Caracas, desde Chacaito hasta Palo Verde en Petare y pronto contará con varias lineas en el Municipio Baruta. Las autopistas, recientemente se han comenzado a re-pavimentar, aunque cuenta con las principales vías de acceso en Caracas, como la Francisco Fajardo, la Prados del Este y la Cota Mil, tiene varias carreteras que conectan a Miranda completa y los estados de alrededor y toda Venezuela. Tiene varios canales de televisión regionales, además del canal del Estado venezolano, Venezolana de Televisión pero en Miranda también se transmiten otros canales de otros estados o nacionales como RCTV, Venevisión, aunque también tiene estaciones de radio propias a nivel regional como 92.9 FM y otra a nivel nacional La Mega 107.3 FM, además tiene su propios periódicos ó diarios regionales y nacionales como El Nacional y diario Avance de Los Teques y La Región que cubre los altos Mirandinos, el área metropolitana, guarenas y guatire.\n\nLa cultura es muy religiosa, una de las tradiciones más católicas y conocidas de Miranda son los Diablos Danzantes de Yare. En el estado Miranda quedan varias industrias internacionales que se distribuyen desde ahí a toda Venezuela.\n\nEl Estado Miranda comprende 21 municipios y 53 parroquias de acuerdo a la constitución regional y nacional.	El Estado Miranda se basa principalmente en actividades industriales y agricultura, ejemplos son las zonas industriales del municipio sucre y la capital mirandina de Los Teques y las haciendas y otras zonas de agricultura del municipio El Hatillo, aunque también existen otras economías menores como el turismo y ventas de artículos como recuerdos u otras cosas.\n\nRecursos económicos \n\nProductos Agropecuarios: Cacao, frutas, flores, hortalizas, cereales. Productos Alimenticios y Manufacturados: Bebidas alcohólicas y gaseosas, artes gráficas, tejidos, calzado, embotelladoras de agua mineral. Productos Industriales: Productos metalmecánicos, químicos. Recursos Forestales: Apamate, escobo, guamo, hicaco, jabillo, jobo, tabaco. Recursos Minerales: Arcilla, Caliza y calizas marmóreas.	2857900	norte	limita con los estados Anzoátegui por el oeste, Aragua y Caracas por el este, Guárico por el sur, el Mar Caribe y Vargas por el norte 	7950 km2
1	12	GUARICO	GUáRICO ES UNO DE LOS 23 ESTADOS DE VENEZUELA, EL CUARTO MáS EXTENSO DEL PAíS, CON UNA POBLACION QUE BORDEA LOS 800.000 HABITANTES (SEGúN ESTIMACIONES PARA EL AñO 2006). LA ENTIDAD, LOCALIZABLE EN LA REGIóN DE LOS LLANOS CENTRALES, LIMITA AL NORTE CON LOS ESTADOS CARABOBO, ARAGUA Y ESTADO MIRANDA, AL SUR CON APURE Y BOLíVAR, AL OESTE CON COJEDES Y BARINAS Y AL ESTE CON ANZOáTEGUI.\n\nSU MAYOR CIUDAD VALLE DE LA PASCUA CON 293.000 HABITANTES.\n\nSU GEOGRAFíA ESTá FORMADA POR UNA FRANJA MONTAñOSA AL NORTE, MIENTRAS QUE EL RESTO ESTá OCUPADO POR LOS LLANOS QUE SE PROLONGAN POR EL SUR Y SE ENCUENTRAN CON EL RíO ORINOCO.\n\nEL NOMBRE Y LíMITES ACTUALES DE LA PROVINCIA SON RESULTADO DE LA ORGANIZACIóN POLíTICA DEFINIDA EN LA LEY DE DIVISIóN POLíTICO TERRITORIAL DEL 28 DE ABRIL DE 1856. EL NOMBRE PROVIENE DEL RíO GUáRICO, QUE EN EL DIALECTO CARIBE SIGNIFICA CACIQUE.\n\nEL ESTADO GUáRICO ES PRáCTICAMENTE LA PUERTA DE ENTRADA A LOS LLANOS CENTRALES,FORMA UNA FIGURA QUE PARECE UNA ESPACIE DE CORAZóN ADEMAS DE QUE OCUPA LA REGIóN DE LOS LLANOS DEL CENTRO DE LA REPúBLICA Y TOMA SU NOMBRE DEL RíO PRINCIPAL QUE ESTá UBICADO A LO LARGO DE SU TERRITORIO. SAN JUAN DE LOS MORROS ES LA CAPITAL DE GUáRICO DESDE FEBRERO DE 1934 Y EMPEZó A POBLARSE A PARTIR DEL SIGLO XVI, CUANDO ERA UNA PARROQUIA ECLESIáSTICA LEVANTADA EN HOMENAJE A SAN JUAN BAUTISTA. EL PAISAJE DE SABANA DE SAN JUAN DE LOS MORROS CONSTITUYE EL PORTAL DE ENTRADA A LOS LLANOS VENEZOLANOS. LOS PEñASCOS ESCARPADOS CONOCIDOS COMO LOS MORROS DE SAN JUAN, SON EL SELLO QUE IDENTIFICA A ESTE ESTADO. LAS AGUAS TERMALES, POSEEDORAS DE UN ALTO CONTENIDO DE SULFATO, SON MUY CONOCIDAS POR SUS PODERES CURATIVOS, RAZóN POR LA QUE SUELEN SER UN CENTRO DE VISITA CONTINUO ENTRE LOS TURISTAS, JUNTO A LOS DIVERSOS PARQUES Y CARACTERíSTICOS DE ESTA REGIóN.\n\n\nUBICADAS A LO LARGO Y ANCHO DE TODO EL TERRITORIO DEL ESTADO GUáRICO, EXISTEN OTRAS ZONAS URBANíSTICAS Y COMERCIALES INTERESANTES PARA VISITAR POR SU GRAN ATRACTIVO TURíSTICO, BASADO EN LA ARQUITECTURA, LA RELIGIóN Y LA HISTORIA, COMO POR EJEMPLO:\n\n    * VALLE DE LA PASCUA\n\n    * SAN JUAN DE LOS MORROS\n\n    * CALABOZO\n\n    * ENTRE OTROS.\n\nLAS CUATRO ACTIVIDADES QUE SUSTENTAN EL DESARROLLO ECONóMICO DE LA REGIóN ESTáN REPRESENTADAS POR LA GANADERíA, LOS RECURSOS HIDROGRáFICOS, LA AGRICULTURA Y LA EXPLOTACIóN PETROLERA, AUNQUE LA ACTIVIDAD AGROPECUARIA ES LA PRINCIPAL DE ESTE ESTADO. EL GANADO VACUNO, EQUINO, PORCINO Y CAPRINO RINDE FRUTOS PARA LA PRODUCCIóN DE LECHE Y QUESOS. LA ACTIVIDAD PETROLERA, EL CEMENTO Y EL GAS NATURAL OSTENTAN, COMO EN MUCHAS REGIONES DEL PAíS, LA BATUTA DE INGRESO DE DIVISAS. EN EL CAMPO AGRíCOLA SOBRESALE LA PRODUCCIóN DE ARROZ, PATILLA, TABACO, ALGODóN, YUCA, FRIJOLES, MAíZ Y TOMATE.\n\nLOS 16 EMBALSES DE LA REGIóN Y LOS RíOS GUáRICO, ORITUCO Y TIZNADOS, PERMITEN EL DESARROLLO DEL VALIOSO SECTOR HIDROGRáFICO. EN LA ZONA INDUSTRIAL DE SAN JUAN SE HAN INSTALADO EMPRESAS PROCESADORAS Y EMPACADORAS DE ARROZ, DE PRODUCTOS LáCTEOS E INDUSTRIAS TRADICIONALES COMO LA DE ALIMENTOS, BEBIDAS, CALZADOS, VESTIDOS, ENTRE OTRAS.\n\n\nBAñOS TERMALES DE SAN JUAN, ESTADO GUáRICO\nBAñOS TERMALES DE SAN JUAN, ESTADO GUáRICO\n\nEN VENEZUELA A PARTIR DEL SIGLO XVI, VIAJEROS Y NATURALISTAS COMO ALEJANDRO DE HUMBOLDT Y JEAN-BAPTISTE BOUSSINGAULT, COMENZARON A INTERESARSE Y ESTUDIAR LAS SORPRENDENTES FORMACIONES NATURALES COMO LAS AGUAS TERMALES Y LOS MORROS.\n\nOTRAS POBLACIONES [EDITAR]\n\n    * EL SOMBRERO.\n\n    * ZARAZA.\n\n    * ALTAGRACIA.\n\n    * CHAGUARAMAS.\n\n    * CABRUTA.\n\n    * LAS MERCEDES DEL LLANO.\n\n    * TUCUPIDO\n\n    * SAN JUAN DE LO MORROS.\n\n    * ENTRE OTRAS\n	LAS CUATRO ACTIVIDADES QUE SUSTENTAN EL DESARROLLO ECONóMICO DE LA REGIóN ESTáN REPRESENTADAS POR LA GANADERíA, LOS RECURSOS HIDROGRáFICOS, LA AGRICULTURA Y LA EXPLOTACIóN PETROLERA, AUNQUE LA ACTIVIDAD AGROPECUARIA ES LA PRINCIPAL DE ESTE ESTADO. EL GANADO VACUNO, EQUINO, PORCINO Y CAPRINO RINDE FRUTOS PARA LA PRODUCCIóN DE LECHE Y 