1	21	TRUJILLO	EL ESTADO TRUJILLO ES UNO DE LOS 23 ESTADOS FEDERALES DE VENEZUELA, éSTE SE UBICA AL OESTE DE ESTE PAíS EN LA REGION ANDINA. SU CAPITAL ES TRUJILLO. EL ESTADO SE DIVIDE EN 20 MUNICIPIOS Y 93 PARROQUIAS, ESTO LO HACE COMO UNO DE LOS ESTADOS MáS DIVIDIDOS POLíTICAMENTE EN VENEZUELA.\n\nA CONTINUACIóN VERá LOS DETALLES ECONóMICOS DEL ESTADO:\n\nRECURSOS ECONóMICOS \n\nEL ESTADO SE BASA EN LA ECONOMíA AGRíCOLA Y ENTRE OTRAS TENEMOS:\n\n    * CRíA: AVíCOLA, ACUíCOLA, BOVINO, OVINO Y PORCINO.\n\n    * PESCA: CAZóN, LISA, RAYA, RóBALO Y CANGREJO.\n\n    * PRODUCTOS AGRíCOLAS: CAFé, CAMBUR, CAñA DE AZúCAR, MAíZ, PAPA, PLáTANO, REMOLACHA, YUCA Y CHAMPIñóN, DE ESTE úLTIMO SE PRODUCEN ACTUALMENTE 40.000 KG EN BOCONó. ES DE SIGNIFICAR ASIMISMO QUE EN EL áREA ACUíCOLA EXISTE UN CRECIENTE DESARROLLO QUE ESTá SUSTENTADO POR MáS DE DIEZ (10) UNIDADES DE PRODUCCIóN PISCíCOLAS, QUE MANTIENEN CONSIDERABLES NIVELES DE PRODUCCIóN DE TRUCHAS EN EL MUNICIPIO BOCONó (50 000 KG/AñO); TILAPIAS EN EL SECTOR EL JAGUITO DEL MUNICIPIO ANDRES BELLO (100 000 KG/AñO) Y LA PLANTA DE REPRODUCCIóN ARTIFICIAL UBICADA EN EL PáRAMO EL CORAZóN, SECTOR \\"EL RIECITO\\" (MUNICIPIO TRUJLLO), CUYA PRODUCCIóN DE ALEVINES DE TRUCHAS, SE APROXIMA A LOS 300 000 UNIDADES/AñO.\n\n    * RECURSOS FORESTALES: ALGARROBO, APAMATE, GATEADO, JABILLO, JOBO, ROBLE, VERA, ENTRE OTROS.\n\n    * RECURSOS MINERALES: ARENAS SILíCEAS, CALIZA, FELDESPATO, GRANITO Y MICA.\n\nEL ESTADO TRUJILLO ES EL MáS PEQUEñO DE LOS ESTADOS ANDINOS, Y EL DE MENOR POBLACIóN ABSOLUTA TAMBIéN, AUNQUE SU DENSIDAD ES MAYOR QUE LA DEL ESTADO MéRIDA. SE ENCUENTRA UBICADO EN EL OCCIDENTE VENEZOLANO.\n\nAS FRONTERAS DEL ESTADO TRUJILLO SON:\n\n    * POR EL NORTE, LIMITA CON LOS ESTADOS ZULIA Y LARA.\n    * POR EL SUR, LIMITA CON LOS ESTADOS MéRIDA Y BARINAS.\n    * POR EL ESTE, LIMITA CON EL ESTADO PORTUGUESA.\n    * POR EL OESTE,LMITA Y TIENE COSTAS EN EL LAGO DE MARACAIBO.\n\nEL RELIEVE ES ACCIDENTADO POR ENCONTRARSE EN LA CORDILLERA ANDINA VENEZOLANA (SIERRA DE MéRIDA), QUE FORMA PARTE DE LA GRAN CORDILLERA DE LOS ANDES AUNQUE POSEE UNA VASTA REGIóN LLANA EN LA DEPRESIóN DEL LAGO DE MARACAIBO.\n\nEL CLIMA ES TROPICAL DE MONTAñA, Y LA TEMPERATURA SE PUEDE UBICAR ENTRE 20º Y 10ºC APROXIMADAMENTE. AUNQUE EXISTEN ZONAS COMO EL SECTOR DE MONAY EN EL CUAL LA TEMPERATURA PUEDE ASCENDER A UNOS 35 GRADOS CENTíGRADOS Y EN SECTORES DE PáRAMO COMO ES EL CASO DEL ÁREA DEL RIECITO EN LA INTERSECCIóN LIMíTROFE DE LOS MUNICIPIOS URDANETA, BOCONò Y TRUJILLO, DONDE LA TEMPERATURA BAJA PROMEDIO, ES DE 4 GRADOS CENTìGRADOS.	RECURSOS ECONóMICOS \n\nEL ESTADO SE BASA EN LA ECONOMíA AGRíCOLA Y ENTRE OTRAS TENEMOS:\n\n    * CRíA: AVíCOLA, ACUíCOLA, BOVINO, OVINO Y PORCINO.\n\n    * PESCA: CAZóN, LISA, RAYA, RóBALO Y CANGREJO.\n\n    * PRODUCTOS AGRíCOLAS: CAFé, CAMBUR, CAñA DE AZúCAR, MAíZ, PAPA, PLáTANO, REMOLACHA, YUCA Y CHAMPIñóN, DE ESTE úLTIMO SE PRODUCEN ACTUALMENTE 40.000 KG EN BOCONó. ES DE SIGNIFICAR ASIMISMO QUE EN EL áREA ACUíCOLA EXISTE UN CRECIENTE DESARROLLO QUE ESTá SUSTENTADO POR MáS DE DIEZ (10) UNIDADES DE PRODUCCIóN PISCíCOLAS, QUE MANTIENEN CONSIDERABLES NIVELES DE PRODUCCIóN DE TRUCHAS EN EL MUNICIPIO BOCONó (50 000 KG/AñO); TILAPIAS EN EL SECTOR EL JAGUITO DEL MUNICIPIO ANDRES BELLO (100 000 KG/AñO) Y LA PLANTA DE REPRODUCCIóN ARTIFICIAL UBICADA EN EL PáRAMO EL CORAZóN, SECTOR \\"EL RIECITO\\" (MUNICIPIO TRUJLLO), CUYA PRODUCCIóN DE ALEVINES DE TRUCHAS, SE APROXIMA A LOS 300 000 UNIDADES/AñO.\n\n    * RECURSOS FORESTALES: ALGARROBO, APAMATE, GATEADO, JABILLO, JOBO, ROBLE, VERA, ENTRE OTROS.\n\n    * RECURSOS MINERALES: ARENAS SILíCEAS, CALIZA, FELDESPATO, GRANITO Y MICA.\n	711400	OESTE	LIMITES:\n\n    * POR EL NORTE, LIMITA CON LOS ESTADOS ZULIA Y LARA.\n    * POR EL SUR, LIMITA CON LOS ESTADOS MéRIDA Y BARINAS.\n    * POR EL ESTE, LIMITA CON EL ESTADO PORTUGUESA.\n    * POR EL OESTE,LMITA Y TIENE COSTAS EN EL LAGO DE MARACAIBO.\n	7400 KM2
1	5	ARAGUA	EL ESTADO ARAGUA ESTá LOCALIZADO EN EL NORTE CENTRAL DE VENEZUELA. LIMITA AL NORTE CON EL MAR CARIBE, AL ESTE CON LOS ESTADOS MIRANDA Y VARGAS, MIENTRAS QUE LA PARTE SUR DEL ESTADO ESTá INCRUSTADA EN EL ESTADO GUáRICO Y AL OESTE LIMITA CON EL ESTADO CARABOBO. EL NOMBRE DE ESTE ESTADO ES UN VOCABLO INDíGENA DE ORIGEN CUMANAGOTO (CARIBE), CON QUE SE DENOMINA AL CHAGUARAMO, PALMA DE TRONCO HINCHADO Y DE TIPO ORNAMENTAL TíPICA DE VENEZUELA.\n\nENTRE LAS PRINCIPALES ATRACCIONES TURíSTICAS SE ENCUENTRAN SUS LLANURAS Y SELVAS ADEMáS DE ATRACTIVAS PLAYAS CARIBEñAS. LAS MáS POPULARES SON CATA Y CHORONI, EL PARQUE NACIONAL \\\\\\"HENRY PITTIER\\\\\\" Y LA COLONIA TOVAR.\n\n\n ECONOMíA \n\nEL VALLE DE ARAGUA ES UNA DE LAS ZONAS AGRíCOLAS MáS PRODUCTIVAS DE VENEZUELA, EN ELLA SE UTILIZAN LAS TéCNICAS AGRONóMICAS MáS AVANZADAS. SOBRESALEN EL CULTIVO DE MAíZ, QUE OCUPA EL MAYOR NúMERO DE HECTáREAS, Y LA DE CAñA DE AZúCAR Y ALGODóN, QUE HAN ESTIMULADO LA INSTALACIóN INDUSTRIAS TEXTILES, CENTRALES AZUCARERAS Y PLANTAS PROCESADORAS DE ALIMENTOS, DE GRAN CAPACIDAD DE PRODUCCIóN, TANTO EN MARACAY COMO EN EL áREA DE INFLUENCIA DE LA VICTORIA.\n\nCUENTA CON BUENOS PASTOS ARTIFICIALES, EN LOS CUALES SE LLEVA A CABO EL PROCESO DE ENGORDE DEL GANADO VACUNO PROCEDENTE DE LOS LLANOS DESTINADO A ABASTECER LA DEMANDA DE LOS NúCLEOS URBANOS DEL VALLE. LA EXPLOTACIóN DEL GANADO PORCINO ES MUY INTENSA Y LO MISMO SE PUEDE AFIRMAR DE LAS AVES DE CORRAL, QUE SON UNA BASE IMPORTANTE DEL ABASTECIMIENTO DE LA POBLACIóN DEL ESTADO.\n\nA LAS ACTIVIDADES TRADICIONALES AGRíCOLAS Y GANADERAS DEL ESTADO CABE AñADIR LAS INDUSTRIALES, QUE HAN EXPERIMENTADO UN NOTABLE INCREMENTO A PARTIR DE LA DéCADA DE LOS 60. ENTRE LAS PRINCIPALES INDUSTRIAS DESTACAN LAS TEXTILES, TENERíAS, CERáMICAS, DE PAPEL, PINTURAS, BARNICES, DE PRODUCTOS LáCTEOS, CONSERVAS VEGETALES, RON, ACEITES, VIDRIO Y PLáSTICOS, REUNIDAS EN SU MAYOR PARTE EN EL GRAN CINTURóN INDUSTRIAL DE MARACAY, DESDE EL QUE LOS PRODUCTOS IRRADIAN HACIA LOS DEMáS NúCLEOS URBANOS DEL VALLE. EN EL LITORAL SE HAN ESTABLECIDO CENTROS DE TURISMO, PRINCIPALMENTE EN LA HERMOSA BAHíA DE CATA, CERCA DE OCUMARE DE LA COSTA, CHORONí, ENSENADAS DE JUAN ANDRéS Y DE KUYAY Y PLAYA DE AROA.\n ECONOMíA \n\nEL VALLE DE ARAGUA ES UNA DE LAS ZONAS AGRíCOLAS MáS PRODUCTIVAS DE VENEZUELA, EN ELLA SE UTILIZAN LAS TéCNICAS AGRONóMICAS MáS AVANZADAS. SOBRESALEN EL CULTIVO DE MAíZ, QUE OCUPA EL MAYOR NúMERO DE HECTáREAS, Y LA DE CAñA DE AZúCAR Y ALGODóN, QUE HAN ESTIMULADO LA INSTALACIóN INDUSTRIAS TEXTILES, CENTRALES AZUCARERAS Y PLANTAS PROCESADORAS DE ALIMENTOS, DE GRAN CAPACIDAD DE PRODUCCIóN, TANTO EN MARACAY COMO EN EL áREA DE INFLUENCIA DE LA VICTORIA.\n\nCUENTA CON BUENOS PASTOS ARTIFICIALES, EN LOS CUALES SE LLEVA A CABO EL PROCESO DE ENGORDE DEL GANADO VACUNO PROCEDENTE DE LOS LLANOS DESTINADO A ABASTECER LA DEMANDA DE LOS NúCLEOS URBANOS DEL VALLE. LA EXPLOTACIóN DEL GANADO PORCINO ES MUY INTENSA Y LO MISMO SE PUEDE AFIRMAR DE LAS AVES DE CORRAL, QUE SON UNA BASE IMPORTANTE DEL ABASTECIMIENTO DE LA POBLACIóN DEL ESTADO.\n\nA LAS ACTIVIDADES TRADICIONALES AGRíCOLAS Y GANADERAS DEL ESTADO CABE AñADIR LAS INDUSTRIALES, QUE HAN EXPERIMENTADO UN NOTABLE INCREMENTO A PARTIR DE LA DéCADA DE LOS 60. ENTRE LAS PRINCIPALES INDUSTRIAS DESTACAN LAS TEXTILES, TENERíAS, CERáMICAS, DE PAPEL, PINTURAS, BARNICES, DE PRODUCTOS LáCTEOS, CONSERVAS VEGETALES, RON, ACEITES, VIDRIO Y PLáSTICOS, REUNIDAS EN SU MAYOR PARTE EN EL GRAN CINTURóN INDUSTRIAL DE MARACAY, DESDE EL QUE LOS PRODUCTOS IRRADIAN HACIA LOS DEMáS NúCLEOS URBANOS DEL VALLE. EN EL LITORAL SE HAN ESTABLECIDO CENTROS DE TURISMO, PRINCIPALMENTE EN LA HERMOSA BAHíA DE CATA, CERCA DE OCUMARE DE LA COSTA, CHORONí, ENSENADAS DE JUAN ANDRéS Y DE KUYAY Y PLAYA DE AROA.\n\nARAGUA, CON EL 8,28% DE LA POBLACIóN TOTAL DEL PAíS, ES UNO DE LOS ESTADOS MáS POBLADOS DE VENEZUELA.\n\nLA POBLACIóN SE ENCUENTRA EN EL LITORAL Y EN LOS VALLES BAJOS, SIENDO LOS VALLES DE ARAGUA UNA DE LAS REGIONES MáS POBLADAS DE VENEZUELA, DEBIDO AL RáPIDO PROCESO DE INDUSTRIALIZACIóN DE LA CIUDAD DE MARACAY Y SU IMPORTANTE AREA METROPOLITANA DE UNOS 2.215.000...	ECONOMíA: \n\nEL VALLE DE ARAGUA ES UNA DE LAS ZONAS AGRíCOLAS MáS PRODUCTIVAS DE VENEZUELA, EN ELLA SE UTILIZAN LAS TéCNICAS AGRONóMICAS MáS AVANZADAS. SOBRESALEN EL CULTIVO DE MAíZ, QUE OCUPA EL MAYOR NúMERO DE HECTáREAS, Y LA DE CAñA DE AZúCAR Y ALGODóN, QUE HAN ESTIMULADO LA INSTALACIóN INDUSTRIAS TEXTILES, CENTRALES AZUCARERAS Y PLANTAS PROCESADORAS DE ALIMENTOS, DE GRAN CAPACIDAD DE PRODUCCIóN, TANTO EN MARACAY COMO EN EL áREA DE INFLUENCIA DE LA VICTORIA.\n\nCUENTA CON BUENOS PASTOS ARTIFICIALES, EN LOS CUALES SE LLEVA A CABO EL PROCESO DE ENGORDE DEL GANADO VACUNO PROCEDENTE DE LOS LLANOS DESTINADO A ABASTECER LA DEMANDA DE LOS NúCLEOS URBANOS DEL VALLE. LA EXPLOTACIóN DEL GANADO PORCINO ES MUY INTENSA Y LO MISMO SE PUEDE AFIRMAR DE LAS AVES DE CORRAL, QUE SON UNA BASE IMPORTANTE DEL ABASTECIMIENTO DE LA POBLACIóN DEL ESTADO.\n\nA LAS ACTIVIDADES TRADICIONALES AGRíCOLAS Y GANADERAS DEL ESTADO CABE AñADIR LAS INDUSTRIALES, QUE HAN EXPERIMENTADO UN NOTABLE INCREMENTO A PARTIR DE LA DéCADA DE LOS 60. ENTRE LAS PRINCIPALES INDUSTRIAS DESTACAN LAS TEXTILES, TENERíAS, CERáMICAS, DE PAPEL, PINTURAS, BARNICES, DE PRODUCTOS LáCTEOS, CONSERVAS VEGETALES, RON, ACEITES, VIDRIO Y PLáSTICOS, REUNIDAS EN SU MAYOR PARTE EN EL GRAN CINTURóN INDUSTRIAL DE MARACAY, DESDE EL QUE LOS PRODUCTOS IRRADIAN HACIA LOS DEMáS NúCLEOS URBANOS DEL VALLE. EN EL LITORAL SE HAN ESTABLECIDO CENTROS DE TURISMO, PRINCIPALMENTE EN LA HERMOSA BAHíA DE CATA, CERCA DE OCUMARE DE LA COSTA, CHORONí, ENSENADAS DE JUAN ANDRéS Y DE KUYAY Y PLAYA DE AROA.	2665200	NORTE CENTRAL	LIMITA AL NORTE CON EL MAR CARIBE, AL ESTE CON LOS ESTADOS MIRANDA Y VARGAS, MIENTRAS QUE LA PARTE SUR DEL ESTADO ESTá INCRUSTADA EN EL ESTADO GUáRICO Y AL OESTE LIMITA CON EL ESTADO CARABOBO.	7014 KM2
1	18	PORTUGUESA	PORTUGUESA ES UNO DE LOS 23 ESTADOS DE VENEZUELA, UBICADO AL OCCIDENTE DE LA REPúBLICA, ES CONSIDERADA UNA DE LA REGIONES GRANERO DEL PAíS POR LA GRAN CANTIDAD DE PRODUCTOS AGRíCOLAS QUE ALLí SE OBTIENEN. EL ESTADO LIMITA AL NORTE CON EL ESTADO LARA, AL ESTE CON EL ESTADO COJEDES, AL OESTE CON EL ESTADO TRUJILLO Y AL SUR CON EL ESTADO BARINAS.\n\nSEGúN LA TRADICIóN, EN UNA PARTIDA CONQUISTADORA QUE MARCHABA HACIA LOS LLANOS, IBA UNA MUJER ORIUNDA DE PORTUGAL, QUE AL CRUZAR UN RíO SE AHOGó EN SUS AGUAS CAUDALOSAS. DESDE ENTONCES SE LE LLAMó EL \\"RíO PORTUGUESA\\" REFERENCIA ANECDóTICA QUE CON EL TIEMPO SE LEXICALIZó, SE CONTRAJO AL PARECER LA PREPOSICIóN Y EL ARTíCULO, Y SE ADOPTó COMO NOMBRE DE AQUEL RíO. LUEGO SE EXTENDIó A LA REGIóN CIRCUNVECINA, QUE HOY FORMA EL ESTADO PORTUGUESA.\n\nESTá SITUADO EN LA REGIóN CENTRO OCCIDENTAL DEL PAíS, SE EXTIENDE APROXIMADAMENTE ENTRE LOS PARALELOS 08°06 Y 09°50 DE LATITUD NORTE, Y LOS MERIDIANOS 68°30, 70°11 DE LONGITUD OESTE. EL ESTADO LIMITA AL NORTE CON EL ESTADO LARA, AL ESTE CON EL ESTADO COJEDES, AL OESTE CON EL ESTADO TRUJILLO Y AL SUR CON EL ESTADO BARINAS. POSEE UNA SUPERFICIE DE 15.200 KM² REPRESENTANDO EL 1,67% DEL TERRITORIO NACIONAL.\n\nEL ESTADO PRESENTA TRES FORMAS PRINCIPALES DE RELIEVE: LAS ESTRIBACIONES ANDINAS CON ALTERNANCIA DE TERRENOS QUEBRADOS Y VALLES MUY ESTRECHOS; EL PIEDEMONTE Y LOS ALTOS LLANOS, CORRESPONDIENDO FISIOGRáFICAMENTE A UNA GRAN PLANICIE ALUVIAL QUE EXHIBE UNA AMPLIA VARIEDAD DE SUB-PAISAJES, DONDE ALTERNAN TERRAZAS DESECTADAS CON LOS CONOS DE DEYECCIóN Y ABANICOS COLUVIO-ALUVIALES; Y POR úLTIMO, LOS BAJOS LLANOS, CON UNA ALTITUD INFERIOR A LOS 100 MSNM., DONDE PREDOMINAN LA TOPOGRAFíA PLANA DETERMINADA POR LA PRESENCIA DE áREAS INUNDABLES O BAJíOS.\n\nEL RéGIMEN DE LLUVIAS ES BASTANTE FAVORABLE A LA PARTE ALTA, OCASIONANDO REGISTROS ENTRE 1.400 Y 1.800 MM ANUALES. LA ESTACIóN LLUVIOSA ESTá COMPRENDIDA ENTRE LOS MESES DE MAYO Y OCTUBRE, SIENDO EL VERANO ENTRE DICIEMBRE Y MARZO. LA TEMPREATURA MEDIA ANUAL OSCILA ENTRE 22 A 26° C.\n\nEL SISTEMA HIDROGRáFICO ESTá FORMADO POR LOS RíOS QUE DESCIENDEN DE LAS CORDILLERAS ANDINAS Y TRIBUTAN A LA CUENCA DEL RíO ORINOCO. LOS PRINCIPALES AFLUYENTES SON EL PORTUGUESA, ACARIGUA, COJEDES, BOCONó, GUANARE, GUACHE, MORADOR Y OSPINO.\n\nLA VEGETACIóN DOMINANTE ES LA SABANA, PERO TAMBIéN SE ENCUENTRAN BOSQUES DE GALERíA A LO LARGO DE LAS CURVAS FLUVIALES, Y DENSAS SELVAS EN EL PIEDEMONTE ANDINO. ALLí ABUNDAN LAS MADERAS FINAS QUE CONSTITUYEN UNA IMPORTANTE FUENTE DE RIQUEZA, REPRESENTADAS POR EL CHAPARRO, CAOBA, SALVIO, EUCALIPTO, TECAS Y PINOS\n\nLA FAUNA ESTá REPRESENTADA POR: OSOS FRONTINOS, JAGUARES, (AMBAS ESPECIES EN RIESGO DE EXTINCIóN), CACHICAMOS, LAPAS, RABIPELADOS, MONOS ARAGUATOS, VENADOS, CUNAGUAROS, PUMAS Y OSOS MELEROS. HAY AVES COMO EL PAUJí COPETE DE PIEDRA, TUCUSITOS, CRISTOFUé Y CARDENALITOS. SE ENCUENTRA UNA DE LAS MARIPOSAS MáS GRANDES DEL MUNDO: LA THYSANIA AGRIPINA, CON 30.5 CM DE ENVERGADURA ALAR.\n\nIENE UNA POBLACIóN DE 873,375 HABITANTES, QUE REPRESENTAN EL 3.34% DEL TOTAL NACIONAL. POSEE UNA TASA DE CRECIMIENTO DEL 2,1% ANUAL, Y UNA DENSIDAD DE 57,5 HABITANTES POR KM2;\n\nDE LA POBLACIóN TOTAL 428,178 SON DEL SEXO FEMENINO Y 445,197 SON DEL SEXO MASCULINO. LA CIUDAD DE ACARIGUA EN EL NORTE, REPRESENTA LA MAYOR CONURBACIóN DEL ESTADO, SIENDO LA SEGUNDA EN IMPORTANCIA EN EL CENTRO-OCCIDENTE DEL PAíS.\n\nLA PRINCIPAL ACTIVIDAD ECONóMICA DE PORTUGUESA ES LA AGRICULTURA, SEGUIDA POR LA ACTIVIDAD PECUARIA. RECIENTEMENTE LA ACTIVIDAD TURíSTICA JUNTO CON LA EXPLOTACIóN PETROLERA ESTáN TOMANDO IMPORTANCIA EN LA ECONOMíA ESTADAL.\n\n\nEN EL ESTADO PORTUGUESA SE HAN CONSOLIDADO VARIAS SUBREGIONES AGRíCOLAS QUE LO HAN CONVERTIDO EN EL MAYOR PRODUCTOR EN EL PAíS DE DIVERSOS PRODUCTOS. ELLO SE HA VISTO FAVORECIDO POR LA CALIDAD DE LOS SUELOS, VENTAJOSAS CONDICIONES AMBIENTALES, EXTENSIóN DE LA ROTURACIóN POR MOVIMIENTOS DE COLONIZACIóN DIRIGIDA, INFRAESTRUCTURA DE RIEGO Y RED CAMINERA. EN LOS FéRTILES SUELOS DEL PIEDEMONTE Y DEL ALTO LLANO OCCIDENTAL SE HA DESARROLLADO UNA AGRICULTURA MECANIZADA Y TECNIFICADA, DESTACANDO 93.000 HECTáREAS SEMBRADAS DE ARROZ, 62.000 HECTáREAS SEMBRADAS DE MAíZ, 43.000 HECTáREAS SEMBRADAS DE CAñA DE AZúCAR, CON OTRAS VASTAS SUPERFICIES DESTINADAS AL SORGO, AJONJOLí, ALGODóN Y TABACO. EN LAS TIERRAS ALTAS DE BISCUCUY Y OTRAS VALLES ANDINOS SE DESTINAN 35.500 HECTáREAS A PLANTACIONES DE CAFé.\n\nCONTINúA EL RáPIDO DESARROLLO AGRíCOLA QUE SE INICIó EN LA DéCADA DE 1950 CON LA UNIDAD AGRíCOLA DE TURéN QUE SE EXTENDIó A OTRAS ZONAS EN AñOS POSTERIORES. LAS ZONAS DEL PROYECTO TURéN SIGUEN AMPLIáNDOSE EN VARIAS FASES, CON SANEAMIENTOS DE TIERRAS Y CONSTRUCCIóN DE DRENAJES. ASIMISMO LA FRONTERA AGRíCOLA SE BENEFICIARá CON LA HABILITACIóN DEL PROYECTO GUANARE-EMBALSE BOCONó-TUCUPIDO; LA ACTIVIDAD MADERERA ES DE GRAN IMPORTANCIA POR LA PRODUCCIóN DE MADERA EN ROLA.\n\nEN LA CIUDAD DE ACARIGUA LAS INDUSTRIAS HAN AUMENTADO, ESPECIALMENTE LA AZUCARERA, PLANTAS PROCESADORAS DE ARROZ Y UN GRAN NúMERO DE ASERRADEROS.\n\n    * RECURSOS DE LA CRíA: AVíCOLA, BOVINO Y PORCINO.\n\n    * RECURSOS PESQUEROS: BAGRE RAYADO, CAJARO, CACHAMA, COPORO, PALOMETA.\n\n    * RECURSOS AGROPECUARIOS: ARROZ, ALGODóN, MAíZ, AJONJOLí, CAñA DE AZúCAR, CARAOTA, PATILLA Y SORGO.\n\n    * RECURSOS FORESTALES: CAOBA, CEREIPO, JABILLO, MERECURE, PALMA LLANERA, PUY.\n\n    * RECURSOS MINERALES: ARENAS, CALIZA MANGANESIANA Y GRAVAS.\n\n    * ENTRE OTROS RECURSOS.\nEL TURISMO PRINCIPALMENTE ESTA UBICADO EN GUANARE Y ACARIGUA, Y EN LAS SABANAS, VALLES, U OTROS LUGARES DEL ESTADO TIENEN PONTECIAL TURíSTICO EXPLOTABLE.\n\nLA MANO DEL ARTESANO PORTUGUESEñO SE DESBORDA EN CREATIVIDAD Y SENTIMIENTO CUANDO TOMA LA PIEDRA, LA ARCILLA, EL CUERO, LA TAPARA, EL ESTROPAJO E INCLUSO TIRAS VIEJAS, Y LES Dá FORMA CON SU INGENIO Y PACIENCIA, TALLANDO EL SENTIR DEL PUEBLO. ENTRE LOS PRINCIPALES PRODUCTOS DEL RENGLóN ARTESANAL ENCONTRAMOS SILLAS DE MONTAR, CABEZALES PARA BESTIAS, TAPAOJOS, CHINCHORROS DE CUERO DE RES, INSTRUMENTOS MUSICALES (ARPAS, CUATROS Y MARACAS), VAINAS PARA MACHETES Y CUCHILLOS, ALPARGATAS Y TALLADOS DE AZABACHE, SILLAS Y MUEBLES EN GENERAL.\n\nPORTUGUESA ES UN ESTADO LLANERO POR EXCELENCIA, DONDE LAS TRADICIONES POPULARES COMO EL JOROPO,LOS CARNAVALES, LAS PELEAS DE GALLOS Y LEYENDAS COMO \\"EL SILBóN\\" SIEMPRE PERMANECEN VIVAS.\n\nLAS CELEBRACIONES LLANERAS SIEMPRE ESTáN ACOMPAñADAS DE UN BUEN PLATO DE COMIDA QUE BIEN PODRíA SER: TERNERA EN VARA CON YUCA Y GUASACACA, CABEZA DE CACHAMA, COPORO O BOCACHICO FRITO, TENIENDO EL GUARAPO DE CAñA O PAPELóN CON LIMóN COMO BEBIDA. LA COCINA PORTUGUESEñA SE CARACTERIZA POR SU SENCILLEZ Y POR REPRESENTAR EN BUENA MEDIDA LA SAZóN CRIOLLA DEL LLANO.	LA PRINCIPAL ACTIVIDAD ECONóMICA DE PORTUGUESA ES LA AGRICULTURA, SEGUIDA POR LA ACTIVIDAD PECUARIA. RECIENTEMENTE LA ACTIVIDAD TURíSTICA JUNTO CON LA EXPLOTACIóN PETROLERA ESTáN TOMANDO IMPORTANCIA EN LA ECONOMíA ESTADAL.\n\n\nEN EL ESTADO PORTUGUESA SE HAN CONSOLIDADO VARIAS SUBREGIONES AGRíCOLAS QUE LO HAN CONVERTIDO EN EL MAYOR PRODUCTOR EN EL PAíS DE DIVERSOS PRODUCTOS. ELLO SE HA VISTO FAVORECIDO POR LA CALIDAD DE LOS SUELOS, VENTAJOSAS CONDICIONES AMBIENTALES, EXTENSIóN DE LA ROTURACIóN POR MOVIMIENTOS DE COLONIZACIóN DIRIGIDA, INFRAESTRUCTURA DE RIEGO Y RED CAMINERA. EN LOS FéRTILES SUELOS DEL PIEDEMONTE Y DEL ALTO LLANO OCCIDENTAL SE HA DESARROLLADO UNA AGRICULTURA MECANIZADA Y TECNIFICADA, DESTACANDO 93.000 HECTáREAS SEMBRADAS DE ARROZ, 62.000 HECTáREAS SEMBRADAS DE MAíZ, 43.000 HECTáREAS SEMBRADAS DE CAñA DE AZúCAR, CON OTRAS VASTAS SUPERFICIES DESTINADAS AL SORGO, AJONJOLí, ALGODóN Y TABACO. EN LAS TIERRAS ALTAS DE BISCUCUY Y OTRAS VALLES ANDINOS SE DESTINAN 35.500 HECTáREAS A PLANTACIONES DE CAFé.\n\nCONTINúA EL RáPIDO DESARROLLO AGRíCOLA QUE SE INICIó EN LA DéCADA DE 1950 CON LA UNIDAD AGRíCOLA DE TURéN QUE SE EXTENDIó A OTRAS ZONAS EN AñOS POSTERIORES. LAS ZONAS DEL PROYECTO TURéN SIGUEN AMPLIáNDOSE EN VARIAS FASES, CON