1	16	MONAGAS	MONAGAS ES UN ESTADO LOCALIZADO EN LA REGIóN NORORIENTAL DE VENEZUELA, DELIMITADO POR EL ESTADO DELTA AMACURO Y EL OCéANO ATLáNTICO POR EL ESTE, BOLíVAR POR EL SUR, ANZOáTEGUI POR EL OESTE Y SUCRE AL NORTE.\n\nEL ESTADO DEBE SU NOMBRE A LA DINASTíA DE PRESIDENTES VENEZOLANOS DE APELLIDO MONAGAS: JOSé RUPERTO, JOSé TADEO Y JOSé GREGORIO, PROVENIENTES DE MATURíN, CAPITAL DE ESTE ESTADO.\n\nLA POBLACIóN ESTIMADA DE MONAGAS PARA 2007 ALCANZA LOS 855.300 HABITANTES, LO QUE LO COLOCA ENTRE LOS ESTADOS DE MAYOR POBLACIóN; SU CAPITAL Y MAYOR CIUDAD ES MATURíN. OTRAS IMPORTANTES POBLACIONES SON PUNTA DE MATA, CARIPITO, CARIPE, TEMBLADOR, QUIRIQUIRE Y URACOA.\n\nLA ECONOMíA ESTá BASADA EN LA ACTIVIDAD PETROLERA Y GASíFERA ESTABLECIDA EN EL CENTRO Y SUR DEL ESTADO, ASí COMO LA ACTIVIDAD GANADERA Y EL TURíSMO.\n\n\nLA ECONOMíA DEL ESTADO ESTá DOMINADA POR EL PRINCIPAL RECURSO ECONóMICO DE VENEZUELA, EL PETRóLEO, LA SEDE ORIENTAL DE PETRóLEOS DE VENEZUELA S. A. ESTá UBICADA EN MATURíN, EL ESTADO HA DESPLAZADO AL ESTADO ZULIA COMO PRINCIPAL RESERVORIO DE PETRóLEO E HIDROCARBUROS DEL PAíS, Y UNO DE LOS MAYORES DEL MUNDO. MONAGAS TAMBIéN PROSPERA EN LA SILVICULTURA, LA AGROINDUSTRIA Y LA GANADERíA EXTENSIVA.\n\nRECURSOS ECONóMICOS \n\n    * FORESTALES: ACEITUNO, ARAGUANEY, CEIBA, CEREIBA, CEREIPO, CUJí, JOBO Y VERA.\n\n    * MINERALES: ARENAS SILíCEAS, CALIZA, CARBóN Y PETRóLEO.\n\nACTIVIDADES ECONóMICAS \n\nLAS PRINCIPALES INDUSTRIAS DEL ESTADO SON LAS RELACIONADAS CON LA PRODUCCIóN DEL PETRóLEO Y GAS, ASí COMO LAS QUE PROCESAN LOS DERIVADOS DE ESTOS HIDROCARBUROS. EN SU TERRITORIO OPERA PARTE DEL COMPLEJO GASíFERO MáS IMPORTANTE DE VENEZUELA: EL COMPLEJO CRIOGéNICO DE ORIENTE, EN SAN JOAQUíN Y JOSE, CON SEDES EN ESTAS ENTIDAD Y EN EL ESTADO ANZOáTEGUI.\n\nEN MATERIA AGRíCOLA SON NUMEROSOS LOS RUBROS, SE COSECHA ALLí LA BATATA, LA YUCA, EL ñAME, EL MAíZ, EL ALGODóN Y LA PATILLA. LA GANADERíA (BOVINA Y PORCINA), ASí COMO LA AVICULTURA Y LA PESCA, REGISTRAN CIFRAS SIGNIFICATIVAS AL IGUAL QUE LA EXPLOTACIóN FORESTAL. EL TURISMO Y EL SECTOR DE LA CONSTRUCCIóN HAN REPUNTADO NOTORIAMENTE.\n\nEN LA GASTRONOMíA MONAGUENSE ENCONTRAMOS UNA GRAN VARIEDAD DE BEBIDAS, DULCES Y PLATOS ELABORADOS A BASE DE PESCADO Y MARISCOS, PROPIOS DE LA CULTURA ORIENTAL DEL PAíS, CON UNA FUERTE INFLUENCIA INDíGENA, AFRICANA, ESPAñOLA Y UN TOQUE APORTADO POR LAS CULTURAS áRABES E HINDúES PRESENTES EN LA REGIóN DE FORMA SIGNIFICATIVA, MANIFESTADA EN EL USO DE CURRYS Y OTROS CONDIMENTOS ASIáTICOS, Y TAMBIéN DE LA GASTRONOMíA PROPIA DE LOS PUEBLOS LLANEROS.\n\nDESTACAN EN LA DIETA DIARIA LOS PLATOS DE TRADICIóN VENEZOLANA COMO LAS EMPANADAS, LA AREPA RASPADA O PILADA, EL QUESO DE MANO, LA CACHAPA, EL MONDONGO, SANCOCHO, LA CARNE EN VARA, EL CASABE Y EL PABELLóN CRIOLLO Y OTROS TANTOS DE TRADICIóN MáS REGIONAL COMO LA FOSFORERA, EL OSSOBUCO, EL BAGRE CON COCO, Y LA JALEA DE GUAYABA. PARA LAS FESTIVIDADES DECEMBRINAS, AL IGUAL QUE EN OTRAS LOCALIDADES DEL PAíS SE UTILIZAN DIFERENTES INGREDIENTES PARA PREPARAR DIVERSAS RECETA DE LA éPOCA COMO LA HALLACA, EL DULCE DE LECHOZA, ETC .\n\nEL ESTADO MONAGAS POSEE UNA CULTURA BASTANTE CONSISTENTE CON LA DE LOS OTROS ESTADOS ORIENTALES, UNIFICADA A TRAVéS DE LA PECULIAR FORMA DE HABLAR EL ESPAñOL EN ESTA ZONA, LA GASTRONOMíA, LAS MANIFESTACIONES ARTíSTICAS Y ARTESANALES, LA MúSICA PROPIA COMO EL GALERóN Y EL JOROPO ORIENTAL Y EL PROFUSO CATOLICISMO EXPRESADO EN EL CULTO A LA SANTíSIMA VíRGEN DEL VALLE, PATRONA DE ORIENTE.	LA ECONOMíA ESTá BASADA EN LA ACTIVIDAD PETROLERA Y GASíFERA ESTABLECIDA EN EL CENTRO Y SUR DEL ESTADO, ASí COMO LA ACTIVIDAD GANADERA Y EL TURíSMO.\n\nLA ECONOMíA DEL ESTADO ESTá DOMINADA POR EL PRINCIPAL RECURSO ECONóMICO DE VENEZUELA, EL PETRóLEO, LA SEDE ORIENTAL DE PETRóLEOS DE VENEZUELA S. A. ESTá UBICADA EN MATURíN, EL ESTADO HA DESPLAZADO AL ESTADO ZULIA COMO PRINCIPAL RESERVORIO DE PETRóLEO E HIDROCARBUROS DEL PAíS, Y UNO DE LOS MAYORES DEL MUNDO. MONAGAS TAMBIéN PROSPERA EN LA SILVICULTURA, LA 