1	19	SUCRE	SUCRE ES UNO DE LOS 23 ESTADOS DE VENEZUELA, UBICADO EN LA REGIóN NORIENTAL DEL PAíS, LIMITA AL NORTE CON EL MAR CARIBE, AL SUR POR LOS ESTADOS ANZOáTEGUI Y MONAGAS, POR EL ESTE CON EL GOLFO DE PARIA Y POR EL OESTE CON EL GOLFO DE CARIACO, EL ESTADO ESTá COMPUESTO POR 15 MUNICIPIOS DIVIDIDOS EN 54 PARROQUIAS.\n\nEL ESTADO SUCRE DEBE SU NOMBRE AL MARISCAL VENEZOLANO ANTONIO JOSé DE SUCRE, HéROE DE LA GUERRA DE INDEPENDENCIA DE SURAMERICANA NACIDO EN LA ACTUAL CAPITAL DEL ESTADO, CUMANá.\n\nLOS LíMITES DEL ESTADO SON LAS SIGUIENTES:\n\n    * AL NORTE EL ESTADO LIMITA CON EL MAR CARIBE, TRINIDAD Y TOBAGO, EL ESTADO NUEVA ESPARTA Y ALGUNAS DEPENDENCIAS FEDREALES VENEZOLANAS.\n\n    * AL SUR EL ESTADO LIMITA CON LOS ESTADOS ANZOáTEGUI, MONAGAS Y DELTA AMACURO.\n\n    * AL ESTE EL ESTADO LIMITA CON EL MAR CARIBE Y LA ISLA DE TRINIDAD.\n\n    * AL OESTE EL ESTADO LIMITA CON EL MAR CARIBE.\n\nEL RELIEVE DE ESTE ESTADO SE PUEDE BASAR EN UNA PUNTA SOBRESALIENTE AL ORIENTE VENEZOLANO QUE TAMBIéN ES PARTE DE LA CORDILLERA DE LA COSTA, EN ESTA PUNTA SOBRESALEN ALGUNOS GOLFOS QUE SON EL GOLFO CARIACO, EL GOLFO DE PARIA, ENTRE OTROS GOLFOS MENORES. TAMBIéN SOBRESALEN 2 PENíNSULAS QUE SON LA PENíNSULA DE PARIA Y LA PENíNSULA DE ARAYA, ADEMáS DE QUE TIENE OTRAS PENíNSULAS MENORES.\n\nLA VEGETACIóN DEL ESTADO SUCRE ES XERóFILA EN LAS ZONAS URBANAS Y DE MONTAñA EN LAS ZONAS RURALES UBICADAS EN LA CORDILLERA DE LA COSTA, TAMBIéN PODEMOS ENCONTRAR PLANTAS Y áRBOLES PLAYEROS CARIBEñOS, COMO EL COCOTERO Y LOS áRBOLES DE CACAO. TAMBIéN SE PUEDE ENCONTRAR EL ROBLE, DECLARADO áRBOL DEL ESTADO.\n\nLA ECONOMíA ESTATAL SE BASA EN LA PESCA, LA AGRICULTURA Y EL TURISMO, PERO, éSTE úLTIMO PRINCIPALMENTE, UNO DE LOS LUGARES MáS TURíSTICOS DE VENEZUELA ES EL PARQUE NACIONAL MOCHIMA, UNA ZONA PROTEGIDA POR EL ESTADO VENEZOLANO COMPARTIDA ENTRE EL ESTADO ANZOáTEGUI Y SUCRE. ESTE PARQUE ES UN LUGAR úNICO, EN EL CUAL HAY UNA GRAN CANTIDAD DE ISLOTES Y CAYOS QUE LA CONFORMAN, ADEMáS DE QUE TIENE UNA GRAN FLORA Y FAUNA EN TODA SU EXTENSIóN. EL PARQUE ES UN GRAN LUGAR TURíSTICO MUY CONOCIDO POR LOS VENEZOLANOS Y DE MáS ALLá. EN LA PESCA, UNO DE LOS ESTADOS QUE MáS RESALTA ES EL ESTADO SUCRE CON UN GRAN PORCENTAJE, ALGUNOS DE LOS ESTADOS QUE MáS RESALTAN CON éSTE SON LOS ESTADOS NUEVA ESPARTA Y FALCóN, ENTRE OTROS .\n\n RECURSOS ECONóMICOS \n\n    * PESQUEROS: ATUNES, PARGOS, SARDINAS, ENTRE OTROS.\n\n    * RECURSOS VEGETALES: CACAO, CAFé, CAñA DE AZúCAR,SABILA, ENTRE OTROS.\n\n    * RECURSOS FORESTALES: MADERA COMúN, ROBLES, ALGARROBO, ENTRE OTROS.\n\n    * RECURSOS MINERALES: AZUFRE, GAS, PETRóLEO, SAL, ENTRE OTROS.\n\nLAS PRINCIPALES áREAS TURíSTICAS SON MOCHIMA, PARQUE NACIONAL CON VARIADOS PAISAJES MARINOS DEL CARIBE, PLAYAS GRANDES E ISLAS PEQUEñAS EN TODA SU EXTENSIóN, VARIAS ESPECIES DE AVES, PECES, MOLUSCOS Y OTROS ANIMALES. LA PENíNSULA DE ARAYA ES OTRO DE VARIOS LUGARES RESALTANTES, CON UN PAISAJE DESéRTICO, SIMILAR A LA ISLA CERCANA DE MARGARITA.	LA ECONOMíA ESTATAL SE BASA EN LA PESCA, LA AGRICULTURA Y EL TURISMO, PERO, éSTE úLTIMO PRINCIPALMENTE, UNO DE LOS LUGARES MáS TURíSTICOS DE VENEZUELA ES EL PARQUE NACIONAL MOCHIMA, UNA ZONA PROTEGIDA POR EL ESTADO VENEZOLANO COMPARTIDA ENTRE EL ESTADO ANZOáTEGUI Y SUCRE. ESTE PARQUE ES UN LUGAR úNICO, EN EL CUAL HAY UNA GRAN CANTIDAD DE ISLOTES Y CAYOS QUE LA CONFORMAN, ADEMáS DE QUE TIENE UNA GRAN FLORA Y FAUNA EN TODA SU EXTENSIóN. EL PARQUE ES UN GRAN LUGAR TURíSTICO MUY CONOCIDO POR LOS VENEZOLANOS Y DE MáS ALLá. EN LA PESCA, UNO DE LOS ESTADOS QUE MáS RESALTA ES EL ESTADO SUCRE CON UN GRAN PORCENTAJE, ALGUNOS DE LOS ESTADOS QUE MáS RESALTAN CON éSTE SON LOS ESTADOS NUEVA ESPARTA Y FALCóN, ENTRE OTROS .\n\n RECURSOS ECONóMICOS \n    * PESQUEROS: ATUNES, PARGOS, SARDINAS, ENTRE OTROS.\n\n    * RECURSOS VEGETALES: CACAO, CAFé, CAñA DE AZúCAR,SABILA, ENTRE OTROS.\n\n    * RECURSOS FORESTALES: MADERA COMúN, ROBLES, ALGARROBO, ENTRE OTROS.\n\n    * RECURSOS MINERALES: AZUFRE, GAS, PETRóLEO, SAL, ENTRE O