1	2	AMAZONAS	EL ESTADO AMAZONAS SE ENCUENTRA SITUADO EN EL SUR DE VENEZUELA, SIENDO SUS LíMITES EL ESTADO  BOLíVAR POR EL NORTE; LA REPúBLICA DEL BRASIL; EL ESTADO BOLíVAR Y BRASIL POR EL ESTE Y LA REPúBLICA DE COLOMBIA POR EL OESTE. SU NOMBRE SE DEBE A SU UBICACIóN GEOGRáFICA, QUE CORRESPONDE A LA REGIóN DE LA AMAZONíA, QUE DE UNA U OTRA FORMA, ESTá INTEGRADA POR LA TOTALIDAD DE LOS PAíSES SUDAMERICANOS, CON LA SOLA EXCEPCIóN DE CHILE. PODEMOS DECIR QUE ESTA EXTENSA ZONA ES QUIZáS EL PULMóN MáS GRANDE DE NUESTRO PLANETA, CUBIERTO DE SELVAS Y CON ALTíSIMO íNDICE DE PLUVIOSIDAD.\n\nSUPERFICIE:\n\n177.000 KM2\n19.2% DEL TERRITORIO NACIONAL\n\nPOBLACIóN (2001):\n\n70.000 HABITANTES\nA PARTE DE SU CAPITAL, PUERTO AYACUCHO QUE PARA ESTA FECHA DEL AñO 2000 SE CALCULA EN UNOS 40.000 HABITANTES, SOLAMENTE SON DIGNOS DE MENCIóN SAN FERNANDO DE ATABAPO CON UN POCO MáS DE 4.000 ATABAPENSES Y OTRAS DOS POBLACIONES QUE NO PASAN DE 1.000 HABITANTES, COMO SON SAN CARLOS DE RíO NEGRO Y MAROA, QUE ESTáN EN LAS MáRGENES DE LOS RíOS NEGRO Y GUAINíA, RESPECTIVAMENTE. EN ESTE CAPíTULO CABE SEñALAR QUE EL CENSO INDíGENA DE 1992 ESTIMó EN POCO MáS DE 43.000 HAB. LOS INDíGENAS DE LA REGIóN CORRESPONDIENTES A UNOS 17 GRUPOS éTNICOS, DESTACANDO ENTRE éSTOS, LOS YANOMAMI, GUAHIBO, PIAROA Y YEKUANA, CADA UNO CON SU LENGUAJE, RELIGIONES, TRADICIONES Y COSTUMBRES DIFERENTES.\n\nRELIEVE\n\nLA TOTALIDAD DEL ESTADO AMAZONAS, ESTá COMPRENDIDA EN EL LLAMADO ESCUDO GUAYANéS. SU RELIEVE ESTá COMPRENDIDO DESDE LAS MáRGENES DEL ORINOCO HASTA EL PICO MARAHUACA QUE CON SUS 3.800M.* ES EL PUNTO CULMINANTE DEL ESTADO. EFECTIVAMENTE, EL RELIEVE DEL ESTADO ES MUY VARIADO, COMENZANDO POR LAS LLANURAS O SABANAS, QUE VAN DE LOS 100 HASTA LOS 500M. PARA PROSEGUIR CON LAS SERRANíAS Y MONTAñAS, QUE ABUNDAN EN LA ZONA, A EXCEPCIóN DADA DEL LADO OCCIDENTAL DEL ESTADO QUE POR ESTAR LIMITADO POR LOS RíOS ORINOCO, GUAINíA Y NEGRO, OBVIAMENTE RECORREN LA PARTE MáS BAJA DEL TERRITORIO. EFECTIVAMENTE, POR EL NORTE, ESTE Y SUR HAY NUMEROSAS SIERRAS, ENTRE ELLAS LA DE MAIGUALIDA, MARAHUACA, UNTURáN, PARIMA, TAPIRAPECó, LA NEBLINA, IMERI Y ARACAMUNí, ENTRE OTRAS.\nLAS PRINCIPALES ALTURAS DEL ESTA DO Y TAMBIéN DE TODA LA REGIóN GUAYANESA, SON: MARAHUACA, (3.804MN.); EL PICO PHELPS Y EL CERRO DE LA NEBLINA, AMBOS CON 3.045M.; CERRO YUTAJé (2.990M.); ZULOAGA (2.800M.); CUAO (2.740M.); CARDONA (2.650M); YAVí (2.550M.) Y LA SERRANíA DE MAIGUALIDA A 2.380M.\n\nHIDROGRAFíA\n\nEN ESTE ESTADO NACE EL PRINCIPAL RíO DE VENEZUELA, EL ORINOCO, LO HACE EN EL CERRO DELGADO CHALBAUD Y DESPUéS DE RECORRER 2.140 KM. DEPOSITA SUS AGUAS EN EL OCéANO ATLáNTICO. EL ORINOCO ES A SU VEZ, LA CUENCA DONDE VIERTEN SUS AGUAS OTROS IMPORTANTES RíOS DE LA REGIóN, COMO EL VENTUARI DE 474 KM. CON SUS AFLUENTES UESETE, YATITí, PARú, ASITA, MANAPIARE, MARIETA Y GUAPACHí. EL OCAMO (238 KM.), CON SU AFLUENTE EL RíO PUTACO.\n\nVEGETACIóN\n\nGRAN PARTE DEL ESTADO, ESTá CUBIERTO POR INMENSAS SELVAS, POR LO QUE LA VEGETACIóN DEBIDO AL ALTO íNDICE DE PLUVIOSIDAD, ES LA TíPICA SELVáTICA . TAMBIéN HAY SABANAS DE SUELOS SECOS Y SABANAS DE SUELOS HúMEDOS. MáS ARRIBA Y DEPENDIENDO DE LA ALTURA, LA VEGETACIóN SE HACE MáS ESCASA, HASTA LLEGAR A MáS DE 2.000 DONDE CASI DESAPARECE TOTALMENTE.\nFAUNA\n\nLA RICA FAUNA DE LA REGIóN ESTá REPRESENTADA POR NUMEROSOS ESPECíMENES DE MAMíFEROS, REPTILES, PECES Y AVES:\n\nMAMíFEROS: PUMA, JAGUAR, DANTA, MONO,( ARAGUATO, TITí) OSO PALMERO (EN PELIGRO DE EXTINCIóN), ZORRO, ETC\nACTIVIDADES ECONóMICAS\n\nTANTO LA EXPLOTACIóN DE LOS BOSQUES, COMO LA AGRICULTURA Y LA PESCA, SON EN ESTE ESTADO INCIPIENTES Y DE SUBSISTENCIA. LA MINERíA ES DE EXTRACCIóN PROHIBIDA Y EJERCIDA POR INESCRUPULOSOS. NO HAY UNA VERDADERA PROTECCIóN POR PARTE DE NUESTRAS AUTORIDADES QUE\nCUIDEN LOS CUANTIOSOS YACIMIENTOS DE BAUXITA, ORO, DIAMANTES, CAOLíN, MINERALES RAROS, RADIOACTIVOS Y FERROMINERALES. LA EXPLOTACIóN DE DIAMANTES Y ORO ESTá EN MANOS DE GARIMPEIROS, EN SU MAYORíA EMIGRANTES DEL NORDESTE BRASILERO, QUE CRUZAN NUESTRAS FRONTERAS Y ESTáN ACABANDO CON LAS CABECERAS DE NUESTROS RíOS AL USAR EL VENENOSO MERCURIO QUE ENVENENA EL AGUA Y MATA A LOS PECES. LA VERDADERA INDUSTRIA PARA EL FUTURO Y DESARROLLO DE ESTE RICO Y UBéRRIMO ESTADO, A PARTE DE UNA EXPLOTACIóN RACIONAL DE NUESTRAS RIQUEZAS MINERALES, ES LA DEL TURISMO: EXCURSIONES (ORINOQUIA, CERRO AUTANA) O ASESORAMIENTO	ACTIVIDADES ECONóMICAS:\nTANTO LA EXPLOTACIóN DE LOS BOSQUES, COMO LA AGRICULTURA Y LA PESCA, SON EN ESTE ESTADO INCIPIENTES Y DE SUBSISTENCIA. LA MINERíA ES DE EXTRACCIóN PROHIBIDA Y EJERCIDA POR INESCRUPULOSOS. NO HAY UNA VERDADERA PROTECCIóN POR PARTE DE NUESTRAS AUTORIDADES QUE\nCUIDEN LOS CUANTIOSOS YACIMIENTOS DE BAUXITA, ORO, DIAMANTES, CAOLíN, MINERALES RAROS, RADIOACTIVOS Y FERROMINERALES. LA EXPLOTACIóN DE DIAMANTES Y ORO ESTá EN MANOS DE GARIMPEIROS, EN SU MAYORíA EMIGRANTES DEL NORDESTE BRASILERO, QUE CRUZAN NUESTRAS FRONTERAS Y ESTáN ACABANDO CON LAS CABECERAS DE NUESTROS RíOS AL USAR EL VENENOSO MERCURIO QUE ENVENENA EL AGUA Y MATA A LOS PECES. LA VERDADERA INDUSTRIA PARA EL FUTURO Y DESARROLLO DE ESTE RICO Y UBéRRIMO ESTADO, A PARTE DE UNA EXPLOTACIóN RACIONAL DE NUESTRAS RIQUEZAS MINERALES, ES LA DEL TURISMO: EXCURSIONES (ORINOQUIA, CERRO AUTANA) O ASESORAMIENTO	142200	SUR	SIENDO SUS LíMITES EL ESTADO  BOLíVAR POR EL NORTE; LA REPúBLICA DEL BRASIL; EL ESTADO BOLíVAR Y BRASIL POR EL ESTE Y LA REPúBLICA DE COLOMBIA POR EL OESTE.	180.144 KM2
1	3	ANZOATEGUI	EL ESTADO ANZOáTEGUI ESTA SITUADO AL NORESTE DE VENEZUELA. LIMITA AL NORTE CON EL MAR CARIBE; POR EL ESTE CON LOS ESTADOS SUCRE Y MONAGAS; POR EL SUR CON EL RíO ORINOCO, QUE LE SEPARA DEL ESTADO BOLíVAR Y POR EL OESTE, CON LOS ESTADOS GUARICO Y MIRANDA.\n\t\n\t  \t\n  \t  \t\n\nCAPITAL: LA CAPITAL DEL ESTADO ES BARCELONA; FUNDADA EN 1671 POR SANCHO FERNáNDEZ DE ANGULO Y, FRAY MANUEL DE YANGUES. LA CIUDAD ESTá A ORILLAS DEL NEVERí, A 3 KILóMETROS DEL MAR Y A 13 METROS DE ALTITUD.\n\nÁRBOL EMBLEMáTICO: CEREIPO O GUATAMARE (MYROSPERMUM FRUTESCENS).\n\nLAS OTRAS POBLACIONES DEL ESTADO: ANACO, ARAGUA DE BARCELONA, CANTAURA, CLARINES, EL TIGRE, PARIAGUáN, PíRITU, PUERTO LA CRUZ, SAN TOMé, SANTA ROSA Y SOLEDAD. \t\n\nPORCENTAJE DEL TERRITORIO ESTADAL: 4,7%. ES EL SéPTIMO ESTADO CON MAYOR SUPERFICIE DEL PAíS.\n\nPOBLACIóN: CON BASE EN EL DESARROLLO POBLACIONAL, EL ESTADO OCUPA EL OCTAVO LUGAR CON RESPECTO AL TOTAL NACIONAL, CON UNA POBLACIóN DE 1.034.311 (1995) HABITANTES.\n\nCLIMA: TEMPERATURA MEDIA ANUAL (MAX-MIN) ENTRE 25° Y 27° CELSIUS.  \t\n\nECONOMíA: LA ECONOMíA DEL ESTADO ANZOáTEGUI SE CARACTERIZA POR EL PREDOMINIO DE LAS ACTIVIDADES PETROLERAS Y AGRíCOLAS, SIN EMBARGO, EXISTEN FAVORABLES EXPECTATIVAS DE DESARROLLO EN LOS SECTORES SECUNDARIO Y TERCIARIO, CON LA INSTALACIóN DE IMPORTANTES INDUSTRIAS COMO: AUTOMOTRIZ, MATERIALES PARA LA CONSTRUCCIóN, DERIVADOS DEL PETRóLEO, AGROINDUSTRIA; Y POR OTRO LADO ACTIVIDADES TURíSTICAS, TRANSPORTE (FERROCARRIL), COMERCIALES Y FINANCIERAS.\n\nLA PRODUCCIóN DE HIDROCARBUROS REPRESENTA UNA PARTE IMPORTANTE DENTRO DEL CONTEXTO NACIONAL OCUPANDO UN ESPACIO FíSICO CONSIDERABLE. EN LOS SECTORES ANACO-ARAGUA DE BARCELONA Y EL TIGRE SE ENCUENTRAN LOS ASPECTOS RELATIVOS A LA FASE EXTRACTIVA, MIENTRAS QUE LAS ACTIVIDADES INDUSTRIALES DE REFINACIóN SE REALIZAN EN PUERTO LA CRUZ Y SAN ROQUE. ASí MISMO, EN EL ESTADO SE LOCALIZA EL COMPLEJO CRIOGéNICO DE JOSé.\n\nLA ACTIVIDAD AGRíCOLA HA VENIDO EXPERIMENTANDO UN CRECIMIENTO BASADO, FUNDAMENTALMENTE, EN EL INCREMENTO DE LA SUPERFICIE OCUPADA LUEGO DE HABER PASADO POR UN PROLONGADO PERíODO DE ESTANCAMIENTO, COMO CONSECUENCIA DEL DESARROLLO DE LA ACTIVIDAD PETROLERA. SEGúN EL ANUARIO ESTADíSTICO AGROPECUARIO DEL MAC 89/91, LOS PRINCIPALES RUBROS CULTIVADOS EN LA ENTIDAD SON: MANí, MAíZ, ALGODóN, CAñA, SORGO, CAFé, CACAO, CAMBUR, RAíCES Y TUBéRCULOS. OTRA ACTIVIDAD AGRíCOLA RELEVANTE LA CONSTITUYE EL APROVECHAMIENTO DE LOS RECURSOS FORESTALES: DE ACUERDO CON LAS ESTADíSTICAS DEL SERVICIO AUTóNOMO FORESTAL VENEZOLANO (SEFORVEN), PARA EL AñO 1990 LA ENTIDAD TENíA UNA PRODUCCIóN DE MADERA EN ROLA DE 1. 033.100 M3 (0,18% DEL TOTAL NACIONAL).\n\nEN LA ACTIVIDAD GANADERA DESTACAN: GANADO BOVINO CON 614. 097 CABEZAS EXISTENTES; PORCINO CON 100. 097 CABEZAS Y AVES CON 4. 019. 816 UNIDADES. EL DESARROLLO DEL ESTADO SE HA CENTRADO EN LA FAJA COSTERA, DONDE SE UBICA EL 50% DE LA POBLACIóN, GENERáNDOSE CONFLICTOS DE USO POR LA OCUPACIóN DEL ESPACIO ENTRE LAS ACTIVIDADES TURíSTICAS, INDUSTRIALES PETROLERAS, MINERAS, RESIDENCIALES Y COMERCIALES.\n\nEL TURISMO ACTUALMENTE OCUPA UN FACTOR RELEVANTE EN EL DESARROLLO DE PUERTO LA CRUZ Y OTRAS POBLACIONES COSTERAS.\n\nPRODUCTOS PRINCIPALES:\n\nAGROPECUARIA: PESCA, MANí, MAíZ, SORGO, RAíCES Y TUBéRCULOS.\n\nINDUSTRIALES: PETRóLEO CRUDO Y REFINADO, GAS NATURAL Y SUS DERIVADOS, HULLA, CEMENTO, PRODUCTOS ALIMENTICIOS Y BEBIDAS. \n	SUS PRINCIPALES FUENTES ECONOMICAS DEL ESTADO ANZOáTEGUI SE CARACTERIZA POR EL PREDOMINIO DE LAS ACTIVIDADES PETROLERAS Y AGRíCOLAS, SIN EMBARGO, EXISTEN FAVORABLES EXPECTATIVAS DE DESARROLLO EN LOS SECTORES SECUNDARIO Y TERCIARIO, CON LA INSTALACIóN DE IMPORTANTES INDUSTRIAS COMO: AUTOMOTRIZ, MATERIALES PARA LA CONSTRUCCIóN, DERIVADOS DEL PETRóLEO, AGROINDUSTRIA; Y POR OTRO LADO ACTIVIDADES TURíSTICAS, TRANSPORTE (FERROCARRIL), COMERCIALES Y FINANCIERAS.\n\nLA PRODUCCIóN DE HIDROCARBUROS REPRESENTA UNA PARTE IMPORTANTE DENTRO DEL CONTEXTO NACIONAL OCUPANDO UN ESPACIO FíSICO CONSIDERABLE. EN LOS SECTORES ANACO-ARAGUA DE BARCELONA Y EL TIGRE SE ENCUENTRAN LOS ASPECTOS RELATIVOS A LA FASE EXTRACTIVA, MIENTRAS QUE LAS ACTIVIDADES INDUSTRIALES DE REFINACIóN SE REALIZAN EN PUERTO LA CRUZ Y SAN ROQUE. ASí MISMO, EN EL ESTADO SE LOCALIZA EL COMPLEJO CRIOGéNICO DE JOSé.\n\nLA ACTIVIDAD AGRíCOLA HA VENIDO EXPERIMENTANDO UN CRECIMIENTO BASADO, FUNDAMENTALMENTE, EN EL INCREMENTO DE LA SUPERFICIE OCUPADA LUEGO DE HABER PASADO POR UN PROLONGADO PERíODO DE ESTANCAMIENTO, COMO CONSECUENCIA DEL DESARROLLO DE LA ACTIVIDAD PETROLERA. SEGúN EL ANUARIO ESTADíSTICO AGROPECUARIO DEL MAC 89/91, LOS PRINCIPALES RUBROS CULTIVADOS EN LA ENTIDAD SON: MANí, MAíZ, ALGODóN, CAñA, SORGO, CAFé, CACAO, CAMBUR, RAíCES Y TUBéRCULOS. OTRA ACTIVIDAD AGRíCOLA RELEVANTE LA CONSTITUYE EL APROVECHAMIENTO DE LOS RECURSOS FORESTALES: DE ACUERDO CON LAS ESTADíSTICAS DEL SERVICIO AUTóNOMO FORESTAL VENEZOLANO (SEFORVEN), PARA EL AñO 1990 LA ENTIDAD TENíA UNA PRODUCCIóN DE MADERA EN ROLA DE 1. 033.100 M3 (0,18% DEL TOTAL NACIONAL).\n\nEN LA ACTIVIDAD GANADERA DESTACAN: GANADO BOVINO CON 614. 097 CABEZAS EXISTENTES; PORCINO CON 100. 097 CABEZAS Y AVES CON 4. 019. 816 UNIDADES. EL DESARROLLO DEL ESTADO SE HA CENTRADO EN LA FAJA COSTERA, DONDE SE UBICA EL 50% DE LA POBLACIóN, GENERáNDOSE CONFLICTOS DE USO POR LA OCUPACIóN DEL ESPACIO ENTRE LAS ACTIVIDADES TURíSTICAS, INDUSTRIALES PETROLERAS, MINERAS, RESIDENCIALES Y COMERCIALES.\n\nEL TURISMO ACTUALMENTE OCUPA UN FACTOR RELEVANTE EN EL DESARROLLO DE PUERTO LA CRUZ Y OTRAS POBLACIONES COSTERAS.\n\nPRODUCTOS PRINCIPALES:\n\nAGROPECUARIA: PESCA, MANí, MAíZ, SORGO, RAíCES Y TUBéRCULOS.\n\nINDUSTRIALES: PETRóLEO CRUDO Y REFINADO, GAS NATURAL Y SUS DERIVADOS, HULLA, CEMENTO, PRODUCTOS ALIMENTICIOS Y BEBIDAS. \n	1477900	NORESTE	LIMITA AL NORTE CON EL MAR CARIBE, AL SUR CON EL ESTADO BOLíVAR, AL OESTE CON LOS ESTADOS MIRANDA Y GUáRICO Y AL ESTE CON LOS ESTADOS SUCRE Y MONAGAS.	43.300 KM2
1	10	DELTA AMACURO	ESTADO DELTA AMACURO, SITUADO AL ESTE DE VENEZUELA, ALBERGA EL DELTA DEL RíO ORINOCO, COORDENADAS 70º 38 Y 10º 3 DE LATITUD NORTE Y 62º 30 Y 59º 48 DE LONGITUD OESTE. LIMITA AL NORTE CON EL GOLFO DE PARIA Y EL OCéANO ATLáNTICO, AL SUR CON EL ESTADO BOLíVAR, AL ESTE CON EL OCéANO ATLáNTICO Y EL TERRITORIO EN RECLAMACIóN DE LA GUAYANA ESEQUIBA Y AL OESTE CON EL ESTADO MONAGAS. OCUPA UNA SUPERFICIE DE 40.200 KM² Y SU CAPITAL ES TUCUPITA.\n\nLA TEMPERATURA PROMEDIO ES DE 26,7º C, VARIANDO MUY POCO DURANTE EL AñO. LA PLUVIOSIDAD VARíA ENTRE 900 MM Y 2500 MM POR AñO.\n\nEL TERRITORIO FEDERAL DELTA AMACURO FUE CREADO COMO DIVISIóN TERRITORAL EL 27 DE FEBRERO DE 1884, ENTRE 1893 Y 1901 FORMó PARTE DEL ESTADO BOLíVAR, EN 1991 ADQUIERE LA CATEGORíA DE ESTADO.\n\nEL PUEBLO SON LOS NATIVOS DEL DELTA. CON UNA POBLACIóN DE 24.000 HABITANTES. LAS VIVIENDAS SON ESENCIALMENTE PALáFITOS A ORILLAS DE LOS CAñOS MENORES DEL ORINOCO. SU PRINCIPAL ACTIVIDAD ES LA PESCA Y LA ARTESANíA.	ECONOMíA\n\nLAS PRINCIPALES ACTIVIDADES ECONóMICAS SON LA PESCA, EL GANADO Y LAS RELACIONADAS CON LA EXPLOTACIóN Y REFINACIóN DEL PETRóLEO.\n\nRECURSOS ECONóMICOS \n\n    * PRODUCTOS AGROPECUARIOS: ARROZ, MAíZ, GANADO DE CARNE BOVINO Y PORCINO, AVES, COCO, PLáTANO, YUCA, PIñA, PALMITO.\n\n    * PRODUCTOS INDUSTRIALES: PRODUCTOS REFINADOS DEL PETRóLEO.\n\n    * RECURSOS FORESTALES: CUAJO, MANGLE, MORICHE, SEJE, YAGRUMO.\n\n    * RECURSOS MINERALES: PETRóLEO, TURBA.\n	152700	ESTE	LIMITA AL NORTE CON EL GOLFO DE PARIA Y EL OCéANO ATLáNTICO, AL SUR CON EL ESTADO BOLíVAR, AL ESTE CON EL OCéANO ATLáNTICO Y EL TERRITORIO EN RECLAMACIóN DE LA GUAYANA ESEQUIBA Y AL OESTE CON EL ESTADO MONAGAS	40200 KM2
1	9	COJEDES	EL ESTADO COJEDES ESTá UBICADO EN EL CENTRO-OESTE DE VENEZUELA. LIMITA AL NORTE CON LOS ESTADOS LARA,  YARACUY Y CARABOBO, AL OESTE CON EL ESTADO PORTUGUESA, AL SUR CON EL ESTADO BARINAS, AL ESTE CON EL ESTADO GUáRICO. SU CAPITAL ES SAN CARLOS.\n\nSUPERFICIE:\n\n14.800 KM2\n1.6% DEL TERRITORIO NACIONAL\n\nPOBLACIóN (2001):\n\n253.000\n\n\nLA MAYOR PARTE DEL ESTADO COJEDES ESTá UBICADO EN LA REGIóN DE LOS LLANOS, Y EN PARTICULAR EN LOS LLANOS CENTRALES. EL EXTREMO NORTE PERTENECE A LA CORDILLERA CENTRAL.\n\nEN EL NORTE HAY COLINAS Y MONTAñAS POCO ELEVADAS. EL PUNTO MáS ALTO ES EL CERRO AZUL DE TUCURAGUA CON 1780 METROS. EN EL CENTRO EXISTEN UNAS LOMAS ALARGADAS DE POCA ALTURA DENOMINADAS GALERAS. EL MACIZO DE EL BAúL ES COMO UNA ISLA EN MEDIO DE LOS LLANOS, FORMADA POR RELIEVES DE ORIGEN MUY ANTIGUO. TAMBIéN SE CUENTA CON LLANOS ALTOS EN DONDE ESTáN LAS PRINCIPALES CIUDADES Y SE CULTIVA EL ARROZ Y EL MAíZ Y LLANOS BAJOS MáS AL SUR.\n\nLAS PRINCIPALES ACTIVIDADES ECONóMICAS DEL ESTADO SON LA AGRICULTURA Y LA GANADERíA. EXISTE UN GRAN CONTRASTE ENTRE EL USO AGRíCOLA Y EL POTENCIAL DE TIERRAS APTAS PARA TAL ACTIVIDAD. LOS PRINCIPALES PRODUCTOS QUE SE CULTIVAN SON: MAíZ, ñAME, SORGO, QUINCHONCHO, YUCA Y MANGO. EN EL SECTOR PECUARIO DOMINAN LA GANADERíA BOVINA Y PORCINA. SU PRODUCCIóN DE MADERA ESTá BASADA EN LA EXTRACCIóN IRRACIONAL DE ESPECIES FINAS, úLTIMAMENTE DIRIGIDO A LAS MADERAS DURAS Y BLANDAS.	LAS PRINCIPALES ACTIVIDADES ECONóMICAS DEL ESTADO SON LA AGRICULTURA Y LA GANADERíA. EXISTE UN GRAN CONTRASTE ENTRE EL USO AGRíCOLA Y EL POTENCIAL DE TIERRAS APTAS PARA TAL ACTIVIDAD. LOS PRINCIPALES PRODUCTOS QUE SE CULTIVAN SON: MAíZ, ñAME, SORGO, QUINCHONCHO, YUCA Y MANGO. EN EL SECTOR PECUARIO DOMINAN LA GANADERíA BOVINA Y PORCINA. SU PRODUCCIóN DE MADERA ESTá BASADA EN LA EXTRACCIóN IRRACIONAL DE ESPECIES FINAS, úLTIMAMENTE DIRIGIDO A LAS MADERAS DURAS Y BLANDAS.	300300	CENTRO OESTE	LIMITA AL NORTE CON LOS ESTADOS LARA,  YARACUY Y CARABOBO, AL OESTE CON EL ESTADO PORTUGUESA, AL SUR CON EL ESTADO BARINAS, AL ESTE CON EL ESTADO GUáRICO.	14800 KM2
1	11	FALCÓN	EL ESTADO FALCóN ES UNO DE LOS 23 ESTADOS DE VENEZUELA, UBICADO AL NOROESTE DE VENEZUELA,\n\nLA PRINCIPAL ACTIVIDAD ECONóMICA DEL ESTADO ESTá RELACIONADA CON LA INDUSTRIA DEL PETRóLEO. EN LA PENíNSULA DE PARAGUANá SE UBICAN DOS REFINERíAS PETROLERAS DE GRAN CAPACIDAD DE PRODUCCIóN PARA LA EXPORTACIóN Y EL CONSUMO DE TODO EL PAíS\n\nLA PRINCIPAL ACTIVIDAD ECONóMICA DEL ESTADO ESTá RELACIONADA CON LA INDUSTRIA DEL PETRóLEO. EN LA PENíNSULA DE PARAGUANá SE UBICAN DOS REFINERíAS PETROLERAS DE GRAN CAPACIDAD DE PRODUCCIóN PARA LA EXPORTACIóN Y EL CONSUMO DE TODO EL PAíS\n\n ECONOMíA\n\nRECURSOS ECONóMICOS \n\n    * CRIA: AVíCOLA, BOVINA, CAPRINO Y PORCINO\n    * PESCA: ATúN, BAGRE, CARITE, COROCORO Y LISA (MARINOS). CAMARóN, CANGREJO Y LANGOSTA, PEPITONAS Y QUIGUA (MOLUSCOS)\n    * PRODUCTOS AGRíCOLAS: CAñA DE AZúCAR, COCO, MAíZ, MELóN, ñAME, OCUMO Y SORGO.\n    * RECURSOS FORESTALES: CANDELERO, CARBóN, CEDRO, CUJI, GUAMO, JABILLO Y VERA.\n    * RECURSOS MINERALES: ARENAS, CALIZAS, CARBóN, CROMITA, GRAVAS, PETRóLEO Y ROCAS FOSFáTICAS.\n\n AGRICULTURA Y GANADERIA \n\nFALCóN ES EL PRIMER ESTADO PRODUCTOR DE COCO Y COPRA, GANADO CAPRINO Y SUS DERIVADOS; SEGUNDO EN PRODUCCIóN PESQUERA Y DE HORTALIZAS COMO CEBOLLA, Y PIMENTóN; TERCERO EN PRODUCCIóN DE LECHE BOVINA Y MELóN. ADEMAS TIENE GRANDES VENTAJAS PARA LA PRODUCCION DE HORTALIZAS DE PISO SECO COMO EL MELóN, CEBOLLA, PATILLA Y EL TOMATE. SOLO EL RUBRO COCO, TIENE APROXIMADAMENTE 20.000 HECTáREAS CULTIVADAS, EXISTIENDO DISPONIBILIDAD PARA LA AMPLIACIóN DE SUPERFICIE EN LA COSTA ORIENTAL DEL ESTADO FALCóN. EL ESTADO FALCóN ES UNO DE LOS PRINCIPALES PRODUCTORES DE ZáBILA EN VENEZUELA, Y EN EL RUBRO CAFé TIENE UNA EXPLOTACIóN DE 3.500 HECTáREAS, PERO CON UNA DISPOSICIóN DE 12.700 HECTáREAS CULTIVABLES, DISTRIBUIDAS EN LA SIERRA DE CORO EN LA ZONA SUR DE LA ENTIDAD FEDERAL.\n\n ACTIVIDADES ECONóMICAS \n\nLA PRINCIPAL ACTIVIDAD ECONóMICA EN CUANTO A LA OCUPACIóN DE LA MANO DE OBRA, ES LA AGROPECUARIA, CON GRANDES CULTIVOS DE CAñA DE AZúCAR, CEBOLLAS, MAíZ, SORGO, PAPAS, BANANOS, PLáTANOS, PATILLAS, MELONES Y CARAOTAS. EN LAS MONTAñAS SE CULTIVAS CAFé ,TENIENDO PRESTIGIO LAS PRODUCCIONES EN LA SIERRA DE SAN LUIS Y EN LA SIERRA DE CHURUGUARA.\n\nEN LA COSTA ORIENTAL HAY IMPORTANTES PLANTACIONES DE COCOTEROS, QUE HAN DESARROLLADO UNA IMPORTANTE INDUSTRIA DE EXTRACCIóN DE ACEITE Y APROVECHAMIENTO DE LA COPRA. EN CUANTO A LA GANADERíA, HAY ABUNDANCIA DE GANADO CAPRINO, VACUNO Y PORCINO.\n\nLA POBLACIóN DEL ESTADO FALCóN SE ESTIMA EN EL AñO 2000 EN 747.672 HABITANTES, MIENTRAS QUE EN 1990 SE CENSABAN 599.185 HABITANTES. SU DENSIDAD DE POBLACIóN HA SUBIDO DE 24,2 HAB/KM2 EN 1990 A 30,1 HAB/KM2. EN EL AñO 2000. HA DECRECIDO EL PORCENTAJE DE POBLACIóN RURAL. EN CAMBIO, SE CONSTATA UNA CRECIENTE TENDENCIA A LA URBANIZACIóN, LLEGANDO LA POBLACIóN URBANA AL 67,3% DE LA POBLACIóN TOTAL ESTADAL EN 1990. EN EL AñO 2000 SE ESTIMA UNA POBLACIóN URBANA DE 561.558 HABS., REPARTIéNDOSE EN VARIAS CIUDADES ENCABEZADAS POR LA CONURBACIóN DE 228.931 HABS. FORMADA POR LA CIUDAD DE SANTA ANA DE CORO (192.558 HABS.) Y SU PUERTO LA VELA DE CORO (36.373 HABS.); Y POR LA CONURBACIóN MúLTIPLE DE 209.731 HABS., COMPUESTA POR PUNTO FIJO (123.551 HABS.), PUNTA CARDóN (51.593 HABS.), CARIRUBANA (23.529 HABS.) Y JUDIBANA (11.058 HABS.). OTRAS CIUDADES MEDIANAS ESTRUCTURAN SUS RESPECTIVAS ZONAS DE INFLUENCIA, DESTACANDO PUERTO CUMAREBO (22.047 HABS.), DABAJURO (15.269 HABS.), TUCACAS (12.970 HABS.), CHURUGUARA (10.800 HABS.), MENE DE MAUROA (10.302 HABS.).\n\nSE ESTIMA QUE EN LA ACTUALIDAD DEBIDO AL CRECIMIENTO ACELERADO QUE SE ESTA GESTANDO EN LA CIUDAD DE PUNTO FIJO( PUNTO FIJO, PUNTA CARDóN, CARIRUBANA Y JUDIBANA) ESTA HAYA SOBREPASADO EN NúMERO DE HABITANTES A LA CAPITAL DEL ESTADO, RAZóN POR LA CUAL MUCHOS INVERSIONISTAS PUSIERON EL OJO EN ESTA ZONA TAN PROMETEDORA; ADEMáS POR TODO LO QUE TIENE QUE OFRECER	LA PRINCIPAL ACTIVIDAD ECONóMICA DEL ESTADO ESTá RELACIONADA CON LA INDUSTRIA DEL PETRóLEO. EN LA PENíNSULA DE PARAGUANá SE UBICAN DOS REFINERíAS PETROLERAS DE GRAN CAPACIDAD DE PRODUCCIóN PARA LA EXPORTACIóN Y EL CONSUMO DE TODO EL PAíS\n\n ECONOMíA\n\nRECURSOS ECONóMICOS \n\n    * CRIA: AVíCOLA, BOVINA, CAPRINO Y PORCINO\n    * PESCA: ATúN, BAGRE, CARITE, COROCORO Y LISA (MARINOS). CAMARóN, CANGREJO Y LANGOSTA, PEPITONAS Y QUIGUA (MOLUSCOS)\n    * PRODUCTOS AGRíCOLAS: CAñA DE AZúCAR, COCO, MAíZ, MELóN, ñAME, OCUMO Y SORGO.\n    * RECURSOS FORESTALES: CANDELERO, CARBóN, CEDRO, CUJI, GUAMO, JABILLO Y VERA.\n    * RECURSOS MINERALES: ARENAS, CALIZAS, CARBóN, CROMITA, GRAVAS, PETRóLEO Y ROCAS FOSFáTICAS.\n\n AGRICULTURA Y GANADERIA \n\nFALCóN ES EL PRIMER ESTADO PRODUCTOR DE COCO Y COPRA, GANADO CAPRINO Y SUS DERIVADOS; SEGUNDO EN PRODUCCIóN PESQUERA Y DE HORTALIZAS COMO CEBOLLA, Y PIMENTóN; TERCERO EN PRODUCCIóN DE LECHE BOVINA Y MELóN. ADEMAS TIENE GRANDES VENTAJAS PARA LA PRODUCCION DE HORTALIZAS DE PISO SECO COMO EL MELóN, CEBOLLA, PATILLA Y EL TOMATE. SOLO EL RUBRO COCO, TIENE APROXIMADAMENTE 20.000 HECTáREAS CULTIVADAS, EXISTIENDO DISPONIBILIDAD PARA LA AMPLIACIóN DE SUPERFICIE EN LA COSTA ORIENTAL DEL ESTADO FALCóN. EL ESTADO FALCóN ES UNO DE LOS PRINCIPALES PRODUCTORES DE ZáBILA EN VENEZUELA, Y EN EL RUBRO CAFé TIENE UNA EXPLOTACIóN DE 3.500 HECTáREAS, PERO CON UNA DISPOSICIóN DE 12.700 HECTáREAS CULTIVABLES, DISTRIBUIDAS EN LA SIERRA DE CORO EN LA ZONA SUR DE LA ENTIDAD FEDERAL.\n\n ACTIVIDADES ECONóMICAS \n\nLA PRINCIPAL ACTIVIDAD ECONóMICA EN CUANTO A LA OCUPACIóN DE LA MANO DE OBRA, ES LA AGROPECUARIA, CON GRANDES CULTIVOS DE CAñA DE AZúCAR, CEBOLLAS, MAíZ, SORGO, PAPAS, BANANOS, PLáTANOS, PATILLAS, MELONES Y CARAOTAS. EN LAS MONTAñAS SE CULTIVAS CAFé ,TENIENDO PRESTIGIO LAS PRODUCCIONES EN LA SIERRA DE SAN LUIS Y EN LA SIERRA DE CHURUGUARA.\n\nEN LA COSTA ORIENTAL HAY IMPORTANTES PLANTACIONES DE COCOTEROS, QUE HAN DESARROLLADO UNA IMPORTANTE INDUSTRIA DE EXTRACCIóN DE ACEITE Y APROVECHAMIENTO DE LA COPRA. EN CUANTO A LA GANADERíA, HAY ABUNDANCIA DE GANADO CAPRINO, VACUNO Y PORCINO.\n\n\n	901500	NOROESTE	LIMITA AL NORTE CON EL GOLFO DE VENEZUELA Y EL MAR CARIBE, POR EL ESTE CON EL MAR CARIBE, POR EL SUR CON LOS ESTADOS YARACUY Y LARA, POR EL OESTE CON EL ESTADO ZULIA.	24800 KM2
1	17	NUEVA ESPARTA	NUEVA ESPARTA ES UN ESTADO FEDERAL DE VENEZUELA, UBICADO AL NORESTE DEL PAíS, SIENDO EL úNICO ESTADO FEDERAL INSULAR Y EL DE MENOR SUPERFICIE DE LA NACIóN.\n\nEL ESTADO POSEE GRAN CANTIDAD DE MONUMENTOS HISTóRICOS, EN LA IGLESIA DE SANTA ANA FUE DECLARADA LA TERCERA REPúBLICA DE VENEZUELA, Y, SIMóN BOLíVAR, SU PRESIDENTE. EL ESTADO FUE DESIGNADO CON ESE NOMBRE A PARTIR DEL 12 DE MAYO DE 1817, CON EL PROPóSITO DE HACER UN HOMENAJE AL HEROíSMO DE LOS HABITANTES DE LA ISLA DE MARGARITA DURANTE LA GUERRA DE INDEPENDENCIA DE VENEZUELA, CALIFICADO COMO \\"HEROíSMO ESPARTANO\\", PORQUE HIZO RECORDAR LA VALENTíA DE LOS CIUDADANOS DE LA CAPITAL DE LA PORCIóN DE LACONIA (ESPARTA), EN LA PENíNSULA DEL PELOPONESO, EN LA ANTIGUA GRECIA. AQUí NACIERON LUIS BELTRáN PRIETO FIGUEROA, SANTIAGO MARIñO Y OTROS GRANDES PERSONAJES DE LA HISTORIA REGIONAL Y NACIONAL.\n\nESTá CONFORMADO POR TRES ISLAS: MARGARITA, COCHE Y CUBAGUA, Y ESTá DIVIDIDA EN LOS MUNICIPIOS AUTóNOMOS ARISMENDI, ANTONIO DíAZ, GóMEZ, MANEIRO, MARCANO, MARIñO, PENíNSULA DE MACANAO Y VILLALBA. LA ISLA DE MARGARITA, LA MAYOR DE TODAS LAS ISLAS, TIENE 1.071 KM². EN 1909 LA ENTIDAD QUEDó DEFINITIVAMENTE CONSTITUIDA Y EN 1947 SE LE AñADIó LA ISLA DE CUBAGUA. SU CAPITAL ES LA ASUNCIóN. OTRAS POBLACIONES IMPORTANTES SON: PORLAMAR (CAPITAL COMERCIAL), JUAN GRIEGO, PUNTA DE PIEDRAS, PAMPATAR, SAN JUAN BAUTISTA, LAS GUEVARAS, LAS HERNáNDEZ, VILLA ROSA, BELLA VISTA, EL VALLE DEL ESPíRITU SANTO, ENTRE OTRAS.\n\nLA ENTIDAD SE ENCUENTRA LIMITADA EN TODOS SUS PUNTOS CARDINALES POR EL MAR CARIBE.\n\nEN CONJUNTO, LAS TRES ISLAS DE LA ENTIDAD REúNEN MAGNíFICAS PLAYAS, MARAVILLOSOS MANGLARES Y OTROS PAISAJES QUE LA HACEN UN VERDADERO PARAíSO INSULAR. MARGARITA, LA MAYOR DE ELLAS, PRESENTA UNA ELEVACIóN MáXIMA EN EL CERRO COPEY (900 M.S.N.M) E INCLUYE AL OESTE EL NúCLEO MONTAñOSO DE MACANAO. COCHE Y CUBAGUA SON NúCLEOS ROCOSOS CUBIERTOS DE SEDIMENTOS MARINOS Y PRESENTAN UN RELIEVE PLANO, CON ACANTILADOS. EL CLIMA ES áRIDO O SEMIáRIDO, AL PUNTO DE QUE NO EXISTEN RíOS DE CORRIENTE PERMANENTE.\n\nEL TERRITORIO ESTATAL SE CARACTERIZA POR EVENTOS DE VULCANISMO, SEDIMENTACIóN, EMERSIóN, DEPOSICIóN Y LEVANTAMIENTO. ROCAS íGNEO-METAMóRFICAS DE LA ERA MESOZOICA FORMAN EL BASAMENTO DE LAS áREAS MONTAñOSAS Y SUS ESTRIBACIONES, INCLUYENDO EL PAISAJE DE COLINA, CON EXCEPCIóN DE LOS RELIEVES ONDULADOS DE PAMPATAR, CONSTITUIDOS POR SEDIMENTOS TERCIARIOS, AL IGUAL QUE EL PLANO COSTERO. LAS áREAS MARINAS MáS BAJAS SON FORMACIONES DEL PLEISTOCENO Y HOLOCENO, COMPUESTAS POR ALUVIONES, TERRAZAS LITORALES Y ALUVIALES, ARENISCAS CALCáREAS Y DEPóSITOS LAGUNARES. COCHE Y CUBAGUA SON NúCLEOS ROCOSOS CUBIERTOS DE SEDIMENTOS MARINOS.\n\nEL SECTOR ORIENTAL DE LA ISLA DE MARGARITA PRESENTA TRES PEQUEñAS SERRANíAS, ALINEADAS EN SENTIDO SURESTE-NOROESTE, CUYOS TOPES DE ALTITUD SON LOS CERROS COPEY, MATASIETE, LA GUARDIA Y GUAYAMURí; HACIA EL SUROESTE EL RELIEVE ES PLANO, CON EXCEPCIóN DE UNAS ELEVACIONES MODERADAS, CONOCIDAS COMO LAS TETAS DE MARíA GUEVARA. LA PENíNSULA DE MACANAO, EN EL SECTOR OCCIDENTAL, OSTENTA UN MACIZO ALARGADO EN SENTIDO ESTE-OESTE, ENTRE LOS CERROS MACANAO Y GUARATARO. EL RESTO SON LLANURAS COSTERAS QUE DESCIENDEN HACIA PLAYAS DE GRAN AMPLITUD. LAS ISLAS DE COCHE Y CUBAGUA OFRECEN UN TERRENO PLANO CON ALGUNOS ACANTILADOS.\n\nEL RELIEVE ESTá COMPUESTO DE LLANURAS COSTERAS, ALBUFERAS Y MACIZOS MONTAñOSOS. LAS LLANURAS COSTERAS DEL MACIZO ORIENTAL, DESCIENDEN HACIA PLAYAS OCEáNICAS DE GRAN AMPLITUD Y ARENAS BLANCAS QUE CONSTITUYEN UN GRAN ATRACTIVO TURíSTICO, PROPICIAS ADEMáS PARA ACTIVIDADES DEPORTIVAS Y DE RECREACIóN.\n\nEN EL MACIZO ORIENTAL LA ALTURA MáXIMA ALCANZA LOS 960 M Y EN SUS FLANCOS, COLINAS Y PLANICIES, EL úNICO CURSO DE AGUA PERMANENTE ES EL RíO ASUNCIóN. EL MACIZO OCCIDENTAL, LLAMADO PENíNSULA DE MACANAO CON 742 M DE ALTITUD, ALCANZA ALTURAS DE 700 M, ESTá ESCASAMENTE POBLADO Y POSEE VEGETACIóN XEROFíTICA. ESTá UNIDO AL MACIZO ORIENTAL MEDIANTE UNA ALBUFERA DENOMINADA LA RESTINGA, QUE TAMBIéN POSEE VEGETACIóN XEROFíTICA.\n\nNO EXISTEN CORRIENTES IMPORTANTES DE AGUA PERMANENTES, SINO DELGADOS RíOS ULTIMAMENTE ESTACIONALES DEBIDO A LOS CAMBIOS CLIMáTICOS QUE HAN ELEVADO LAS TEMPERATURAS EN TODO EL PLANETA EN LOS ULTIMOS AñOS. SECOS LA MAYOR PARTE DEL AñO Y CON TORRENCIALES EN LOS CORTOS PERíODOS DE LLUVIA. DE ELLOS, LOS PRINCIPALES SON EL SAN JUAN (POSAS DE SAN JUAN), SAN FRANCISCO, LA ASUNCIóN, EL VALLE, CHAGUARAMAL, EL MUCO, LA VIEJA, NEGRO Y TACARIGUA.\n\nLAS ALBUFERAS DE LA RESTINGA, LOS MáRTIRES Y LAS MARITES, JUNTO CON LAS AGUAS TERMALES DEL VALLE DEL ESPíRITU SANTO Y EL SECTOR DE SAN FRANCISCO, COMPLETAN UN SISTEMA HIDROGRáFICO ESCASO, INSUFICIENTE Y NO APTO PARA ABASTECER DE AGUA POTABLE A LA POBLACIóN LOCAL.\n\nPOSEE UN CLIMA DE ESTEPA, CON MICROCLIMAS QUE VAN DEL áRIDO MUY CáLIDO AL SEMIáRIDO FRíO. DOMINA EN MARGARITA EL CLIMA SEMIáRIDO. EN PORLAMAR LA PLUVIOSIDAD ES SóLO DE 399 MM. ANUALES CON UNA TEMPERATURA MEDIA DE 27°. LAS ZONAS DE MAYOR PRECIPITACIóN SE LOCALIZAN EN LA SERRANíA DE EL COPEY LLEGANDO HASTA 1.100 MM., QUE JUNTO A NEBLINAS LOCALES, PERMITE EL DESENVOLVIMIENTO DE BOSQUES NUBLADOS, QUE DERIVAN EN LADERAS MáS BAJAS EN FORMACIONES DE BOSQUES SECOS PREMONTANOS. LA PRECIPITACIóN ES MENOR EN LA PENíNSULA DE MACANAO, FLUCTUANDO DE 300 A 500 MM. ANUALES, CON TEMPERATURAS DE 27° A 28°. EN COCHE LA TEMPERATURA MEDIA ANUAL ES TAMBIéN ALTA CON PRECIPITACIONES DE 512 MM. ANUALES. LAS CONDICIONES DE SEQUEDAD SON RIGUROSAS EN CUBAGUA CON 250 MM. DE PRECIPITACIONES AL AñO. SI SE CONSIDERA QUE EN LOS SITIOS LITORALES Y PLAYEROS, COMO PORLAMAR, HAY SóLO 66 DíAS DE LLUVIA APRECIABLE AL AñO, SE DAN LAS CONDICIONES óPTIMAS PARA DIVERSOS TIPOS DE TURISMO. ALGUNOS EJEMPLOS DE SU CLIMA SON EL CERRO COPEY, LAGUNA LA RESTINGA, PENíNSULA DE MACANAO, LAS ISLAS DE COCHE Y GUBAGUA.\n\nLOS SUELOS DEL ESTADO NUEVA ESPARTA SON EL RESULTADO DE PROCESOS DE ADICIóN, PéRDIDA O TRANSPOSICIóN DE MATERIALES EN ZONAS áRIDAS Y DE ESCASA VEGETACIóN. SON SUELOS DELGADOS Y POCOS DESARROLLADOS, SUJETOS A INTENSOS PROCESOS EROSIVOS ACELERADOS POR EL SOBREPASTOREO, LAS OSCILACIONES DEL NIVEL DEL MAR Y LA DEFORESTACIóN REALIZADA PARA EL APROVECHAMIENTO AGRíCOLA. LOS SUELOS DE LOS VALLES, LAS TIERRRAS DE MEJOR CALIDAD, SON BIEN DESARROLLADOS, TIENEN CAPA ORGáNICA, ESTáN PROTEGIDOS DE LA ACCIóN EROSIVA DEL VIENTO Y SE ENCUENTRAN CUBIERTOS DE VEGETACIóN, PERO SóLO OCUPAN UNA PEQUEñA PROPORCIóN DEL ESTADO. EN LAS ZONAS DE PIEDEMONTE, LOS CONOS DE DEYECCIóN Y MATERIALES COLUVIALES DAN LUGAR A SUELOS MUY PEDREGOSOS. LAS ISLAS DE COCHE Y CUBAGUA PRESENTAN SUELOS CON SALINIDAD Y CON UNA FUERTE EROSIóN RESULTANTE DE LA ACCIóN DE LOS VIENTOS, LO CUAL LE CONFIERE A SU CAPA SUPERFICIAL UN CARáCTER PEDREGOSO.\n\nEN LA ISLA DE MARGARITA LOS EFECTOS CLIMáTICOS Y/O EDáFICOS HAN PRODUCIDO UNA MEZCLA DE ZONAS DE VIDA, CON VARIADOS ECOSISTEMAS QUE COMPRENDEN DESDE LA MALEZA DESéRTICA TROPICAL, EN LAS ZONAS BAJAS Y SECAS, HASTA EL MONTE ESPINOSO Y EL BOSQUE SECO TROPICAL EN ZONAS DE MAYOR ALTURA. EN EL CERRO COPEY SE ENCUENTRA EL BOSQUE HúMEDO PREMONTANO Y EN LAS ZONAS PANTANOSAS Y SALINAS ABUNDAN LOS MANGLARES. LAS ESPECIES MáS REPRESENTATIVAS SON OLIVOS, DIVIDIVE Y PARDILLO, ALREDEDOR DE LOS CERROS COPEY, MATASIETE Y GUARAGUAO. EL BOSQUE MUY SECO SE ENCUENTRA EN áREAS DE VEGETACIóN MUY INTERVENIDA. LAS PRINCIPALES ESPECIES SON: CUJí, GUATACARE, GUAMACHE, CARDóN, DIVIDIVE Y OLIVO. LOS ESPINARES Y LAS MALEZAS DESéRTICAS, FORMACIONES DOMINANTES DEL ESTADO, OCUPAN LAS LLANURAS COSTERAS. SUS PRINCIPALES ESPECIES SON ABROJO, CUJí, YAQUE, ORéGANO, TUNA, CARDóN, DIVIDIVE, GUAMACHE Y OTRAS. LAS CONCENTRACIONES DE MANGLARES SE LOCALIZAN EN LA RESTINGA, LAS MARITES Y OTRAS ZONAS DE AGUA COSTANERAS. LAS ESPECIES MáS IMPORTANTES SON EL MANGLE COLORADO, BOTONCILLO Y EL MANGLE NEGRO.\n\nLA ENTIDAD DESTACA POR SUS RECURSOS ESCéNICOS, REPRESENTADOS EN PAISAJES NATURALES, TALES COMO LAGUNAS, PLAYAS, CERROS, SALINAS Y FORMACIONES EóLICAS, TODOS DE UN GRAN POTENCIAL TURíSTICO. NO CUENTA, EN CAMBIO, CON GRANDES RECURSOS ENERGéTICOS, Y SU DISPONIBILIDAD DE MINERALES SE LIMITA A LA EXISTENCIA DE GRAVA, ARENA, CALIZA, DOLOMITA, CROMITA, MANGANESITA, TALCO Y PIEDRA. ASIMISMO, DISPONDE DE EXIGUOS RECURSOS FORESTALES: ARAGUáN, CARDóN, CUJí, YAQUE, GUAYACáN, JOBO, VERA, ENTRE OTROS. TéCNICAMENTE LA VEGETACIóN Y RECURSOS NATURALES DEL ESTADO SON POCOS POR SER TéCNICAMENTE UNA ZONA áRIDA EN MEDIO DEL MAR CARIBE, PERO, LAS PLANTAS DE CALOR COMO CACTUS, PALMERAS SON MUY VISTAS EN LAS áREAS CáLIDAS, PERO, TAMBIéN HAY ZONAS VERDES COMO EL CERRO COPEY Y OTROS.\n\nPREDOMINA EL COMERCIO, DEBIDO A LA CONDICIóN DE PUERTO LIBRE(ESTABLECIDO EN 1971 POR DECRETO PRESIDENCIAL) Y A SU VINCULACIóN CON OTRA ACTIVIDAD FUNDAMENTAL: EL TURISMO. LA INDUSTRIA DE LA CONSTRUCCIóN ES MUY IMPORTANTE, SEGúN LO DEMUESTRA LA EXISTENCIA DE HOTELES, RESTAURANTES, VIVIENDAS VACACIONALES Y CENTROS DE DIVERSIóN, COMO PARTE DE UNA INFRAESTRUCTURA QUE REVALORIZA ESTA ZONA DE INNEGABLES ATRACTIVOS PARA LOS VIAJEROS. CON LA EXPANSIóN DE LA DEMANDA, SECTORES COMO LA AGRICULTURA Y LA CRíA SE HAN REACTIVADO Y APORTAN BERENJENA, MAíZ, MELóN, AJí, PIMENTóN Y TOMATE, ADEMáS DE CAPRINOS, PORCINOS Y AVES. LA PESCA TAMBIéN SE HA BENEFICIADO DE ESTíMULOS INTERNOS Y EXTERNOS, LO QUE HA PERMITIDO AUMENTAR LA PRODUCCIóN PESQUERA EN CUANTO A (PECES); AGUJA, ANCHOA, ATúN, PARGO, COROCORO, LAMPAROSA, CARITE, TORITO, LISA, BAGRE, CAZóN, VAQUITA, JUREL, PICUA Y SARDINA (MARISCOS); CAMARóN Y LANGOSTA (CRUSTáCEOS); ALMEJA, CALAMAR, CHIPICHIPI, GUACUCO, TRIPA DE PERLA Y OSTRAS (MOLUSCOS).\n\nSU DENSIDAD SUPERA EL PROMEDIO NACIONAL Y ES UNA DE LAS MáS ALTAS DEL PAíS, DEBIDO A UN CRECIMIENTO POBLACIONAL CONSTANTE DESDE LA DéCADA DE LOS 40, SóLO FRENADO POR LA DISMINUCIóN DE LA NATALIDAD A PARTIR DE LOS AñOS 60. PARTICULARMENTE, EL DECRETO DE PUERTO LIBRE, PROMULGADO EN 1971, PROVOCó UN DRáSTICO INCREMENTO DE LA INMIGRACIóN. LA MAYOR PARTE DE LA POBLACIóN SE AGLUTINA EN LOS MUNICIPIOS MáS ESTRECHAMENTE ASOCIADOS CON LA ACTIVIDAD COMERCIAL EMANADA DEL TURISMO. EL MUNICIPIO MARIñO, POR EJEMPLO, CONCENTRA MáS DEL 23,7% DE LOS HABITANTES DE LA ENTIDAD, Y SU CAPITAL, PORLAMAR, ES EL MAYOR CENTRO ECONóMICO DE LA ISLA DE MARGARITA. LE SIGUEN EN IMPORTANCIA LOS MUNICIPIOS GARCíA Y MANEIRO, QUE SON VECINOS DE PORLAMAR, CIUDAD QUE, ANTE LA IMPOSIBILIDAD FíSICA DE SEGUIR CRECIENDO, SE HA EXPANDIDO HACIA ELLOS. OTRAS POBLACIONES IMPORTANTES SON VILLA ROSA, PAMPATAR, SAN JUAN BAUTISTA, LA ASUNCIóN, PARAGUACHí, JUANGRIEGO Y EL PILAR (LOS ROBLES).	PREDOMINA EL COMERCIO, DEBIDO A LA CONDICIóN DE PUERTO LIBRE(ESTABLECIDO EN 1971 POR DECRETO PRESIDENCIAL) Y A SU VINCULACIóN CON OTRA ACTIVIDAD FUNDAMENTAL: EL TURISMO. LA INDUSTRIA DE LA CONSTRUCCIóN ES MUY IMPORTANTE, SEGúN LO DEMUESTRA LA EXISTENCIA DE HOTELES, RESTAURANTES, VIVIENDAS VACACIONALES Y CENTROS DE DIVERSIóN, COMO PARTE DE UNA INFRAESTRUCTURA QUE REVALORIZA ESTA ZONA DE INNEGABLES ATRACTIVOS PARA LOS VIAJEROS. CON LA EXPANSIóN DE LA DEMANDA, SECTORES COMO LA AGRICULTURA Y LA CRíA SE HAN REACTIVADO Y APORTAN BERENJENA, MAíZ, MELóN, AJí, PIMENTóN Y TOMATE, ADEMáS DE CAPRINOS, PORCINOS Y AVES. LA PESCA TAMBIéN SE HA BENEFICIADO DE ESTíMULOS INTERNOS Y EXTERNOS, LO QUE HA PERMITIDO AUMENTAR LA PRODUCCIóN PESQUERA EN CUANTO A (PECES); AGUJA, ANCHOA, ATúN, PARGO, COROCORO, LAMPAROSA, CARITE, TORITO, LISA, BAGRE, CAZóN, VAQUITA, JUREL, PICUA Y SARDINA (MARISCOS); CAMARóN Y LANGOSTA (CRUSTáCEOS); ALMEJA, CALAMAR, CHIPICHIPI, GUACUCO, TRIPA DE PERLA Y OSTRAS (MOLUSCOS).	436900	NORESTE	LA ENTIDAD SE ENCUENTRA LIMITADA EN TODOS SUS PUNTOS CARDINALES POR EL MAR CARIBE	1150 KM2
