1	6	9	PEDRAZA	ciudad bolivia	El Municipio Pedraza es uno de los 12 municipios que forman parte del Estado Barinas, Venezuela. Se encuentra ubicado al oeste de Barinas y es el segundo municipio en extensión de esa entidad. Tiene una superficie de 6.693 km² y una población de 50.767 habitantes (censo 2001). Su capital es Ciudad Bolivia. La parte norte del municipio se encuentra en la Cordillera de Mérida y la zona sur del municipio se extiende por los Llanos.	sus principales fuentes economicas\n\nse basa en la agricultura, algunas de sus principales producciones son frutas tropicales y la ganadería	50767	oeste	Límites\n\nNORTE: Limita con el estado Mérida, por el límite del estado Barinas, comprendido entre los nacimientos del río Acequia ó Ticoporo, denominada Quebrada del Loro y el Alto de Granate.\n\nESTE: Limita con los municipios Barinas y Bolívar, por los limites descritos de dichos municipios en sus lados correspondientes con el municipio Pedraza y comprendido entre el Alto de Granate, el río Pajuí y la desembocadura del río Canagua, en el río Apure.\n\nSUR: Limita con el estado Apure por el río Apure desde la desembocadura del río Canagua aguas arriba hasta la desembocadura del Caño Negro y limitando con el municipio autónomo Ezequiel Zamora, continúa el limite por el Caño Negro aguas arriba hasta el punto donde es cortado por la línea Norte-Sur que parte de la desembocadura del río Suripá y de ahí siguiendo agua abajo por el río Suripa limitando con el Sur del municipio Antonio José de Sucre, hasta la desembocadura del río Ticoporo ó Acequia en el sitio conocido conocido como Puerto de Boca de Anaro.\n\nOESTE: Limita con el municipio Antonio José de Sucre, que comprende entre los nacimientos del río Acequia ó Ticoporo denominado Quebrada del Loro, de aquí el limite toma aguas abajo por el río Acequia, hasta llegar al puente situado en la troncal cinco que conduce Barinas-Santa Bárbara, continua en dirección a esta ultima hasta encontrar otro puente situado so