1	4	4	PAEZ	Guasdualito 	El Municipio Páez está ubicado en el Oeste del estado Apure, Venezuela. Es el segundo en importancia después del municipio San Fernando, su capital es la ciudad fronteriza de Guasdualito y posee una superficie de 12.820 km²\n\n Geografía \n\nA continuación, verá con detalle, los datos geográficos del municipio:\n\nRelieve \n\nEste municipio se caracteriza por poseer tanto tierras altas como bajas, el 70% del municipio se encuentra conformado por las tierras bajas o llanas del río Apure mientras que el restante lo ocupa las estribaciones de los andes tachirenses alcanzando en esta zona hasta los 3000 M.s.n.m.\n\nHidrografía \n\nEl municipio Páez posee importantes ríos como lo son el Río Apure y el río Arauca (quién sirve de límite entre Venezuela y Colombia) además de otros menores como el Sarare, Uribante, Chiquito, Nula, Cutufí y Burga.\n\nClima \n\nEl clima en la mayor porción del territorio es de tipo Sabana, con temperaturas desde los 27º hasta los 35º con excepción de la zona oeste del municipio donde se encuentra un clima templado intertropical de altura con temperaturas que van desde los 18º hasta los 27º e inclusive llegan hasta los 12º en las zonas más altas.\n\nVegetación \n\nPredomina la vegetación de Sabana (gramíneas, matorrales, arbustos bajos, selvas de galería, chaparrales, etc.).\n\nPoblación \nEl municipio Páez es el segundo más poblado luego del municipio San Fernando con el 23% de la población del estado, es decir, 88.600 Habitantes según el censo 2001. Además de la ciudad de Guasdualito, otras ciudades importantes en el municipio son: Ciudad Sucre, El Amparo, El Nula y Palmarito.\n\nEconomía \n\nEn su condición de municipio fronterizo, la zona maneja gran parte del comercio entre el Estado Apure de Venezuela y el Departamento Arauca de Colombia. Además, en este municipio se ubica el recurso forestal más importante del país, la Selva de San Camilo. Otras actividades de gran importancia son la ganadería, Agricultura, pesca y los productos relacionados.\n\nTransporte \n\nPese a que el estado Apure en general cuenta con vías de comunicación precarias, el municipio Páez cuenta con una de las únicas vías pavimentadas que lo comunica con la capital del estado (San Fernando de Apure) y con la ciudad de San Cristóbal. Además el municipio cuenta con un aeropuerto ubicado en su capital, Guasdualito, y vías marítimas a través del Río Apure que lo llevan hasta Bruzual y San Fernando de Apure.	Economía \n\nEn su condición de municipio fronterizo, la zona maneja gran parte del comercio entre el Estado Apure de Venezuela y el Departamento Arauca de Colombia. Además, en este municipio se ubica el recurso forestal más importante del país, la Selva de San Camilo. Otras actividades de gran importancia son la ganadería, Agricultura, pesca y los productos relacionados.	105419	oeste	Límites\n\nNorte: Estados Barinas y Tàchira\nSur: Municipio Ròmulo\nGallegos y Repùblica de Colombia\nEste: Municipio Muñoz y Romulo Gallegos\nOeste: Municipio Ròmulo Gallegos y Repùblica de Colombia.\n\nDIVISIÓN POLÍTICO-TERRITORIAL\nActualmente el Municipio, está conformado por cincos (5) Parroquias, distribuidos de la siguiente manera:\n\nPARROQUIA---CAPITAL\nGuasdualito---Guasdualito\nAramendi---Palmarito\nEl Amparo---El Amparo\nSan Camilo---El Nula\nUrdaneta---La Victoria\n\nSUPERFICIE, DENSIDAD Y POBLACIÓN TOTAL\nEl Municipio José Antonio Páez del Estado Apure, cuya capital es la Parroquia Guasdualito. Ocupa una extensión territorial de 12.820 Km2, lo que representa el 16,75% del total del Estado Apure.\n\nCuenta con una población de 93.200 habitantes representando el 23,63% del total del Estado Apure, siendo su densidad poblacional de 7,3 hab/km2.\n\nParroquia---Poblacion\nGuasdualito--35.215\nAramendi-- 4.018\nEl Amparo--9.634\nSan Camilo--21.065\nUrdaneta--23.268\nTotal-- 93.200\n\n\nEl Amparo: capital de la Parroquia el Amparo, fue fundada a finales del siglo XVIII, como El Amparo del paso Real de Arauca, nombrada parroquia Civil el 20 de Noviembre de 1846, en el Amparo funciona la Escuela Técnica Agropecuaria Francisco Aramendi que fue fundada en el año 1972, en el gobierno del presidente de la República Dr. Rafael Caldera; dicha escuela está ubicada frente de la Plaza Bolívar y su primer director fue el pedagogo en Zootecnia, José Vicente Gutiérrez, natural del Estado Barinas.\n\nPALMARITO: Capital de la parroquia Aramendi, fue fundada por Fray Tomas de Castro a finales del siglo XVIII. Para el año 1866 Palmario era capital del entonces Departamento de Guasdualito, segundo del Estado Apure en el orden comercial y político y en consecuencia el señor Cornelio Antonio Muñoz, puso el ejecútese y se estableció allí una ESCUELA FILARMONICA, para que se enseñara el Arte de la música, teórica y práctica a los niños pobres de la región. Palmarito fue capital del Territorio Federal, armìstico creado por el Presidente de la República, el General Antonio Guzmán Blanco en 1883, esta entidad federal tuvo una efímera vida desde 1883 hasta 1889.\n\nLA VICTORIA: Capital de la parroquia Urdaneta, fue fundada a mediados del siglo pasado por un grupo de familias dirigidas por francesco Caroprese de origen italiano, Abounasar de origen Palestino, Díaz Reina, Sánchez y otras. La Victoria fue elevada a parroquia en el año de 1937.\n\nLA TRINIDAD: La Parroquia La Trinidad, con su capital la Trinidad de Orichuna, fue fundada en el año 1771, por Fray de Granada con indígenas de etnia Yarura-Guahibas, en las inmediaciones del Río Orichuna, hoy convertido en caño.\n\n\nCIUDAD SUCRE: Se encuentra ubicada en la región del CUTUFI, parroquia Urdaneta, esta ciudad conforma otra zona fronteriza con la República de Colombia. De acuerdo con su planificación al construir la carrera marginal de la selva, debe fomentarse y estimularse las relaciones de INTEGRACIÒN entre Bolivia, Perú, Ecuador, Colombia y Venezuela. El área urbana de Ciudad Sucre coincide en superficie y límite con la zona de Doblamiento y Desarrollo designada a tal fin y de acuerdo con el decreto Presidencial Nº 2.163 de fecha 22/10/1997, su extensión es de 2.184 habitantes, delimitada por una poligonal cerrada, cuyos vértices están definidos por coordenadas UTM; se estima que para el año 2019, esta ciudad debe tener aproximadamente 13.500 habitantes.\nEL NULA: Capital del Municipio Camilo, su fundaciòn se remonta al sigo XVIII, la nombrada Vice-parroquia de San Camilo puede haber sido fundada hacia el año 1781.\n\n 	12820 km2	0
