1	3	1	ANACO	anaco	\nGEOGRAFÍA:\nUbicación: La Ciudad de Anaco es la Capital del Municipio Anaco y está ubicada en la región de los Llanos Orientales parte céntrica del Estado Anzoátegui, su ubicación es excelente, ya que se encuentra enclavada en la vía de acceso entre a región Nororiental y las demás regiones del País Esta ubicación geográfica le permite tener una gran accesibilidad hacia los Puertos de Guanta y Puerto la Cruz, así como hacia Guayana y las regiones del Centro del País.\n\nClima: La zona de Anaco y sus alrededores presenta un clima tropical semi-árido e isotermo de sabana.\n\nVegetación: Las características climáticas, relieves y condiciones geoambientales de Anaco y sus alrededores pertenecen a un tipo de vegetación dispersa formadas por gramíneas, chaparros, mantecos, etc.\n\nHidrografía: Los ríos y quebradas que surten los alrededores de la ciudad vierten sus aguas en la Cuenca hidrográfica del Caribe; son el Güario, situado al Sur y el Anaco situado al Norte; sus caudales son de escasa importancia y de carácter intermitente. La dirección de drenaje es de Este a Oeste y las Aguas desembocan en el Río Aragua tributario del Güere por cuyo cause caen el Unare, el cual finalmente desemboca en el Mar Caribe.\n\nEconomía: Anaco es el producto de la explotación petrolera y de las consiguientes transformaciones económicas, sociales y espaciales que de ella se derivan.\n\nLa presencia de las empresas petroleras y de servicios ligadas a ellas, estimulo la construcción y dio lugar a la existencia de una fuerza de trabajo de un relativo alto nivel de ingreso, por ende, de una cierta capacidad de gasto, que permitió el desarrollo indirecto de otras actividades. Estos hechos determinaron que Anaco se convertiría rápidamente en un centro densamente poblado, donde por encima de la actividad petrolera, sobresale el dinámico desarrollo del comercio y los servicios de la población.\n\nAnaco tiene la disponibilidad de importantes Reservas Petroleras y Gasíferas en la región del estado Anzoátegui.\n\nCultura: Entre los venezolanos, los margariteños han sido, los que mas influencia regionalista han inyectado en Anaco; tanto en sus costumbres como en su alimentación y religión. Desde siempre se han preocupado por conservar sus propias costumbres, siendo la única colonia venezolana que ha preservado su cultura nativa, divulgándola y promocionándola a través de su casa Nueva Esparta.\n\nReligión: Anaco desde el punto de vista eclesiástico dependió de la Diócesis de Guayana hasta el Papado de su santidad Pío XII, cuando se crea la Diócesis de Barcelona el 7 de Junio de 1954. En sus primeros años lo oficios religiosos eran atendidos por los sacerdotes de Cantaura quienes practicaban una rutinaria visita Dominical a este caserío para oficiar una misa en la escuela Socony Nº 1.\n\nA partir de 1953 dos templos se encargan de satisfacer el fervor religioso de Anaco, uno católico que fue construido en honor a la virgen del valle por el margariteño Cristino Rosas recogiendo pequeñas contribuciones entre los habitantes de este pueblo, y el otro protestante a cargo de una secta anglicana.\n\nFolklore: el predominante en el municipio Anaco es igual al resto de os municipios del estado Anzoátegui así como todos los estados nororientales del país como son: Nueva Esparta, Sucre y Monagas.\n\nTradición: En Anaco no estén fiestas patronales propias del pueblo y debido a la gran colonia margariteña aquí residenciada, la celebración del día de la virgen del valle, adquiere gran solemnidad.\n\nDesde 1953 gracias a una promesa hecha por Diego Ramón Arteaga a la virgen de hacerle decir una misa cantada, y de organizar una procesión con su imagen cada año en su día. Para cumplir su promesa Diego Ramón Arteaga, hizo construir por el carpintero Felipe González, la replica de un barco, compro una imagen de la virgen del valle y una pequeña planta eléctrica, todo esto montado sobre una plataforma rodante.\n\nEs costumbre – quizás la única que existe en Anaco ver en estas ocasiones a la virgen recorrer las calles de la población, montada sobre su barca iluminada y con don Diego encabezando la sentida manifestación religiosa.\n\nGastronomía: Dentro de la gastronomía de Anaco al igual que el resto del estado, contiene sus bases en la comida criolla oriental, a demás de comidas adoptadas de otras culturas extranjeras por ejemplo de la norteamericana las tortas de almendras y el pavo relleno de navidad, de los Españoles, Italianos y Portugueses hemos adoptado el consumo masivo de legumbres y hortalizas, y de los Árabes el tarkari, el cual se hizo plato típico en Anaco.\n\nMonumentos Históricos\n\nCasa Campo Americano\n\nSan Joaquín\n\nAnaco\n\nEs un monumento civil, fue construida a mediados del siglo XX, esta ubicada en el municipio Anaco, San Joaquín, en Buena Vista, su utilidad original fue de uso residencial, al igual que en nuestros días.\n\nAtractivos Naturales\n\nParque Las Ballenas\n\nUbicado en la av. De Campo Norte.\n\nEs un parque recreacional, el cual posee pista para caminar y trotar, cancha múltiple, cafetín y sitios para camping. 	sus principales fuentes de economia La principal industria de Anaco es la explotación gasifera, siendo la mayor productora de éste hidrocarburo a nivel nacional (se le conoce como el corazón gasífero de Venezuela) y uno de los más importantes del hemisferio.	122003	central	Al Norte con Libertad al Sur con Pedro María Freites al Este con Pedro María Freites y al Oeste Santa Ana y Aragua de Barcelona\n\n 	795 km2	0
1	3	5	CAJIGAL	Juan manuel cajigal	El Municipio Juan Manuel Cajigal es uno de los 21 municipios que forman parte del Estado Anzoátegui, Venezuela. Está ubicado al noroeste \n tiene una superficie de 1.741 km² y una población de 13.747 habitantes (INE 2007). El Municipio Cajigal está dividido en dos parroquías, Onoto y San Pablo. Su capital es el poblado del Onoto.\nGEOGRAFIA\n\nOnoto parece que fuese una de las puertas del llano, porque esa vía inmensamente larga después de esta población se pasa por San José de Unare, Zaraza, Tucupido, Valle la Pascua y sigue por la extensa llanura venezolana.\n\nOnoto se encuentra a 40 mts sobre el nivel del mar, esta situado a la margen derecha del río Unare, las playas de Pto Píritu le quedan a 90 kms de distancia. Onoto es un pueblo atractivo por el ambiente, la paz y el clima agradable de esta población.\n\nCuenta con las aguas del río Unare, la represa del cují, la represa del andino y varias lagunas.\n\nECONOMIA\n\nEn Onoto la producción agrícola y pecuaria son factores importantes que le aseguran vida propia a la población, y que en una época llegó a ser el primer municipio ganadero del estado Anzoátegui.\n\nSus tierras son fértiles y aptas para toda clase de producción agrícola, y para la cría.\n\nCULTURA\n\nDentro de la cultura de Onoto podemos observar que es gente atenta, cordial y de buen humor además de laboriosa, educada, culta y organizada, es un pueblo altamente religioso y con el regionalismo en muy alta estima.\n\nPueblo de patriotas y luchadores.\n\nRELIGIÓN\n\nOnoto figura como parroquia eclesiástica en el año 1822 y el primer párroco fue Fray Juan González López, para que Onoto pudiera figurar como parroquia eclesiástica, en esa época tenía que haber sido un pueblo con suficiente cultura y de mucho valor religioso.\n\nTambién formaban parte del curato de Onoto las parroquias de San Lorenzo, San Pablo y Guaribe Tenepe, ya que la encantada dependía de la arquidiócesis de Caracas y era atendida por el párroco de Río Chico.\n\nLa primera iglesia fue construida antes del año 1814, la construcción consistía en techo de paja, paredes de barro y piso de lajas; la primera imagen que lució el altar fue la de la virgen de las Mercedes y un crucifijo de regular tamaño.Fue construida al frente de lo que es hoy la prefectura de Onoto.\n\nCALENDARIO DE FERIAS Y FIESTAS TRADICIONALES DEL MJUNICIPIO.\n\nFECHA PATRONO LUGAR\n\n30 de noviembre Apóstol San Andrés Onoto\n\nFOLKLORE\n\nVelorios, Joropos, Contrapunteo parrandas y bailes recuerdan los onoteños de ayer, el vivo folklore venezolano de aquellos tiempos. 	ECONOMIA\n\nEn Onoto la producción agrícola y pecuaria son factores importantes que le aseguran vida propia a la población, y que en una época llegó a ser el primer municipio ganadero del estado Anzoátegui. 	13747	noreste	noroeste: con el municipio carvajal\nnorte: con el municipio bruzual\noeste: con el estado guarico\nsur : con el municipio mc gregor\nsureste: con el municipio aragua\nnorte con el municipio pirutu	1741km2	0
