1	3	6	CARVAJAL	Francisco del carmen carvajal	El Municipio Francisco del Carmen Carvajal es uno de los 21 municipios que forman parte del Estado Anzoátegui, Venezuela. Está ubicado al noroeste de dicho Estado, tiene una superficie de 125 km² y una población de 11.072 habitantes (censo 2001). El Municipio Carvajal está dividido en dos parroquías, Santa Bárbara y Valle de Guanape. Su capital es el poblado del Valle de Guanape.\nGEOGRAFIA\n\nValle Guanape como su nombre lo indica, se encuentra en un valle rodeado de espesas montañas, con una vegetación que cautiva, y riachuelos de aguas cristalinas de un río moderado, muy agradable durante el día y con una neblina que cobija en las noches.\n\nPosee hermosos lugares naturales dignos de ser visitados por turistas que buscan un sitio diferente de esparcimiento. Es un hermoso lugar donde convergen una exuberante vegetación, y un clima muy fresco.\n\nECONOMIA\n\nEs un pueblo ganadero y agricultor, en el área ganadera, se puede observar la recolección de leche en forma tradicional, donde el ordeñador inicia su diaria faena, endulzando con su canto al animal, para obtener de el la leche más fresca. Este producto es llevado al centro de acopio de Valle Guanape, donde llegan además el de otros 50 productores más de la zona y de allí distribuidos a grandes compañías pasteurizadotas. Además de varias microempresas artesanales de queso blanco.\n\nOtros productos que forman parte de la actividad económica de la población, son: sorgo, maíz, los cuales son llevados a los silos pertenecientes a la agroindustria de los estados Guarico y Aragua, café, yuca, ñame, mapuey, ocumo, cacao, naranja, mandarina, ají, tomate, etc. También se elabora el sabroso casabe, uno de los más deliciosos del estado Anzoátegui, el cual es elaborado por los pobladores de Santa Bárbara, pequeño caserío que posee extensas áreas de tierras lista para el cultivo.\n\nCULTURA\n\nVarios artistas con sus esculturas muy peculiares se destacan en Valle Guanape. Tal es el caso de Eutico Mata y su esposa quienes trabajan la madera. Eutico Mata además es especialista en el morro gallo símbolo de la cultura indígena de la cuenca del unare. Otras impresionantes obras con una delicada y exquisita finura hacen de ellos y su taller una obligada visita al lugar.\n\nTambién invitamos a deleitarse de las obras de otros hijos de esta tierra, como son las de Cruz Marín Pinto y Fernando Álvarez, quien ha realizado varias exposiciones a nivel nacional y en muchas de ellas han obtenido importantes premios.\n\nRELIGION\n\nLa fe cristiana une más a su gente con las celebraciones patronales y religiosas enriquecidas por la influencia de otras culturas asentadas en la región.\n\nTRADICION\n\nLas fiestas patronales de Valle Guanape, celebradas en el mes de Febrero, son parte de las tradiciones culturales y recreacionales que muestra esta población. Estas festividades son dedicadas a Santa Escolástica, patrona de los valleguanapenses.\n\nOtras de las celebraciones que se pueden disfrutar en el lugar son las dedicadas a San Juan, manifestaciones culturales religiosas que forman parte de la vida de sus pobladores.\n\nATRACTIVOS DE LA REGIÓN\n\nLa topografía de la región y sus configuraciones altimétricas dan al paisaje un marco de agradable policromía que proyecta la floresta, también es importante destacar que existen otros tipos de paisajes y parajes históricos, tales como: la piedra de budare, la piedra del corredor, el salto, las quinuas, la piedra de los pintos, ubicada en el centro de la población e integrada al parque los Jabilllos, la cual tiene una connotación histórica, por cuanto fue allí donde se construyó la primera casa en lo que fue territorio de los Guaqueries, se le atribuye al arriero Pedro Manuel Pinto la construcción de esta casa. Dentro de las maravillas naturales con que cuenta esta región se encuentra un túnel subterráneo, o cueva, situada en la parte alta de Fila Maestra, antiguo territorio de los indios tesermas, la cual, cuenta con una corriente de agua permanente.\n\nEsta cueva no ha sido totalmente explorada y mucho menos explotada con fines turísticos, no obstante, la mano del hombre ha cambiado la geografía regional construyendo una obra hidráulica de gran importancia como lo es la represa guacamayal, dando posteriormente origen al parque de su mismo nombre. 	ECONOMIA\n\nEs un pueblo ganadero y agricultor, en el área ganadera, se puede observar la recolección de leche en forma tradicional, donde el ordeñador inicia su diaria faena, endulzando con su canto al animal, para obtener de el la leche más fresca. Este producto es llevado al centro de acopio de Valle Guanape, donde llegan además el de otros 50 productores más de la zona y de allí distribuidos a grandes compañías pasteurizadotas. Además de varias microempresas artesanales de queso blanco.\n\nOtros productos que forman parte de la actividad económica de la población, son: sorgo, maíz, los cuales son llevados a los silos pertenecientes a la agroindustria de los estados Guarico y Aragua, café, yuca, ñame, mapuey, ocumo, cacao, naranja, mandarina, ají, tomate, etc. También se elabora el sabroso casabe, uno de los más deliciosos del estado Anzoátegui, el cual es elaborado por los pobladores de Santa Bárbara, pequeño caserío que posee extensas áreas de tierras lista para el cultivo. 	11072	noroeste	oeste con el estado guarico\nnorte con el estado miranda\nsur con el municipio cajigal\neste con el municipio bruzual	125km2	0
1	3	7	FREITES	Pedro maria de freites	El Municipio Pedro María Freites es uno de los 21 municipios que forman parte del Estado Anzoátegui, Venezuela. Está ubicado al este de dicho Estado, tiene una superficie de 7.153 km² y una población de 59.189 habitantes (censo 2001). El Municipio Freites está dividido en cuatro parroquías, Cantaura, Libertador, Santa Rosa y Urica. Su capital es el la ciudad de Cantaura.\nGEOGRAFIA.\n\nEl municipio Freites tiene como capital la ciudad de Cantaura y esta compuesto por 4 parroquias a saber: Cantaura, santa Rosa, Úrica y Libertador.\n\nEs el municipio más extenso del estado Anzoátegui, ya que su extensión territorial es de 7153 km2 lo que significa un 16.51% de la totalidad del estado, su ubicación geográfica es excepcional, ya que es una zona equidistante entre el mar caribe al norte y el río Orinoco al sur, y punto intermedio entre el estado Monagas al este y el estado Guárico al oeste.\n\nHumana y geográficamente el municipio freites es una región en donde la heterogeneidad es su característica esencial, ya que en el encontramos montañas al norte, limitante con el estado Sucre influenciada por la cordillera de la costa y el turimiquire; penillanura al noreste; llanura y mesas en el centro y al sur.\n\nECONOMIA.\n\nEl municipio Pedro María Freites es el principal productor de petróleo y gas del estado Anzoátegui y es el segundo municipio petrolero de Venezuela. Nuestro subsuelo en la mesa de guanipa es depositario de la mayor riqueza acuífera del estado Anzoátegui y esta cubierta por una red de ríos de primer orden, algunos nacen en su propia jurisdicción territorial como son: amana, guanipa, el tigre, Aragua, ocopia, el caris, etc.\n\nLa agricultura y la ganadería tradicionalmente han sido la base fundamental del proceso económico de la jurisdicción del municipio.\n\nA finales del proceso colonial, Cantaura alcanzó posición relevante en la producción y exportación de productos pecuarios. Grandes salazones de carne, cuero, cebo, e incluso ganado en pie, orientaban rumbo a otros países por lo puertos de Carúpano, Cumaná y Angostura.\n\nLas antillas y especialmente el puerto de la habana, eran destinatarios de la mayor parte de esa producción. A partir de la tercera década del siglo XX, el esquema económico se modifica sustancialmente y la producción y exportación petrolera desplaza a la pecuaria.\n\nCULTURA.\n\nAl igual a otras zonas del estado Anzoátegui, en el municipio Freites las manifestaciones culturales fundamentales están influenciadas por los estados Sucre y Nueva Esparta, especialmente a través de las diversiones. Lo auténticamente anzoatiguense se expresa en la cultura indígena, el maremare y el akatoompo son expresiones características en la mesa de guanipa.\n\nEL MAREMARE.\n\nEs una danza festiva y representa la sociabilidad del indígena en su mayor dimensión y trascendencia.\n\nEsta danza consiste en que los bailadores forman dos filas que en su constante movimiento emulan el desplazamiento de una serpiente que avanza, retrocede, se contonea y a saltos amenaza, se enrolla y desenrolla formando registros de belleza apreciable y artísticamente especial.\n\nEL AKATOOMPO.\n\nEs una fiesta ritual que se celebra el 2 de Noviembre de cada año y se realiza en memoria de los difuntos de las familias Kariña. Existe la creencia de que los ausentes regresan y se incorporan a la festividad y a su encuentro con familiares y amigos además de visitantes de las comunidades indígenas, los cuales se incorporan al ritual. Bebidas, canto, danza y jolgorio. El colectivo emula o escenifica aspectos resaltantes de la personalidad del ausente, gestualidad, anecdotario, vivencias, travesuras, etc.\n\nRELIGIOSO.\n\nEl ministerio cristiano de Cantaura gira alrededor de la virgen de la Candelaria y de San Francisco de Asís. Históricamente destacan 3 sacerdotes, Fray Fernando Jiménez, el fundador quien ejerció su servicio sacerdotal hasta el año 1742; Fray Nicolás de Odena, (1842-1894) guía espiritual de las generaciones y Rafael Granato, (1900-1935).\n\nLa iglesia Nuestra Sra. de la Candelaria, es asiento histórico de la imagen venerada, existe en la ciudad de Cantaura, el complejo religioso recreacional El Paseo de la Virgen, en donde además se concentra el moderno y funcional polideportivo y novísimo gimnasio cubierto.\n\nLo cristiano se conjuga con otros cultos, como ocurre en toda Venezuela, pero en el caso de Cantaura alcanza otras dimensiones, por ejemplo las comunidades indígenas de la mesa de guanipa, la cosmogonía y lo telúrico ancestral, encuentran referencia en mitos y leyendas, íntimamente asociadas a cerro negro, santuario religioso ancestral kariña. 	ECONOMIA.\n\nEl municipio Pedro María Freites es el principal productor de petróleo y gas del estado Anzoátegui y es el segundo municipio petrolero de Venezuela. Nuestro subsuelo en la mesa de guanipa es depositario de la mayor riqueza acuífera del estado Anzoátegui y esta cubierta por una red de ríos de primer orden, algunos nacen en su propia jurisdicción territorial como son: amana, guanipa, el tigre, Aragua, ocopia, el caris, etc.\n\nLa agricultura y la ganadería tradicionalmente han sido la base fundamental del proceso económico de la jurisdicción del municipio.\n\nA finales del proceso colonial, Cantaura alcanzó posición relevante en la producción y exportación de productos pecuarios. Grandes salazones de carne, cuero, cebo, e incluso ganado en pie, orientaban rumbo a otros países por lo puertos de Carúpano, Cumaná y Angostura.\n\nLas antillas y especialmente el puerto de la habana, eran destinatarios de la mayor parte de esa producción. A partir de la tercera década del siglo XX, el esquema económico se modifica sustancialmente y la producción y exportación petrolera desplaza a la pecuaria. 	29189	este	limita al Norte: con el Estado Sucre y el Municipio Libertad; al Sur: con el Municipio Independencia, el Municipio Guanipa y el Municipio Simón Rodríguez; al Este: con el Estado Monagas; y al Oeste: Mun