e concluyeron 5 años después, (1882). Hoy en día la iglesia se está remodelando para así poder continuar con sus labores religiosas al servicio de dios. 	 ECONOMÍA\n\nEl sector económico está integrado por pequeñas y medianas empresas, comercio informal, restaurantes, agricultura, ganadería, cría de cerdos, cabras, ovejas, y aves, además se desarrolla la industria pesquera fluvial. 	26141	sureste	NORTE: Limita con los municipios Guanipa y freites.\nSUR: Limita con el estado Bolívar.\nESTE: Limita con el estado Monagas.\nOESTE: Limita con las parroquias Boca del pao y Atapirire. 	60306km2	0
1	3	8	GUANIPA	san jose de guanipa	El Municipio San José de Guanipa es uno de los 21 municipios que forman parte del Estado Anzoátegui, Venezuela. Está ubicado al este de dicho Estado, tiene una superficie de 792 km² y una población de 64.016 habitantes (censo 2001). Su capital es San José de Guanipa nombre también de la única parroquía del municipio.\nGeografía\n\nGeográficamente esta ubicada en la parte Sur del Estado Anzoátegui, área de relieve homogéneo, aunque presentan algunas colinas y zonas sometidas a procesos erosivos, baja fertilidad de sus suelos por la presencia marcada de un largo periodo de sequía y uno de lluvia, sus suelos estad conformados por sedimentos residuales proveniente del Escudo Guayanés, con abundante arena cuarcíferas y granos pobremente redondeados, gravas limos, y arcilla, algunas veces presentan cubiertas de oxido de hierro, de clima seco en lo externo y húmedo en el subsuelo a consecuencia del reservorio de agua de manantiales subterráneos, con vegetación de bosques de galería, donde destacan los morichales que son los más predominantes, los cuales constituyen verdaderos oasis dentro de la sabanas\n\nLimites del Municipio Guanipa\n\nNorte: Con el Municipio freites\n\nSur: Con el Municipio Simón Rodríguez\n\nEste: Con el Municipio Independencia\n\nOeste: Con el Municipio Simón Rodríguez\n\nEconomía\n\nLa actividad económica principal de El tigrito es la comercial la cual se mueve bajo el producto de la venta petrolera, que en nuestro caso uno de los vasos comunicantes son las empresas de servicios (contratadas).\n\nPor otro lado la labor agropecuaria del Municipio es escasa y el mayor movimiento que existió en esta área fue hasta la década de los 70 con la producción manicera.\n\nEntre los principales cultivos encontramos maní, caña, lechoza, yuca, cebolla, patilla, sorgo, maíz, entre otras.\n\nPor otra parte se desarrolla la actividad ganadera vacuna en menores cantidades.\n\nCultura\n\nTomando en cuenta que este como todo pueblo minero se forma a la saga de las explotaciones según el tipo, que en nuestro caso la petrolera, lo cual tiene una desventaja en el aspecto cultural ya que su gente viene de diferentes regiones del país incluso del extranjero existiendo una diversidad de costumbres y tradiciones que forman una heterogénea amalgama, pero que en todos los encuentros tiende a predominar una, se podría enfatizar que no hay arraigo cultura que predomine en el comportamiento actual de su gente.\n\nRegión\n\nDentro de los datos religiosa de esta población encontramos registros de que para el año 1938 se inaugura la Santa Iglesias Parroquial, y la primera misa oficial se celebro en el año la Diócesis de Barcelona decreta la imagen de San José como patrono del El Tigrito. 	 Economía\n\nLa actividad económica principal de El tigrito es la comercial la cual se mueve bajo el producto de la venta petrolera, que en nuestro caso uno de los vasos comunicantes son las empresas de servicios (contratadas).\n\nPor otro lado la labor agropecuaria del Municipio es escasa y el mayor movimiento que existió en esta área fue hasta la década de los 70 con la producción manicera.\n\nEntre los principales cultivos encontramos maní, caña, lechoza, yuca, cebolla, patilla, sorgo, maíz, entre otras.\n\nPor otra parte se desarrolla la actividad ganadera vacuna en menores cantidades. 	64016	sureste	\nNorte: Con el Municipio freites\nSur: Con el Municipio Simón Rodríguez\nEste: Con el Municipio Independencia\n\nOeste: Con el Municipio Simón Rodríguez	792km2	0
