1	3	15	PEÑALVER	peñalver 	El Municipio Fernando de Peñalver es uno de los 21 municipios que forman parte del Estado Anzoátegui, Venezuela. Está ubicado al noroeste de dicho Estado, tiene una superficie de 643 km² y una población de 24.819 habitantes (censo 2001). El Municipio Peñalver está dividido en tres parroquías, Puerto Píritu, San Miguel y Sucre. Su capital es la ciudad de Puerto Píritu.\n\nTiene problemas ambientales en las dos lagunas más grandes del Estado anzoátegui, la Laguna de Píritu y la Laguna de Unare\n\nCULTURA\n\nPíritu, tierra de hombres ilustres, religiosos, trabajadores, tenaces, cordiales y de incomparable valor.\n\nRELIGIÓN\n\nLos piriteños son un pueblo muy devoto, su mayor orgullo es su patrona La Inmaculada Concepción, a quien veneran con respeto y amor, y a su iglesia, joya colonial la cual se construyó cerca de la única fuente de agua dulce, y donde se inicio la historia de esta peculiar comunidad. Como en esa época fue la catequización de los indios chacopatas y píritus, ameritó que la construcción fuese en una loma al oeste de la quebrada de la iglesia Ntra. Sra. de la Concepción de María Santísima.\n\nCALENDARIO DE FERIAS Y FIESTAS PATRONALES DEL MUNICIPIO\n\nFECHA\n\t\n\nPATRONO\n\t\n\nLUGAR\n\n08 de Diciembre\n\t\n\nInmaculada Concepción\n\t\n\nPíritu\n\nTRADICIONES\n\nCarnavales turísticos y folklóricos\n\nDesde 1988, se vienen realizando los carnavales turísticos de Puerto Píritu, con comparsas, elección de reinas, templetes y festivales playeros.\n\nFestivales playeros\n\nEvento deportivo que se realiza en la playa durante los carnavales y semana santa. Organizado por la alcaldía de Peñalver y patrocinado por empresas privadas. Se realizan competencias deportivas y se ameniza con minitecas y grupos musicales.\n\nLEYENDAS\n\nCuando salían las familias a sentarse en las noches en las aceras, lo hacían como a escondidas y la mayoría de sus charlas giraban en torno a los aparecidos, parece que en Píritu tanto la sayona, el ánima sola, el caballo enfrenado y la llorona, cuando llegaba la media noche tomaban el pueblo por su cuenta. Estos podían encontrarse en cualquier parte del pueblo.\n\nLa sayona\n\nSegún los piriteños tenía su sitio predilecto que era la esquina de la fragua, y fecha para hacer su debut. Todo el que tenía la mala suerte de topársela contaba que este espanto ni pestañeaba cuando lo sorprendía un vivo y que se gastaba una pose como los transformistas de la Av. Casanova.\n\nLa llorona\n\nTenía su fecha para hacer su aparición. Esta bajaba por el alto de la iglesia llorando a moco tendido y a todo gañote llamando a su hijo muerto.\n\nEl cabello enfrenado\n\nEra un fantasma según los que lo vieron, lujoso y se gastaba un caballo pura sangre con frenos de oro cochano, las polainas y espuelas del jinete eran del mismo metal. Dicho espectro se instalaba en la esquina de una casa que quedaba frente a la fragua y en la cual prendían un farol, este espanto no molestaba a nadie, pero impresionaba por el gran lujo que ostentaban tanto el jinete como el caballo.\n\nEl ánima sola\n\nEra la más pendeja del grupo, hacia sentir su presencia con un silbido agudo y prolongado que cruzaba el espacio.\n\nARTESANÍA\n\nEn el área se puede encontrar una gran variedad de piezas en madera y cuero, tales como; masas, sillas, taburetes, y utensilios de cocina, los cuales son elaborados con cántaro de árbol de corteza blanda, esta artesanía puede ubicarla en la carretera de la costa.\n\nGASTRONOMÍA\n\nLas comidas típicas de esta región son: el sudado de lebranche, lisa asada, cachicamo, sancocho de pescado, camarón guisado, ensalada de camarón, consomé de chipichipi y relleno cachicameado. En cuanto a las bebidas tradicionales encontramos el ron de ponsigué, Píritu curtido y guarapitá. En la dulcería podemos degustar dulces tradicionales como el de mamón, de hicaco, jobo de la india, cereza, conserva de coco, majarete, y arroz con coco.\n\nMonumentos Históric os\n\nIglesia Nuestra Sra. de la Concepción.\n\nEs un monumento religioso, fue construido a mediados del siglo XVI, esta ubicado en el Municipio Peñalver, Píritu, al lado del cementerio por la carretera nacional a la derecha, su utilidad original y hasta nuestros días es religiosa.\n\nLa Fragua de Píritu\n\nEs un monumento civil, no se tiene fecha exacta de construcción, esta ubicada en el Municipio Peñalver, Píritu, en la calle Cantaura, su utilidad original fue de aljibe en la actualidad son ruinas.\n\nOtros Atractivos\n\nBasílica “Cristo de José”\n\nEsta ubicada en la carretera de la costa, a 30 Km. De Puerto la Cruz, en su diseño destaca una gran cúpula metálicas, de color bronce que cubre el templo, el cual carece de paredes. Esta rodeada de jardines y cuenta con estacionamiento y parque infantil. El 20 de noviembre de 1994 fue declarado monumento Diocesano del Estado Anzoátegui su imagen del Cristo de José fue declarada patrimonio del Estado.\n\nIglesia Nuestra Sra. de los Desaparecidos\n\nEs una iglesia de reciente construcción diseñada por el arquitecto Alfredo Armas, por su diseño contemporáneo es considerado una joya arqueológica, recibiendo así un premio Nacional de Arquitectura.\n\nSitios Culturales\n\nMuseo de artes El Sol de las Botellas\n\nCreado por el poeta Douglas Gutiérrez, fue inaugurado el 28 de agosto de 1993, el detalle de la botella en círculos incrustada en unas de las paredes, da origen a su nombre. Este museo esta formado por 5 salones; uno con pieza de madera y metal, otro con piezas de vidrio y cerámicas, uno con pinturas y tapices, un salón para diseño y un ultimo para artistas invitados. \nLas principales industrias del estado son las relacionadas con la producción del petróleo y gas, así como las que procesan los derivados de estos hidrocarburos. En su territorio operan la refinería de Puerto La Cruz; el Complejo Petroquímico José Antonio Anzoátegui, en Jose; así como parte del complejo gasífero más importante de Venezuela	Las principales industrias del estado son las relacionada