1	5	2	CAMATAGUA	camatagua	Municipio Camatagua es uno de los 18 municipios que forman parte del Estado Aragua, Venezuela. Tiene una superficie de 780 km² y una población de 15.186 habitantes (censo 2001). Su capital es la ciudad homónima de Camatagua. Se encuenta ubicado al sur del Estado Aragua en Los Llanos centrales donde se encuentra el Embalse de Camatagua. La economía del municipio es fundamentalmente agrícola.\n\nLIMITES DE CAMATAGUA\n\n\n\nPor el Norte: Con el Municipio San Casimiro, de donde el río Guarico recibe el nombre de Zuata.\n\nPor el Sur: Limita con el Municipio Urdaneta hasta llegar debajo de la quebrada los Apamates, que desemboca en el río Cura.\n\nPor el Este: Limita con el Municipio Urdaneta en el sentido sur franco pasando por el cerro el aguacate.\n\nPor el Oeste: Limita con el Municipio San Sebastián, con rumbo norte va al alto de Rusito en la loma de Margarito.\n\nFue fundada, en 1.693, con el nombre de Purísima Concepción de Camatagua. Por Ambrosio de Baza, quien era fraile capuchino, una vez muerto Baza, en la comunidad que fundo los indios se dispersaron y volvieron a sus tribus. Es refundada en el año 1.716, por Jerónimo Pérez Valenzuela, quien le da el nombre de “Camatagua”.\n\n\nCamatagua, era un Caserío que se encontraba ubicada Geográficamente al centro de las de mas poblaciones, del Sur del Estado Aragua, emplazada a 260 m de altitud en la orilla occidental del río Guárico, se comunica por vía terrestre con los valles de Tuy, Aragua y los Llanos Centrales. Debe su nombre a los indios, que en su vocabulario la llamaban “Camatagua” a la flor de la pasionaria planta trepadora, de origen Sur Americano cuyo nombre científico es pasiflora, pues así la llamaban los indios que habitaban esta región dada la forma de la flor los misioneros vieron en ella los símbolos de la pasión de Cristo y por eso la llamaron pasionaria. De hay vino el nombre científico de “pasiflora” para designar, las plantas de este género por correlación, Camatagua vino entonces hacer pasionaria o flor de la pasión, según Arístides Rojas, Camatagua es también patrimonio Oriental.\n\n\nOtros consideran que es una especie de gallinácea silvestre de carne delicada y muy apreciada, que debía abundar en las tupidas arboledas y espesuras de los montes cercanos a Camatagua.\n\n\nSe localizan en las cercanías instalaciones para comunicaciones satelitales. Algunas zonas agrícolas están cambiando de uso con la construcción de áreas de recreo para el disfrute de la población residente en las grandes ciudades.\n\n\nEl Municipio Autónomo Camatagua esta integrado por la Parroquia Foránea de Carmen de Cura, tres caseríos que son: Carutico, La Frideña y El Jobal y su Capital Camatagua.\n\n\nLIMITES DE CAMATAGUA\n\n\nPor el Norte: Con el Municipio San Casimiro, de donde el río Guarico recibe el nombre de Zuata.\n\nPor el Sur: Limita con el Municipio Urdaneta hasta llegar debajo de la quebrada los Apamates, que desemboca en el río Cura.\n\nPor el Este: Limita con el Municipio Urdaneta en el sentido sur franco pasando por el cerro el aguacate.\n\nPor el Oeste: Limita con el Municipio San Sebastián, con rumbo norte va al alto de Rusito en la loma de Margarito.\n\n\n1. Superficie: El Municipio Camatagua tiene una superficie de 569,32 Kilómetros Cuadrados (Km2).\n\n2. Población: El Municipio Camatagua tiene una población aproximada de 35.000 habitantes.\n\n3. Vegetación: La vegetación predominante es de baja densidad y esta constituida por bosques livianos, con especies de sabanas, matorrales y arboledas. Cerca del centro poblado existen especies tales como: Caoba, Samán, Cedro, Apamate, Roble, etc.…\n\n4. Relieve: Se caracteriza por ser ondulado plano donde las pendientes oscilan entre 0 a 10% a excepción de pequeñas colinas localizadas hacia el norte de Camatagua (presentan mayor altura y pendientes de hasta 30%), hacia el Sur Este. Y una topografía ondulada con unas pendientes promedio de 8%, Camatagua se localiza a una altura de 245,6 m.s.n.m.\n\n5. Geología: El pueblo de Camatagua se caracteriza por la presencia de un sustrato sedimentario fundamentalmente de edad terciaria (Oligoceno Mioceno) producto de la erosión y arrastre de sedimentos provenientes de las serranías del interior y se encuentra conformado por una litología asociada, sin resistencia a la erosión lo que restringe, en cierta medida el soporte de la infraestructura.\n\n6. Hidrografía y Drenaje: Camatagua se encuentra drenadas por el río Guarico, representados en sus nacientes, lo que disminuye el riesgo de inundaciones, por otra parte sus afluentes, las quebradas Camatagua, ojo de agua y Calanche. Presenta un régimen intermitente de lluviosidad y la baja pendiente del sector permite que durante los periodos de mayor precipitación se produzcan inundaciones de mediana duración y ocasionales. En la época de lluvias se observan numerosas quebradas hacia el Sur y el Este del pueblo como también del Norte y Noreste no se presentan problemas de drenaje. En la quebrada de Calache descargan las aguas negras del centro poblado.\n\n7. Localización Geográfica: La población de Camatagua se encuentra localizada en la región Central correspondiente al pie de monte y altiplanicie del Sur, entre las coordenadas U.I.M.N. 1081000 y N-1085000 de latitud Norte y E- 7285000 y 73100 de longitud Oeste, a la orilla occidental del río Guarico.	las principales fuentes de la economia es la agricultura	35000	sur	LIMITES DE CAMATAGUA\n\n\nPor el Norte: Con el Municipio San Casimiro, de donde el río Guarico recibe el nombre de Zuata.\n\nPor el Sur: Limita con el Municipio Urdaneta hasta llegar debajo de la quebrada los Apamates, que desemboca en el río Cura.\n\nPor el Este: Limita con el Municipio Urdaneta en el sentido sur franco pasando por el cerro el aguacate.\n\nPor el Oeste: Limita con el Municipio San Sebastián, con rumbo norte va al alto de Rusito en la loma de Margarito.	56932km2	0
1	5	3	GIRARDOT	girardort	El Municipio Girardot es el más poblado del estado venezolano de Aragua, cuya capital es la ciudad de Maracay. El municipio está situado en la zona noroccidental del Estado Aragua, y limita al norte con el Mar Caribe, al sur con el municipio Libertador, al este con los municipios Santiago Mariño y Linares Alcántara y al oeste con el Lago de Valencia, los municipios Mario Briceño Iragorry y Ocumare de la Costa de Oro y el vecino Estado Carabobo.\n\nEl nombre del municipio es en homenaje al prócer independentista y coronel antioqueño Atanasio Girardot, quien se unió al ejército del Libertador Simón Bolívar en Nueva Granada durante la preparación de la Campaña Admirable, muriendo en el sitio de Bárbula en el año 1813. La autoridad del Municipio Girardot es el Alcalde Humberto Prieto, quien gobierna desde el año 2000 cuando ganó las elecciones locales, apoyado por el Movimiento Quinta República.\n\n Geografía \n\nEl municipio Girardot tiene un relieve diverso: al norte presenta una estrecha franja litoral, en la costa Caribe, donde se encuentran algunas de las playas más hermosas de Venezuela y el mundo, como Choroní, Cepe y Chuao. Esta franja está delimitada al sur por la Cordillera de la Costa, la cual está constituida por dos ramales: la serranía del litoral, con montañas altas y fuertes pendientes, y la serranía del interior, de menor elevación. Entre ambas serranías se localizan la depresión del Lago de Valencia o de Tacarigua y numerosos valles fluviales, llamados cotidianamente Valles de Aragua.\n\nEnclavado en la serranía del litoral, se encuentra el Parque Nacional Henri Pittier, con su típica vegetación de selva nublada y una biodiversidad asombrosa: existen más de 150 especies botánicas únicas y el 6.5% de las especies de aves del planeta (locales y migratorias).[1]\n\nHacia el sur, el municipio Girardot está totalmente urbanizado y la zona corresponde al área metropolitana de la ciudad de Maracay, que actualmente rebasa los límites municipales hacia el sur, este y oeste. El Lago de Valencia baña el sur del municipio y en los últimos años su volumen se ha recuperado considerablemente, inundando áreas que se encontraban urbanizadas al sur de Maracay. La serranía del interior se levanta, aunque con menores elevaciones que la del litoral, separando los Valles de Aragua de los Llanos centrales.\n\n\nClima \n\nEn el municipio, se presentan dos períodos climáticos durante el año: lluvioso entre mayo y octubre, y de sequía entre noviembre y abril. Las mediciones pluviométricas en Maracay (a 434 m.s.n.m.) indican una precipitación media anual de 902 mm.[2] Las temperaturas medias varían poco entre los meses más fríos y más cálidos, y oscilan, dependiendo de diversos factores locales entre 16°C en las zonas montañosas y 30°C en la zona del litoral.\n\n\nParroquias \nParroquias del Municipio Girardot, Aragua, Venezuela\nParroquias del Municipio Girardot, Aragua, Venezuela\n\nEl Municipio Girardot se divide en 7 parroquias urbanas y 1 extraurbana. La población reflejada confiere al censo realizado en el año 2.001. Se estima que para 2006, el municipio obtuvo un crecimiento del 25% en su población, incremento que se refleja en poco más de 100.00 habitantes, y rebasa el medio millón de ciudadanos, tal y como aparece reseñado en el cuadro superior izquierdo inicial.\n	n las actividades económicas del municipio girartdot destacan los empleos industriales y de servicios que se generan en el Área Metropolitana de Maracay, en las ciudades de Turmero, La Victoria, Cagua y en otros centros urbanos situados en los Valles de Aragua y en las cabeceras del valle del Tuy en Sabaneta y Las Tejerías, con: importantes industrias ensambladoras de automóviles, metalmecánicas, productos químicos, textilerías, agroindustrias y procesadoras de alimentos. De significación son las actividades de transportistas y comerciantes.	435679	noroccidental	NORTE\n    Limita por el Mar Caribe, desde Punta Mosquito, con coordenadas N: 1.161.