1	11	5	CARIRUBANA	punto fijo 	El Municipio Carirubana es uno de los 25 municipios que integran el Estado Falcón, en Venezuela, está ubicado al sur de la Península de Paraguaná. Tiene una superficie de 684 km² y una población de 203.583 habitantes (censo 2001). Su capital es la ciudad de Punto Fijo, centro de las actividades comerciales e industiales del Estado Falcón.\n\nEl primer periódico (diario) fue llamado El Timón, un órgano fundado por la Unión de Marinos Petroleros y Mercantes de Venezuela. Estaba dirigido por un maestro de nombre Luis Alberto Méndez. Se tiraba en multígrafo y era un periódico eminentemente de oposición al gobierno de turno.\n\nActualmente el municipio está en pleno auge turístico, entre los proyectos existentes en la expansión comercial económica de la ciudad está la construcción de grandes obras, entre ellas un Centro Comercial llamado Sambil Paraguaná que además contará con un hotel de 145 habitaciones.\n\nLímites\n\nNorte: con los municipios Los Taques y Falcón del Estado Falcón\nSur: con el Golfete de Coro\nEste: con el Municipio Falcón del Estado Falcón\nOeste: con el Mar Caribe 	\n\nOPORTUNIDADES PRODUCTIVAS\n\n    * La principal actividad económica es la refinación petrolera y de ella se derivan actividades conexas en servicios, construcción, pequeña y mediana Industria, comercio y otras, generadoras de empleos directos e indirectos.\n    * La actividad pesquera tanto artesanal como Industrial tiene su asiento en los puertos de Las Piedras, Guaranao y muelles privados\n    * La pesquería artesanal constituye una actividad importante en las zonas de Carirubana, Las Piedras y Punta Cardón. La organización de los pescadores (Cooperativas, Asociaciones), la implantación de políticas de asistencia técnica y financiamiento, potenciarán efectivamente esta actividad y se generará mayor empleo y productos pesqueros para el mercado local y nacional.\n    * Los Puertos de Las Piedras y Guaranao constituyen la sede de la segunda flota pesquera de importancia en el país y genera empleos directos e indirectos.\n    * La promoción internacional de la Zona Franca industrial, comercial y de servicios de Paraguaná ofrece oportunidades reales con incentivos fiscales de instalación de empresas en la ZONFIPCA.\n    * La declaración de la Península de Paraguaná como Zona libre de la "mosca de la fruta" le confiere una oportunidad privilegiada para el cultivo, procesamiento y exportación de cucurbitáceas (melón, patilla, etc.) a Estados Unidos de Norteamérica; sin restricciones fiscales o sanitarias para el producto. Este proyecto incorporará mano de obra agrícola e inversiones agrícolas en el corto plazo\n    * La formación y capacitación de la juventud de la localidad en áreas de actividad turística, agregando el conocimiento y dominio de otro idioma (Inglés), garantizará el recurso humano capacitado para desarrollar la actividad turística.\n    * La alcaldía del Municipio Carirubana otorga exenciones fiscales hasta por tres (3) años, a las empresas que se instalen en el territorio del Municipio.\n    * La industria de la construcción naval posee un amplio desarrollo, tanto a nivel industrial como para la pesca artesanal y transporte marítimo.\n    * Las posibilidades de la instalación de plantas Petroquímicas aguas abajo de la Refinación de petróleo se evidencia como una oportunidad para la generación de empleo masivo.\n    * Forma parte de la Unidad turística Península de Paraguaná, y es zona libre de inversión turística.\n    * El Eje Punto Fijo – Punta Cardón concentran la oferta de servicios básicos y el Comercio para la población de la Península\n    * En el marco de la Zona Libre, es el escenario ideal para desarrollar los productos turísticos:Punto Fijo de Negocios, Guaranao: Puerto de Cruceros y Balcón del Caribe.\n\nZONAS INDUSTRIALES\n\nEl Municipio cuenta con 2 zonas industriales:\n\n    * Zona Franca Industrial, Comercial y de Servicios de la Península de Paraguaná (ZONFIPCA)\n    * Zona Industrial " Las Galeras" (Sector privado)\n	203583	norte	Límites\n\nNorte: con los municipios Los Taques y Falcón del Estado Falcón\nSur: con el Golfete de Coro\nEste: con el Municipio Falcón del Estado Falcón\nOeste: con el Mar Caribe 	684 km2 	0
1	11	6	COLINA	la vela de coro 	El Municipio Colina es uno de los 25 municipios que integran el Estado Falcón, Venezuela. Su capital es el poblado de La Vela de Coro. Tiene una superficie de 582 km² y se estima que para 2007 cuenta con más de 33.000 habitantes. El municipio está conformado por cinco parroquias, La Vela de Coro, Acurigua, Guaibacoa, Las Calderas y Macoruca.\n\nUno de los acontecimientos históricos más importantes que han ocurrido en este territorio fue el desembarco de Francisco de Miranda en La Vela de Coro el 3 de Agosto de 1806 cuando iza la primera bandera venezolana. En 1993 La Vela de Coro es delcarada Patrimonio de la Humanidad, debido a la preservación del casco colonial de la ciudad donde convergen construcciones españolas y holandesas con influencias indígenas. En 2006 es inaugurado en las orillas dl Mar Caribe el Paseo Generalísimo Francisco de Miranda que junto al monumento a éste Prócer de la independencia venezolana y el paseo de las banderas forman otro de los principales atractivos turísticos del municipio. En la zona sur del Municipio Colina se encuentra el Parque Nacional Sierra de San Luis\n\nDebido a la cercanía (12 km) de La Vela de Coro con la capital del Estado Falcón, Coro el intercambio comercial es un factor importante en la economía del municipio.\n\nLímites\n\nNorte: con el Mar Caribe\nSur: con el Municipio Petit del Estado Falcón\nEste: con el Municipio Zamora del Estado Falcón\nOeste: con los municipios Miranda y Petit del Estado Falcón \n\nOPORTUNIDADES PRODUCTIVAS\n\n    * La rehabilitación del casco colonial de la localidad de la Vela de Coro, que forma parte de la Declaratoria de Coro y La Vela de Coro como Patrimonio Cultural de la Humanidad (UNESCO,1993), garantizará una mayor atracción turística y por ende empleos e ingreso.\n    * La pesquería artesanal constituye una actividad importante en la zona de la Vela de Coro. La organización de los pescadores, y la implantación de políticas de asistencia técnica y financiamiento, potenciarán efectivamente esta actividad y se generará mayor empleo y productos pesqueros para el mercado local y nacional.\n    * La adopción de una Política Comercial Nacional dirigida al intercambio de bienes, servicios y turistas desde el Puerto de Muaco en la Vela de Coro hasta las Antillas Neerlandesas y viceversa, a través de la comunicación marítima por Ferrys (transporte marítimo de vehículos, carga y pasajeros) con el propósito de generar una fuente de suministro de bienes a las Antillas, generará una dinámica económica capaz de crear empleos y riqueza.\n    * La adecuación y dotación de servicios a la Zona Industrial de Sabana Larga es una oportunidad de concentrar pequeñas y medianas industrias que generarán empleos directos e indirectos.\n    * La población de la Vela de Coro, se encuentra ubicada a 14 kilómetros del Aeropuerto Internacional "José Leonardo Chirinos" en Coro.\n    * Junto con los municipios Miranda, Petit y Zamora conforma una importante oferta agro-eco-turística y productiva.\n\nZONAS INDUSTRIALES\n\nEl Municipio cuenta con la zona industrial Sabana Larga 	OPORTUNIDADES PRODUCTIVAS\n\n    * La rehabilitación del casco colonial de la localidad de la Vela de Coro, que forma parte de la Declaratoria de Coro y La Vela de Coro como Patrimonio Cultural de la Humanidad (UNESCO,1993), garantizará una mayor atracción turística y por ende empleos e ingreso.\n    * La pesquería artesanal constituye una actividad importante en la zona de la Vela de Coro. La organización de los pescadores, y la implantación de políticas de asistencia técnica y financiamiento, potenciarán efectivamente esta actividad y se generará mayor empleo y productos pesqueros para el mercado local y nacional.\n    * La adopción de una Política Comercial Nacional dirigida al intercambio de bienes, servicios y turistas desde el Puerto de Muaco en la Vela de Coro hasta las Antillas Neerlandesas y viceversa, a través de la comunicación marítima por Ferrys (transporte marí