1	11	9	FALCON	pueblo nuevo	El Municipio Falcón es uno de los 25 municipios que integran el Estado Falcón, Venezuela dentro de él está el Cabo de San Román punto más septentrional del territorio continental de Venezuela. Se encuentra ubicado al oeste de la Península de Paraguaná, ocupa un área de 1.577 km² y tiene una población de 40.879 habitantes (censo 2001). Su capital es Pueblo Nuevo.	OPORTUNIDADES PRODUCTIVAS\n\n    * Forma parte de la unidad turística de la Península de Paraguaná. Por la belleza y calidad de sus playas, se desarrollará el producto turístico "Playas del Este", comprendido desde el sector La Bocaina hasta el sector Piedras Negras.\n    * Es factible el desarrollo del producto "Media Luna de Pueblos y Hatos", que comprende la recuperación de más de 29 casas de hatos y su entorno con la finalidad de desarrollar un tipo de turismo de aventura en zonas áridas.\n    * La declaratoria de Filas de Monte Cano, Cabo de San Román y Golfete de Coro como áreas bajo régimen de administración especial contribuirá a la conservación de áreas que apoyarán el desarrollo turístico del municipio.\n    * El desarrollo del producto turístico " Bahías del Norte", entre Cabo San Román y Morros de Chaure constituye una oportunidad de desarrollo de turismo de baja densidad pero de altísima inversión.\n    * El Cerro Santa Ana con 840 m.s.n.m, es la más imponente elevación en la Península de Paraguaná. La vegetación allí existente es única.\n    * La Laguna de Boca de Caño constituye uno de los refugios de Fauna más importante de América Latina para las aves migratorias de otras latitudes. Representa una oportunidad de turismo de recreación y contemplación.\n    * El Cabo de San Román se ubica en el punto más al norte de América del Sur. Posee bellezas escénicas de playa y médanos.\n    * El Cerro de Monte Cano posee una flora endémica que caracteriza la zona. Existen senderos de interpretación bien interesantes para recorrer.\n    * Pueblo Nuevo, capital del municipio se consolida como centro oferente de servicios básicos del oeste de la Península de Paraguaná. Es la sede de la Corporación para la Zona Libre para el Fomento de la Inversión Turística de la Península de Paraguaná (CORPOTULIPA).\n    * La recuperación, cercado y operación de la Pista aérea de Adícora, garantiza una afluencia nacional de avionetas directamente de cualquier parte del país.\n    * Pueblo Nuevo y zonas adyacentes se encuentran a 75 kilómetros del Aeropuerto Internacional "Josefa Camejo" en Punto Fijo.\n    * La adopción de sistemas de producción sustentables en las ganaderías caprina y ovina que incrementen la producción y propendan a la exportación de esta carne y de sus productos derivados como son leche, queso, y conservas dulces. En el ámbito nacional tiene un mercado cautivo.\n    * La pesquería artesanal constituye una actividad importante en la zona Adícora y Cabo San Román. La organización de los pescadores (Cooperativas, Asociaciones), la implantación de políticas de asistencia técnica y financiamiento, potenciarán efectivamente esta actividad y se generará mayor empleo y productos pesqueros para el mercado local y nacional.\n    * La consolidación del eje Adícora - El Hato – Pueblo Nuevo como centro de servicios de todo el municipio para suplir las demandas de turistas en diferentes productos.\n    * El desarrollo y explotación adecuada de las "Salinas de las Cumaraguas", se constituye en una fuente de empleo permanente para más de mil familias.\n    * La declaración de la Península de Paraguaná como Zona libre de la "mosca de la fruta" le confiere una oportunidad privilegiada para el cultivo, procesamiento y exportación de cucurbitáceas (melón, patilla, etc.) a Estados Unidos de Norteamérica; sin restricciones fiscales o sanitarias para el producto. Este proyecto incorporará mano de obra agrícola e inversiones agrícolas en el corto plazo.\n    * La formación y capacitación de la juventud de la localidad en áreas de actividad turística, agregando el conocimiento y dominio de otro idioma (inglés), garantizará el recurso humano capacitado para desarrollar la actividad turística.\n	41077	norte 	Límites\n\nNorte: con el Mar Caribe\nSur: con el Municipio Carirubana del Estado Falcón\nEste: con el Mar Caribe\nOeste: con el Municipio Los Taques del Estado Falcón 	1577 km2 	0
