1	11	12	LOS TAQUES	Santa Cruz de Los Taques	El Municipio Los Taques es uno de los 25 municipios que forman parte del Estado Falcón, Venezuela está ubicado al oeste de la Península de Paraguaná; limita al norte con el Mar Caribe y el Municipio Falcón, al sur con el Municipio Carirubana, al este con el Municipio Falcón y al oeste con el Mar Caribe (Golfo de Venezuela). Tiene una superficie de 231 km² y una población de 28.528 (censo 2001), su capital es Santa Cruz de Los Taques. La actividad petrolera en especial la refinación es el principal rubro económico del municipio, el turismo es la segunda actividad en importancia. El primer busto del Libertador Simón Bolivar fue develado el 5 de julio de 1957.	OPORTUNIDADES PRODUCTIVAS\n\n    * Forma parte de la Unidad Turística de la Península de Paraguaná. Es uno de los tres municipios que conforman la Zona Libre de Inversión Turística de la Península de Paraguaná.\n    * El Centro de Refinación de Paraguaná que produce el 73% del combustible y lubricantes del país está ubicado en este municipio.\n    * La pesquería artesanal constituye una actividad importante en la zona de Playa de Los Taques - Villa Marina. La organización de los pescadores, y la implantación de políticas de asistencia técnica y financiamiento, potenciarán efectivamente esta actividad y se generará mayor empleo y producción pesquera para el mercado local – nacional.\n    * La activación del Astillero Naval de Los Taques (ASTINAVE) debe impactar de manera favorable la economía del Municipio.\n    * La Puesta en marcha del Centro de Acopio de Villa Marina garantiza la oferta de pescado en la zona y la posibilidad de integración de los pescadores artesanales en una organización de productores.\n    * La adopción de sistemas de producción sustentables en las ganaderías caprina y ovina incrementará la producción de leche y carne, generando oportunidades de exportación de esta carne adicionalmente de sus productos derivados como son leche, suero y conservas du