1	14	14	OBISPO  RAMOS DE LORA	Santa Elena de Arenales	\n\nLas tierras cálidas y húmedas del sur del lago de Maracaibo han sido muy atractivas para los merideños desde el siglo XVI, sus primeros pobladores se propusieron la creación de vías que les permitieran transporte y acarreo de sus productos. Adicionalmente, los merideños encontraron en esta zona una fuente adicional de riqueza en extensos bosques con árboles de cacao y que, posteriormente, también se proyectan para el cultivo de frutas tropicales y producción ganadera.\n\n \n\nSanta Elena de Arenales, esta zona es una fuente adicional de riqueza en extensos bosques con árboles de cacao y que posteriormente también se proyecta para el cultivo de café. Debe su nombre a la existencia en sus tierras de dos puertos comerciales que se llamaron: Puerto de Santa Elena y Puerto de Arenales. Conservan una gran devoción a Cristo Rey.\n\n \n\nCaracteristicas Territoriales\n\n \n\nPosición geográfica:\n\nEl Municipio Obispo Ramos de Lora está situado al noroeste del Estado Mérida, entre las siguientes red de coordena­das: 8º 42 33 y 8º 56 20 de latitud Norte y 71º 17 13 y 71º 30 20 de longitud Oeste.\n\n \n\nLímites:\n\nNorte: Estado Zulia.\nEste: Parroquia Florencio Ramírez del Municipio Caracciolo Parra y Olmedo.\nSur: Municipio Andrés Bello.\nOeste: Parroquia Héctor Amable Mora del Municipio Alberto Adriani.\n\n \n\nExtensión territorial:\n\nTiene una extensión de 383 km2 que representa el 3.39% del territorio del Estado Mérida.\n\n \n\nDistancia de capital del estado al cual pertenece y a la Capital del País:\n\nA la capital del estado es de 96 km. y\n\nA la capital del país 599 km.\n\n \n\nPrincipales actividades económicas:\n\nAgrícolas, pecuarias, comerciales.\n\n \n\nReseña Histórica:\n\nEsta pequeña Aldea fue el origen de Caño Zancudo mientras se construía la Carretera Panamericana en 1950. El 15 de Diciembre de 1966 se creó el Distrito Andrés Bello, segregando el Municipio Zerpa (La Azulita) del Distrito Campo Elías. El Distrito Andrés Bello, quedó integrado entonces por los Municipios Zerpa, Eloy Paredes (Guayabones), Obispo Ramos de Lora (Caño Zancudo-Santa Elena de Arenales) y Caracciolo Parra y Olmedo (Tucaní). En esta misma fecha, se le cambió el nombre de Caño Zancudo por el de Santa Elena de Arenales.\n\n \n\nEste Municipio, dependió Eclesiásticamente de la Parroquia Inmaculada Concepción de La Azulita. El 18 de Octubre de 1981, se convirtió en Parroquia bajo el patrocinio de Cristo Rey. En 1988, Santa Elena de Arenales se separa de La Azulita y se convierte en capital del Municipio Autónomo Obispo Ramos de Lora. Desde 1992, es llamado Municipio Obispo Ramos de Lora, capital Santa Elena de Arenales.\n\n \n\nSanta Elena de Arenales debe su nombre a la existencia en sus tierras de dos puertos comerciales que se llamaron Puerto de Arenales y Puerto de Santa Elena, en el año 1850, que más tarde sirvieron para que de ellos se tomara su nombre y así el pueblo se llamara Santa Elena de Arenales, Municipio Obispo Ramos de Lora en homenaje a ese ilustre. hombre de la iglesia merideña.\n\n \n\nDada la importancia de estos puertos para la economía regional en el año 1855 se constituye la primera empresa que se encargaría de la construcción del camino de arenales y para 1856, se establece la ordenanza para distribuir las tierras en el nuevo camino y es donde comienza la importancia de la actividad comercial de las ciudades de Mérida y Ejido con la Zona Sur del lago, como vía para la importación y exportación de bienes y productos a través del puerto de Santa Elena de Arenales.\n\n \n\nOrganización parroquial del municipio:\n\nParroquia Eloy Paredes\n\nSan Rafael de Alcázar\n\n \n\nPoblación y su distribución en la zona: 20873	\nPrincipales actividades económicas:\n\nAgrícolas, pecuarias, comerciales.\n	20873	noreste	Límites:\n\nNorte: Estado Zulia.\nEste: Parroquia Florencio Ramírez del Municipio Caracciolo Parra y Olmedo.\nSur: Municipio Andrés Bello.\nOeste: Parroquia Héctor Amable Mora del Municipio Alberto Adriani.	383 km2	0
