1	16	2	BOLIVAR	caripito	El Municipio Bolívar, es uno de los 13 municipios que conforman al Estado venezolano de Monagas, su capital es la población de Caripito. El municipio tiene una sola parroquia de las 37 parroquias que conforman al estado nororiental venezolano.\n\nEl municipio Bolívar, contaba con una población de 29.150 habitantes, estimada por el año 1995, distribuida principalmente en los centros poblados: Caripito, San Miguel, La Plena, Río Bonito, Km.8, Km.9 y Km.5 (Los Kilómetros, y Los Morros). Para 2010 se estima que su porblación se eleve a 48.279 habitantes y en 2015 a 55.545 \n\nEl clima es tropical como en toda la zona climática terrestre homónima, la temperatua debe oscilar entre los 20° y los 30°C.\n\nToda la superficie del área vierte sus aguas al Golfo de Paria a través del Río San Juan, por tributarios directos a dicho Río. Entre los primeros se distinguen Río Caripe - Río San Miguel. La red Hidrográfica en general esta organizada en función de las características geológicas y fisiográficas del área. Los tributarios directos del Río San Juan tienen una orientación Nor Oeste - Sureste en recorrido por el paisaje montañosos pero el hacer contacto con la mesa de piedemonte y los planicres, cambian su curso hacia el Este, con excepción del Río San Miguel y parte del curso del Río San Juan, cuya orientación es Noroeste - Sureste (constituyen el limite Norte del Área Bolívar), el Río San Juan así como causas finales del Río Caripe que sufre cierta represamiento (Freno Hidráulico) debido a la influencia y actuación de la marea dinámica (Dos veces al día). Este sector comprende la llamada planicie aluvial de desborde y la planicie deltaica. La primera, situada en el extremo este de los llanos orientales, a la derecha de una línea de dirección aproximadamente Norte-Sur, que parte desde Caripito, continúa por la población de la pica, sigue por el caserío El Blanquero y finaliza en las salidas del río morichal largo de la mesa de temblador. Los materiales de este sector de llanos bajos corresponden a formaciones cuaternarias recientes, donde mesas y terrazas de valle han sido cubiertos por el material depositado por ríos arriba mencionados, explicando el origen fluviomarítimo de esta unidad, a partir de la acumulación de los materiales arrastrados desde mesas. La cuenca del río San Juan, al Nor –este, principal tributaria del golfo de paria, capta las aguas de los ríos Guarapiche y Caripe, importantes tributarios que atraviesan amplios valles regando y abasteciendo de agua a las principales poblaciones del Norte del Estado (Caicara, Jusepín, Maturín, Caripe, Caripito).	En materia agrícola son numerosos los rubros, se cosecha allí la batata, la yuca, el ñame, el maíz, el algodón y la patilla. La ganadería (bovina y porcina), así como la avicultura y la pesca, registran cifras significativas al igual que la explotación forestal. El turismo y el sector de la construcción han repuntado notoriamente.	34975	norte	El Municipio Bolívar está ubicado al Nor-Este del Estado Monagas y pertenece a la región Nor-Oriental de Venezuela. Limita al Nor-Este con el Municipio Benítez perteneciente al Estado Sucre. Por el Sur con el Municipio Puncéres y por el Oeste con el Municipio Caripe, ambos del estado Monagas.	529 km2	0
