1	14	21	TOVAR	tovar	El Municipio Tovar se encuentra lozalizado en el oeste del estado Mérida. Es uno de los municipios más pequeños del estado con 184 km² pero su capital, la ciudad homónima de Tovar, es la 3ª más importante de esa entidad.\n\n\nPosición geográfica:\n\nSe encuentra en el Occidente del país, al suroeste del estado del estado Mérida, entre los 8º 14 37 y 8º 26 30 de latitud norte y entre 71º 39 10 y 71º 48 24 de longitud Oeste.\n\n \n\nLímites:\n\nNorte: Municipio Zea y el municipio Antonio Pinto Salinas.\nEste: Municipio Antonio Pinto Salinas.\nSur: Municipio Rivas Dávila\nOeste: Municipio Antonio Pinto Salinas.\n\nExtensión territorial:\n\n179, 6 Km2.\n\n \n\nDistancia del Municipio a la capital del Estado Mérida:\n\nLa distancia en recorrido terrestre, desde la capital del Municipio hasta capital del estado al cual pertenece es de 79 Km . y de la capital del país 689 Km.\n\n \n\nPrincipales actividades económicas:\n\nLas principales actividades económicas son la agrícola, pecuaria, avícola, industrial (talabartería, metalmecánica, imprenta y panificadoras) y el comercio (textil, agencia de vehículos y chiveras de vehículos, (venta de repuestos usados).\n\n \n\nReseña Histórica:\n\nEl Municipio Tovar forma parte del entorno montañés del Valle del Mocoties, donde la providencia de recursos: Agua, suelo, clima y paisaje, asociados a la laboriosidad de sus pobladores a la honrosa y noble actividad de trabajar la tierra, han logrado situar el Cantón del Mocoties en privilegiado emplazamiento de relevancia nacional en la producción agropecuaria...\n\n \n\nEl Sacerdote Franciscano José Cevallos de Obregón, llegó a tierra de los Mocoties en 1709 y estableció una comunidad indígena a la que denominó Pueblo de Nuestra Señora de Regla de los Bailadores, para poder evangelizar a estos indios.\n\n \n\nA finales del siglo XVIII la región Tovar - Bailadores creció urbana y demográficamente como consecuencia del desarrollo agrícola y el comercio. Tovar producía Cacao, Caña, tabaco, maíz y yuca, entre otros productos y para 1782 era uno de los Valles mas importante. Lo que conoce actualmente como Bailadores era de nominada La Villa de Bailadores y Tovar, Parroquia de Bailadores.\n\n \n\nDurante el periodo 1832 y 1840 existió rivalidad económica entre estos dos sectores, lo cual influyó en su conformación político - administrativo y el 19 de febrero de 1850 se decreta a Tovar como Villa en homenaje a Martín Tovar por intención de José Tadeo Monagas.\n\n \n\nOrganización parroquial del municipio:\n\nLas Parroquias que conforman este municipio son: Tovar, El Amparo, El Llano y San Francisco.\n\n \n\nPoblación y su distribución en la zona:\n\nPoblación total del Municipio (Censo 2001): 32.805 habitantes.\n\nDensidad de población de: 214,41 Hab/Km.²\n\nPoblación Rural: 12.234 (27,54%)\n\nPoblación Urbana: 32.184 (72,46 %). 	Principales actividades económicas:\n\nLas principales actividades económicas son la agrícola, pecuaria, avícola, industrial (talabartería, metalmecánica, imprenta y panificadoras) y el comercio (textil, agencia de vehículos y chiveras de vehículos, (venta de repuestos usados).	32805	oeste	Límites:\n\nNorte: Municipio Zea y el municipio Antonio Pinto Salinas.\nEste: Municipio Antonio Pinto Salinas.\nSur: Municipio Rivas Dávila\nOeste: Municipio Antonio Pinto Salinas.	184 km2	0
