entración de los rayos solares; los valores más altos se presentan entre los meses de marzo y junio y se puede apreciar que dichos valores no han presentado mayores cambios en los últimos cinco años.\n\nHidrografía: Presenta un drenaje natural con aspecto radial, ya que todos los ríos y quebradas nacen en el cerro central y vierten sus aguas al mar, a las lagunas de Boca Chica y Punta Arenas o a la albufera de La Restinga. Los ríos son: La Chica, San Francisco, Guainamal, Río Grande, La Vieja y Chacaracual. Las quebradas ( de régimen desconocido o cauce seco) son: El Muco, La Montaña, La Empalizada, Guayacancito y Los Robles, que vierten sus aguas al mar en la época de lluvias fuertes.\n\nEl balance hídrico del suelo es deficitario debido a la intensa insolación y evapotranspiraciòn que ocurre durante casi todo el año, haciendo casi imposible la actividad agropecuaria sin auxilio del riesgo.\n\nTemperatura: Promedio de 28º C.\n\nPaisaje: El relieve está caracterizado por una fila de montañas, el cual presenta una altimetría entre 0-750 msnm y los principales cerros son: Pico de Macanao, Soledad, Risco Blanco, Guaraguao, Los Cedros, Piedra Lisa y El Castillo; además por valles xerófilos; y su vegetación: está representada por la maleza desértica tropical, bosques de manglares, espinares, secos y ralos; playas y costas.\n\nPrecipitación: El índice de precipitación es de 552 m.m.\n\nÁreas Protegidas: Lagunas de Boca Chica, de Boca del Río, Punta Arena, Parque Nacional la Restinga, entre otros; ya que aproximadamente un 70% del territorio de la Península de Macanao, es Áreas Bajo Régimen de Administración Especial (ABRAE).\n\nLa pesca de altura y costanera predomina. La pesca de altura se realiza con embarcaciones con dimensiones de 12 a 20 metros de eslora. La embarcación utilizada se denomina lancha o barco y su campaña dura entre treinta días y tres meses.\n\nSe le denomina de altura porque se faena en alta mar y/o en aguas internacionales. Existe también la pesca de media altura, en la cual se utilizan embarcaciones con dimensiones entre 5 y 12 metros de eslora que reciben el nombre de bote o piragua. Sus campañas puede mencionar: collares, cadenas, cinturones, anillo, diademas, pendientes, etc.\n\nLa carpintería de ribera, que se caracteriza por la construcción de embarcaciones pesqueras (peñeros, barcos, botes etc), que se desarrollan en los centros poblados como Boca del Río; Boca de Pozo, San Francisco, Guayacancito; Robledal y El Manglillo. Es importante resaltar que la carpintería de ribera constituye la actividad artesanal de mayor relevancia en la Península de Macanao.\n\nEs muy conocida, además en San Francisco de Macanao la elaboración de agajes para ser utilizados por los burros para trasportar la cosecha. Muy conocidos fueron los botes de hojalata y de boya de madera en miniaturas. Con habilidad los pescadores costaneros u orilleros fabrican sus redes y atarrrayas diestro carpintero de ribera con constancia fabrican duraderas embarcaciones.	La pesca de altura y costanera predomina. La pesca de altura se realiza con embarcaciones con dimensiones de 12 a 20 metros de eslora. La embarcación utilizada se denomina lancha o barco y su campaña dura entre treinta días y tres meses.\n\nSe le denomina de altura porque se faena en alta mar y/o en aguas internacionales. Existe también la pesca de media altura, en la cual se utilizan embarcaciones con dimensiones entre 5 y 12 metros de eslora que reciben el nombre de bote o piragua. Sus campañas puede mencionar: collares, cadenas, cinturones, anillo, diademas, pendientes, etc.\n\nLa carpintería de ribera, que se caracteriza por la construcción de embarcaciones pesqueras (peñeros, barcos, botes etc), que se desarrollan en los centros poblados como Boca del Río; Boca de Pozo, San Francisco, Guayacancito; Robledal y El Manglillo. Es importante resaltar que la carpintería de ribera constituye la actividad artesanal de mayor relevancia en la Península de Macanao.\n\nEs muy conocida,