1	19	3	ARISMENDI	rio caribe	 Situada a 12 metros de altitud en el litoral norte de la península de Paria en el\nmar Caribe, fundada en 1713 con el nombre de San Miguel de Rio\nCaribe, fue el segundo asentamiento no indígena en sucre.\n\nLa iglesia construida en la plaza en 1717, fue reconstruida en 1919, en\néste templo están enterrados los restos de Alonso Ruiz Moreno, famoso\ncirujano que realizó la primera operación cesárea en Venezuela en el año 1833,\ny Juan Manuel Cajigal renombrado matemático.\nHa sido considerado Centro de Formación Educativo y Cultural.\nPuerto de cabotaje nacional e internacional.\n\nActividades pesquera y la agricultura son la base fundamental de su economía, pequeñas actividades agroindustriales con producción de copra y procesamiento de producciones locales de cacao, plátano y maíz. A 30 Km . de la costa se sitúa una importante cuenca gasífera, con reservas de petróleo liviano. Río Caribe cuenta con hermosas playas como: Medina, Caracolito, Pui Pui y otras.\nEn la actualidad cuentan con destacadas instituciones como: El Ateneo, el Centro Civico y la Fundación Proyecto Paria.\n\nRío Caribe es un rincón del Oriente, con gente amable, cordial y muy religiosa, teniendo como Patrono a San Miguel de Arcángel.\nEn los puertos y ensenadas cerca de Río Caribe pululan barcos, yates, lanchas y peñeros, porque aquí llega la pesca de atún, de sardinas y otras especies marinas desde alta mar, desde Surinam, islas del Caribe. Por los caminos del municipio es frecuente ver los camiones y las cavas que a su vez transportan la pesca procesada y las cosechas agrícolas.\n\nLa capital del municipio Arismendi posee tantas bellezas naturales que se ha convertido en la entrada principal del turismo del estado Sucre. Se ubica a 22 kilómetros de Carúpano, y posee un puerto pesquero de capital importancia para toda la zona de Paria. Precisamente, quien va a visitar la península de Paria tiene como paso obligado a Río Caribe.\n\nLlama la atención en Río Caribe su 