1	19	7	CAJIGAL	Yaguaraparo	El Municipio Cajigal, es 1 de los 15 municipios que conforman al estado nor-oriental venezolano de Sucre. El municipio se ubica en la parte sur de la Península de Paria (ver mapa), tiene 3 parroquias llamadas: Libertad, con capital Río Seco, la segunda parroquia llamada El Paujil, con capital la población homónima, y finalmente la parroquia capital, con capital la misma que el municipio, Yaguaraparo. Tiene una población aproximada de 18.942 habitantes, con una densidad de 51,9 habitantes por Km2 (censo 2001), tiene 365 Km2 de superficie y su altura máxima es de 800 msnm, en el cerro Pacholí, cerca de Cachipal. Sus límites son: por el norte, en su totalidad delimita con el Municipio Arismendi, por el sur-este con el Golfo de Paria y el sur-oeste con el Municipio Libertador. Por el este limita con el Municipio Mariño, por el oeste limita un poco con el Municipio Arismendi, y el resto con el Municipio Libertador. En su costa sur tiene al Golfo de Paria. Estas costas no son secas ni arenosas, sino que predominan los manglares en terreno fangoso; igualmente, el Golfo de Paria, en sus inmediaciones, tiene poca profundidad, por lo que solamente se puede navegar en pequeñas embarcaciones.\n\nEn el municipio Cajigal están los mejores cultivos de cacao del estado Sucre. Como se sabe, el estado Sucre produce alrededor de 5.004 TM. de este producto, lo que equivale al 60% de la producción nacional. En Yaguaraparo está previsto el funcionamiento de la Comercializadora de Cacao Cagigal, que incluye un Laboratorio de Certificación de Calidad y un Central de Beneficio para mejorar la calidad del grano.	En el municipio Cajigal están los mejores cultivos de cacao del estado Sucre. Como se sabe, el estado Sucre produce alrededor de 5.004 TM. de este producto, lo que equivale al 60% de la producción nacional. En Yaguaraparo está previsto el funcionamiento de la Comercializadora de Cacao Cagigal, que incluye un Laboratorio de Certificación de Calidad y un Cent