1	20	11	JUNIN	rubio	El Municipio Junín es un municipio del estado Táchira de Venezuela, población de 87.302 hab. Su capitial es Rubio, una de las principales ciudades del Táchira.\n\n    * Al Norte: con el muncipio Libertad\n    * Al Sur: con estado Apure\n    * Al Este : con el Muncipio Cordoba\n    * Al Oeste : con el Muncipio Bolivar y Muncipio Rafael Urdaneta\n\n\n\n Parrioquias \n\n    * Bramón\n    * Las Dantas\n    * Rio Chico\n\nCentros Poblados \n\n    Urbanos: 3\n    Rurales: 166\n\nRelieve \n\nMontañoso ,Terrazas Aluviales {Rubio}, Hasta cerros ,Picos y Paramos\n\nTemperatura\n\n14-24 °C {media anual}\n\nPrecipitacion \n\n700 a 3.000 mm {media anual}\n\nClima \n\nPredomina Tropical Lluvioso de Sabana.\n\nVegetación \n\nPredomina el bosque Húmedo Premontano.\n\nHidrografía \n\nRíos:\n\n    * Quinimari\n    * Carapo\n    * Bramoncito\n    * Quebradas\n    * La Lejia\n    * El Salado\n    * La Ratona\n\nAltitud \n\nCapital de Mcpio.: 825 msnm\n\n\n\nEscudo del Municipio \n\nFue diseñado en su parte heráldica por los escritores Rafael María Rosales y don Aurelio Ferrero Tamaño, lleva en sus campos los colores de la Bandera Nacional en tres cuarteles y fue esculpido por el artista Prof. José Natalio Bruguera. El escudo se encuentra en la sede de la Prefectura del Municipio. Presenta tres cuarteles, dos superiores y uno inferior. El cuartel superior derecho del escudo es amarillo y contiene la figura de Don Gervasio Rubio, impulsor agrícola de la población como testimonio a quien favoreciera el nacimiento de la ciudad capital del Municipio. El cuartel superior izquierdo es rojo y él contiene una mano sobre una torre almenada, símbolo de Santa Bárbara, Patrona espiritual de Rubio. En el cuartel inferior de mayor tamaño contendrá la figura de Puente Azul, construido en el estilo de medio arco romano por el ingeniero Cristancho y las ondas de la quebrada Capacha, que justifican la tradición Pontálida de la ciudad. En su parte superior el escudo contiene por timbre una Corona Mural. Fuera del Escudo y en las partes laterales las figuras de una rama de cafeto frutado en la derecha y una de caña de azúcar en la izquierda, símbolos de la riqueza de nuestro suelo. En la parte inferior del Escudo, lleva una cinta de color rojo con la siguiente inscripción en letras negras: a la derecha “9 DE DICIEMBRE DE 1794": como fecha de la fundación de Rubio en el centro: “ARMAS DE LA CIUDAD"; y a la izquierda “9 DE JUNIO DE 1855". fecha de creación de la Parroquia Civil de Rubio por la Diputación de Mérida.\n\nBandera del Municipio \n\nLa Bandera del Muniipio es autoría y diseño del Prof. Diego Ramírez Sánchez, la cual po los olores El ángulo superior de la franja es BLANCA y sobre la misma, irá un campo de color NEGRO y en el centro de éste, estampado en colores, llevará el Escudo de Armas de la Ciudad. El resto del cuerpo general de la franja superior, será de color BLANCO, y en la parte inferior en franja ancha el color ROJO. El color NEGRO con el ESCUDO en su centro, simboliza la riqueza de nuestro sub-suelo y ello, involucra el Petróleo, factor fundamental de la economía Nacional y a nuestro Municipio, que fue la primera tierra venezolana donde se explotó por primera vez, el Oro Negro en el Pozo “EUREKA” de la Alquitrana en 1883. El ESCUDO en su centro representa la fuerza, la constancia, el coraje y el poder del pueblo de Junín, para vencer y sobreponerse a todas las dificultades. El color BLANCO simboliza el color que representó a los viejos Comuneros en la lucha por sus ideales de libertad y autonomía. I representa también este color hermoso, la nívea blancura de nuestros cafetos en flor.\n\n El ROJO es el color que representa la idiosincrasia del rubiense. Su vergüenza, pundonor y coraje para enfrentar la vida. I se circunscribe también, al color púrpura del café maduro.\n\nEl diseño y realización de la bandera del Municipio Junín fue encargada al Prof. Diego Ramírez Sánchez y éste cumpliendo sus funciones inherentes a su cargo de Cronista del Municipio, la presenta para su aprobación con fecha del 24 de agosto de 1997., y es aprobada en sesión de Cámara Acta N° 64, del 28 de noviembre de 1997\n\n\nHimno del Municipio \n\nEl Himno del Municipio Junín es el canto "¡Salve Oh Rubio!" escrito por el R. P. Fr. Campo Elías Claro y música del Profesor Rufo Pérez Salomón. El decreto fue firmado por el profesor Marco Tulio Rodríguez y refrendado por la Secretaria de Cámara María Lucinda Sierra V. Este himno fue oficializado el 4 de noviembre de 1964, en donde se especificaba lo siguiente: :\n\nEL CONCEJO MUNICIPAL DEL DISTRITO JUNÍN EN USO DE SUS ATRIBUCIONES LEGALES, CONSIDERANDO Que la entidad Política - Geográfica carece de los Símbolos que permitan contribuir al mantenimiento y desarrollo de los sentimientos patrióticos y de un sano bien entendido Regionalismo, CONSIDERANDO Que el próximo 9 de diciembre la ciudad de Rubio cumple 170 años de su fundación CONSIDERANDO Que la conmemoración de tan magna fecha, es propicia para crear los mencionados Símbolos ACUERDA Art. 1. Procédase a poner en vigencia oficial el Himno Patriótico del Distrito Junín, a partir del 9 de diciembre próximo. Art. 2. Óptese como Himno Patriótico la letra del Canto "Salve Oh Rubio", compuesto por el Reverendo Padre Fray Campo E. Claro, (O.P), en el mes de diciembre de 1944, con motivo del Sesquicentenario de la ciudad Pontálida. Composición destinada a cumplir el fin que inspira esta resolución Art. 3. Encomiéndese al Prof. Rufo Pérez Salomón, Director de la Banda Municipal la misión de componer la música adaptada al referido canto con movimiento marcial, concedida en forma asequible a su proyección en los institutos educativos y del Distrito y realizado en dos versiones: Una partitura para Banda y otra para canto y piano Art. 4. El Himno será ejecutado por la Banda Municipal y coro de voces en el acto solemne que se realizará en el Salón de Sesiones del Concejo Municipal al descubrir el cuadro contentivo del Escudo de Armas del Distrito. Art. 5 Comuníquese y Publíquese Dado, firmado y sellado en el Salón de sesiones del Concejo Municipal a los cuatro días del mes de noviembre de mil novecientos sesenta y cuatro Años 155 de la Independencia y 106 de la Federación.\n\n\n¡Salve Oh Rubio!\n\nCoro ¡Salve oh Rubio! Ciudad del Trabajo Noble sede del patrio ideal; tu destino es por siempre la gloria que conquistas en rudo lidiar.\n\nI Hoy te yergues ceñida de lauros constelada de luz y de fe, despertando los dulces recuerdos, que atesora tu fúlgido ayer. (Coro)\n\nII Tu memoria se embriaga evocando, a despecho del tiempo veloz, al insigne patricio que un día sus blasones y bienes te dio. (Coro)\n\nIII No en vano surgiste al progreso bajo el signo feliz de la Cruz, pues tu fe con el tiempo aquilatas, ascendiendo por rutas de luz. (Coro)\n\nIV ¡Oh Ciudad que enalteces tu nombre en faenas de gloria y honor, no se eclipse jamás en tu cielo de tu estrella propicia el fulgor! (Coro)\n\nV ¡Magnifique la Historia tus obras, y perdure en el bronce inmortal el prestigio que brinda la fama a tu anhelo de siempre triunfar! (Coro)\n\nVI ¡Que el Eterno prospere tus campos; que difunda su lumbre estelar, sobre el pueblo que labra su gloria en las lides de la libertad! (Coro)\n\n\n\nExplotación\n\n    * Maiz\n    * Cafe\n    * Vacuna\n	sus  pricipales feutnes economicas es la explotacion de maiz, cafe y vacuno.	87302	sur oeste	    * Al Norte: con el muncipio Libertad\nlimites     \n* Al Sur: con estado Apure\n    * Al Este : con el Muncipio Cordoba\n    * Al Oeste : con el Muncipio Bolivar y Muncipio Rafael Urdaneta\n	225 km2	0
