1	21	3	CARACHE	carache	El Municipio Carache es un municipio del Estado Trujillo, Venezuela. Tiene una superficie de 957 km² y una población de 26.261 habitantes (censo 2001). Su capital es la población de Carache.\n\nLos Andes Venezolanos constituyen una prolongación de la gran Cordillera de los Andes que se extiende a lo largo de la costa pacífica de Sudamérica. Atraviesan los estados Táchira, Mérida, Trujillo y parte de Lara. Carache está a 1.210 m, aproximadamente, sobre el nivel del mar.\n\nCarache se deriva de kas-aras-chi (indio no habla); nombre de un caudillo cuica de una población y del río llamado más adelante Monay.\n\n    * Por el norte: Con el antiguo municipio Cuicas (que ahora es parte del propio municipio Carache, y parte del estado Lara).\n\n    * Por el este: Con los pueblos de Humocaro Bajo y Humocaro Alto en el Municipio Morán del estado Lara.\n\n    * Por el sur: Con el pueblo de La Concepción y el caserío de Miquia.\n\n    * Por el oeste: Con los pueblos de Chejendé Y Bolivia en el Municipio Candelaria. El límite occidental del distrito está formado por el ramal de los Andes trujillanos que separa la cuenca del río Tocuyo, en el Estado Lara, que drena hacia el mar Caribe, del sistema fluvial del Motatán-Monay-Cenizo y Barua que desemboca en el río de la Concepción, es decir, en el Lago de Maracaibo. Esta cordillera, que corre de norte a sur, constituye el límite entre los Estados Lara y Trujillo y esta formada por las montañas más altas de la parte norte de Trujillo: los páramos de Cendé (3.583) m., Jabón (3.503 m.), Las Rosas (3.245 m.), Guache (3.092 m.), Nariz y Agua de Obispo (3.000 m), entre otras.\n\nSu clima es agradable durante todo el año, pero a comienzos de la tarde, en todo el año, el calor es relativamente alto. Las temperaturas máximas en las partes más bajas del valle están entre los 26º-27°C, y en las zonas más altas entre 13º y 14°C. Las temperaturas mínimas en las partes más bajas del valle están entre los 15º y 17º y en los páramos, entre los 4º y 6º. Las fluctuaciones de las temperaturas máximas y mínimas absolutas anuales del pueblo de Carache oscilan entre los 18º y 22º. La precipitación anual es de 820 a 850 mm, mientras que en las partes más altas, en el páramo de Agua de Obispo, la media anual es de 949 mm.\n\nCarache es un pueblo de tradición arraigada, su idiosincrasia se centra en sus quehaceres diarios y en el rescate de los valores autógenos que determinan su historia. El desarrollo y nacimiento de nuevos valores en el mundo de las artes y letras, simplifican y resumen la fuerza creadora de nuestro pueblo. Sus hombres aún conservan su identidad como hombres andinos y campesinos entregados a sus siembras y a sus rudas tareas de campo. El labrado de la tierra, debido a las altas pendientes del terreno y por tradición heredada de antepasados se realiza aún con fuerza animal, llamados yuntas de bueyes.\n\nEn el estado Trujillo existe una larga tradición en la producción de panela dulce o papelón, elaborada en los antiguos trapiches, a partir del jugo de caña de azúcar. A pesar de que actualmente sólo el 55 % de los trapiches trujillanos funciona, existen amplias posibilidades para revitalizar esta importante actividad rural artesanal, toda vez que la investigación está aportando tecnologías mejoradas como nuevas variedades mejor adaptadas a la producción de panela, y prácticas agronómicas / culturales que permiten incrementar los rendimientos y las condiciones económicas de producción de los pequeños productores que se dedican a esta actividad.\n\nEn el Estado Trujillo, existe una superficie sembrada de caña de azúcar de 8.238 ha, 9% de la superficie total del subsector agrícola vegetal (3). La producción de este rubro en esta zona es destinada a los centrales azucareros La Pastora, Central Venezuela ya los distintos trapiches existentes en el área, para la producción de panela. Este estado ha sido dividido en siete zonas productoras de panela de acuerdo con la disponibilidad de materia prima a ser procesada (6). Existen actualmente unos 68 trapiches en toda la geografía trujillana, 32 funcionales y el resto paralizados; de estos últimos, 3 están siendo reconstruidos y remodelados, 23 fuera de operación por falta de materia prima y los demás por diferentes problemas de tipo legal y de infraestructura (3). La mayoría de estos trapiches datan del siglo XIX, encontrándose en condiciones precarias de infraestructura (1).\n\nActualmente el Estado Trujillo aporta el 26% de la producción panelera, ocupando el segundo lugar a nivel nacional. Esta producción se ha incrementado paulatinamente, pasando de 422 t en 1989 a 11.264 t en 1990, lo que representa según cálculos de CORPOANDES, un incremento del 39% interanual (6). Se estima que para el período 1994-96 la producción pase de 8.955 a 9.428 t, producción que indica el afianzamiento progresivo de esta producción en el mercado local y el abastecimiento y colocación de una significativa producción en mercados extra-regionales (3). Es importante destacar que por ser una industria que opera casi todo el año, demanda una gran cantidad de mano de obra: 411 empleados directos y 734 indirectos (6).\n\nCarache, con el objetivo de evaluar algunas características varietales de adaptación, rendimiento de panela por hectárea, momento óptimo de cosecha, resistencia a plagas y enfermedades, floración, capacidad de permanencia de socas en el campo, hábito de crecimiento y otras características agronómicas de importancia.\n\nEl Municipio Carache, ubicado a una altura de 1.157 msnm, con una temperatura y precipitación promedio de 20,93°C y 49,1 mm mensuales (5), es una zona de relevancia agrícola para el estado, donde los principales rubros son las hortalizas y la caña de azúcar; este último con una superficie sembrada de aproximadamente 100 ha, destinado exclusivamente a la producción de panelas y papelón. Existen en esta zona seis trapiches, cuatro de ellos funcionales, con una producción de 1.800 pacas/ semana (6). Esta actividad agrícola es de gran importancia, por ser una de las principales fuentes generadoras de empleo para un significativo número de personas en esta zona, además del valor nutricional que representa este producto para la población consumidora.\n\nGastronomía [editar]\n\nLa cocina carachera es variada en platos de mesa, postres, golosinas y granjerías; el mojo carachero, las arepas de maíz pelado; la sopa de arepa con leche; las arepas de hierbabuena y mantequilla; los pacaros (plátano madura con queso), las paledonias, equivalentes a las catalinas o cucas del centro del país; la caspiroleta (mezcla de leche, maicena y brandy, que se toma caliente); el curruchete (miel de panela, queso y anís de pepita), entre otras. En Carache se elabora el chepe, arepa hecha con maíz Cariaco o trigo; el sakus, que corre el riesgo de desaparecer de la mesa tradicional Carachera y que consiste en pescado que se rellena, preferiblemente de la especie Manamana; se envuelve en masa y luego en hojas de plátano, tal como una hallaca y se hornea; las carabinas, hallaquitas de caraotas; en Carache se utiliza mucho el ají al cual se le agrega frecuentemente maguey y diablito (penca y frutos del sisal); en lo que respecta a la dulcería y granjería, son de la zona la torta de plátanos; la acema carachera, con miel y anís. Bebidas espirituosas de fabricación casera como la mistela y la Leche de burra.	sus principales fuentes economicas son el turismo y la agricultura 	26261	noreste	    * Por el norte: Con el antiguo municipio Cuicas (que ahora es parte del propio municipio Carache, y parte del estado Lara).\n\n    * Por el este: Con los pueblos de Humocaro Bajo y Humocaro Alto en el Municipio Morán del estado Lara.\n\n    * Por el sur: Con el pueblo de La Concepción y el caserío de Miquia.\n\n    * Por el oeste: Con los pueblos de Chejendé Y Bolivia en el Municipio Candelaria. El límite occidental del distrito está formado por el ramal de los Andes trujillanos que separa la cuenca 