1	20	13	LIBERTADOR	Abejales	El municipio Libertador, es 1 de los municipios que conforman al estado Táchira, y a la vez, tiene 4 parroquias de las 52 que conforman a este estado de Venezuela.\n\nl municipio se encuentra ubicado al sudeste del Estado Táchira.\n\n\nSe encuentran dos clases de relieve; el montañoso en las tierras del norte y del oeste y el llano que se extiende hacia el oriente. Su economía es variada, cuenta con actividades agropecuarias, forestales y de pesca, así como un intenso comercio. Los recursos forestales han dado impulso a la industria maderera. El turismo se centra en la actividad de pesca y en los ríos de la entidad, en los cuales los visitantes pueden disfrutar las diferentes especies que se pueden encontrar, otra actividad es la casería que se practica en las tierras altas y bajas de la región. En el llano la vida es especialmente atrayente y subyugante, el visitante podrá conocer personalmente todo lo relativo a las actividades ganaderas. Este municipio se encuentra ubicado en la Ruta del Llano y la Pesca.\n\nLa superficie municipal es de 1139 km²\n\nLa altura municipal es de 245 msnm, debido a su ubicación en Los Andes.\n\nSegún la OCEI, en el municipio hay 19.261 habitantes según proyección del año 2000.\n\nlimites\n\nnorte: uribante\nsur: apure\noeste: fernanandez feo	Su economía es variada, cuenta con actividades agropecuarias, forestales y de pesca, así como un intenso comercio. Los recursos forestales han dado impulso a la industria maderera. El turismo se centra en la actividad de pesca y en los ríos de la entidad, en los cuales los visitantes pueden disfrutar las diferentes especies que se pueden encontrar, otra actividad es la casería que se practica en las tierras altas y bajas de la región.	19261	sureste	limites\n\nnorte: uribante\nsur: apure\noeste: fernanandez feo\n	1139 km2	0
1	20	14	LOBATERA	lobatera 	El Municipio Lobatera es una de las veintinueve municipalidades del Estado Táchira. Ubicado en la región centro-occidental del Estado, limita al norte con los municipios Ayacucho y Michelena; al sur con Andrés Bello, Guásimos, Independencia; al este con José María Vargas; al oeste con Libertad, Pedro María Ureña y la República de Colombia. Su superficie es de 252 km² y su geografía es totalmente montañosa. Su capital es Lobatera. El Municipio tiene una parroquia; la parroquia Constitución con capital en Borotá. La principal industria es la explotación del mineral carbón y de fosforita, y en lo agrícola el principal producto es la caña de azúcar y sus derivados como la panela (conocida como papelón en otras regiones de Venezuela).\n\nSegún los datos oficiales del XIII Censo Nacional de Población y Vivienda (2001). La población del Municipio Lobatera era de 10.427 habitantes, de los cuales 5.237 son hombres y 5.100 mujeres. Asimismo se censaron 3.419 viviendas en el Municipio.\n\nEl árbol emblemático del Municipio Lobatera es el árbol del clavellino, un árbol caracterizado por ser de ornato y antierosivo. La flor emblemática es la flor roja del clavellino. Un ejemplar del mismo se encuentra en el Parque Bolívar de Lobatera.	La principal industria es la explotación del mineral carbón y de fosforita, y en lo agrícola el principal producto es la caña de azúcar y sus derivados como la panela (conocida como papelón en otras regiones de Venezuela).	10427	oestes	limita al norte con los municipios Ayacucho y Michelena; al sur con Andrés Bello, Guásimos, Independencia; al este con José María Vargas; al oeste con Libertad, Pedro María Ureña y la República de Colombia	252 km2 	0
1	20	15	MICHELENA	michelena	El Municipio Michelena se encuentra ubicado en la zona centro occidental del estado Táchira, su capital es Michelena, fundada el 4 de mayo de 1849 por el Presbítero y doctor José Amando Pérez.\n\n\nEl municipio cuenta con un centro urbano y 51 centros rurales, en cuanto a su relieve su topografía es variada. Su temperatura oscila entre los 17 y 24 ºC; su vegetación predomina el bosque húmedo de montaña. En cuanto a su hidrografía, Michelena cuenta con el Río Angaraveca y las Quebradas Lobatera, la Jalapa y el Salado.\n\nSus límites son por el norte con el Municipio Ayacucho y Municipio Jáuregui, por el este con el Municipio Jáuregui y Municipio Andrés Bello, por el sur con el Municipio Lobatera, por el oeste con el Municipio Lobatera y Municipio Ayacucho. En Michelena el clima es muy fresco, sus temperaturas varían entre los 17 a 24 ºC\n\nLa economía municipal se centra en los siguientes sectores:\n\nTurismo \n\nEn cuanto al aspecto económico Michelena hace uso de su atractivo turístico, teniendo muy cerca el páramo y con ello se ha ideado la creación de un corredor turístico denominado El Corredor Turístico de las Rosas, donde el turista puede saborear dulces típicos de la región, así como bebidas, la mermelada y vino de rosas.\n\nCabe destacar que para hacer el recorrido por El Corredor Turístico de las Rosas se cuenta con el autobús el cual sale desde El Tejar (tasca) hasta La Última Troja, se cuenta con un vehículo llamado Rosalinda, el cual se diseñó con la finalidad de que los turistas y visitantes puedan apreciar los hermosos paisajes andinos.\n\nOtros sitios turisticos son:\n\n    * La Capilla del Tabor.\n    * La Casa natal de Marcos Pérez Jiménez, sede de la Sociedad Bolivariana del municipio.\n    * La Casa de la Cultura Don Vicente Becerra Pérez.\n\nIndustria \n\nCon respecto al sector industrial, el Municipio Michelena cuenta con fábricas de calzado, cerámica, pitillos y caramelos.\n\nAgricultura [editar]\n\nLa actividad agrícola mas desarrollada en el municipio es, según la Oficina de Estadísticas del Ministerio de Producción y Comercio (julio 2002), los cereales y leguminosas con 111 hectáreas sembradas, aportando un 24% a la producción del Estado Táchira, caraota con 64 hectáreas sembradas y aportando un 13% a la producción del Estado Tachira.	La economía municipal se centra en los siguientes sectores:\n\nTurismo \n\nEn cuanto al aspecto económico Michelena hace uso de su atractivo turístico, teniendo muy cerca el páramo y con ello se ha ideado la creación de un corredor turístico denominado El Corredor Turístico de las Rosas, donde el turista puede saborear dulces típicos de la región, así como bebidas, la mermelada y vino de rosas.\n\nCabe destacar que para hacer el recorrido por El Corredor Turístico de las Rosas se cuenta con el autobús el cual sale desde El Tejar (tasca) hasta La Última Troja, se cuenta con un vehículo llamado Rosalinda, el cual se diseñó con la finalidad de que los turistas y visitantes puedan apreciar los hermosos paisajes andinos.\n\nOtros sitios turisticos son:\n\n    * La Capilla del Tabor.\n    * La Casa natal de Marcos Pérez Jiménez, sede de la Sociedad Bolivariana del municipio.\n    * La Casa de la Cultura Don Vicente Becerra Pérez.\n\nIndustria \n\nCon respecto al sector industrial, el Municipio Michelena cuenta con fábricas de calzado, cerámica, pitillos y caramelos.\n\nAgricultura [editar]\n\nLa actividad agrícola mas desarrollada en el municipio es, según la Oficina de Estadísticas del Ministerio de Producción y Comercio (julio 2002), los cereales y leguminosas con 111 hectáreas sembradas, aportando un 24% a la producción del Estado Táchira, caraota con 64 hectáreas sembradas y aportando un 13% a la producción del Estado Tachira.	16269	oeste 	Sus límites son por el norte con el Municipio Ayacucho y Municipio Jáuregui, por el este con el Municipio Jáuregui y Municipio Andrés Bello, por el sur con el Municipio Lobatera, por el oeste con el Municipio L