1	20	19	SAN CRISTOBAL	san cristobal 	, es una ciudad venezolana capital del municipio homónimo y del estado Táchira en la región de Los Andes, también llamada la Ciudad de la Cordialidad. Fue fundada por Juan Maldonado Ordóñez y Villaquirán, capitán del ejército español, el 31 de marzo de 1561.\n\nSan Cristóbal es conocida entre otras cosas por ser sede de la Feria Internacional de San Sebastián, que se realiza durante el mes de enero, es popular en el país por sus eventos musicales, concursos y competencias deportivas, exposiciones industriales y comerciales y por sus corridas de toros; de reconocida tradición.\n\nEs también marco de una importante competición ciclística de nivel internacional llamada la Vuelta al Táchira en Bicicleta, por la cual han desfilado algunos de los más importantes ciclistas de ruta de Europa y América. La afición de los sancristobalenses por el ciclismo hizo posible la realización, en 1977, del único Mundial de esta especialidad que se ha celebrado en Venezuela.\nCatedral de San Cristóbal\nCatedral de San Cristóbal\n\nUbicada en los andes venezolanos, está rodeada de paisajes montañosos y naturales, las actividades económicas, culturales y sociales de la ciudad están muy condicionadas por su geografía.\n\nA San Cristóbal se suele mencionar por haber sido cuna de reconocidos personajes de diversas ocupaciones; historiadores, músicos, escritores y políticos entre otros.\n\nLa gente de la ciudad es conocida por ser amigables con los visitantes y francamente abiertos y dispuestos hacia todos aquellos que estén, en cualquier circunstancia, en su territorio, la disposición para recibir a los turistas y visitantes le ha valido el nombre de "Ciudad de la Cordialidad".\n\nEs la ciudad de las "Brisas del Torbes" del compositor tachirense Luis Felipe Ramón y Rivera, reflejo del sentir del sancristobalense, e inspiración de muchos de los temas del compositor Chucho Corrales.\n\nEl Deportivo Táchira F.C., uno de los equipos de fútbol de mayor tradición en Venezuela, uno de los de mayor y más fiel afición en el país, tiene su sede en el estadio Polideportivo de Pueblo Nuevo llamado por la afición de toda Venezuela "El Templo Sagrado" del fútbol nacional, el cual fue remodelado para ofrecer un recinto con mayor aforo ( 40.000 personas)y una arquitectura y funcionalidad más moderna, con motivo de la celebración en San Cristóbal de la Copa América Venezuela 2007, en donde se jugaron tres fechas, incluyendo la inauguración de la misma, a mediados de 2007.\n\nSan Cristóbal es la segunda ciudad menos pobre de Venezuela después de los municipios Chacao, Baruta y San Antonio de los Altos en el Estado Miranda. Posee un índice de población pobre de 17,05% según el censo del 2001 y según las fuentes del Instituto Nacional de Estadística. [Fuente: INE [1]]\n\nLa situación geográfica de la ciudad, punto de convergencia del tránsito binacional colombo-venezolano y su cercanía a principal zona ganadera del país (norte del Táchira, región sur del lago de Maracaibo y oeste del estado Barinas), han desarrollado la actividad bancaria y financiera de San Cristóbal, el segundo banco del sector público nacional (Banfoandes) y dos importantes instituciones privadas (Sofitasa y BanPro) así como la presencia de la mayor parte de los entes bancarios privados nacionales, colocan a San Cristóbal en una particular situación económica dado el alto flujo de capital que hay en la región, lo cual ha encarecido a sectores como la vivienda y la construcción.\n\nPor otra parte el comercio agrícola y pecuario tiene gran importancia en la ciudad e influye (al contrario del sector vivienda) en una manera muy positiva en los precios de los productos del campo, cuyos costos son menores que los de la media del país.\n\nSan Cristóbal es, principalmente, una ciudad comercial, donde se desarrollan importantes transacciones mercantiles, sin embargo esto no se ha reflejado apropiadamente en la calidad de vida del ciudadano promedio, porque si bien la ciudad tiene uno de los menores índices de pobreza absoluta entre las grandes ciudades de Venezuela, no existe una bonanza económica que beneficie a los sectores de menores recursos, y si no existen mayores privaciones entre este grupo social se debe a la situación antes mencionada de los bajos precios de los productos alimenticios.\n\nLa industria en San Cristóbal se limita, salvo contadas excepciones, a pequeñas fábricas de los sectores metal mecánico y textil, así como del calzado. La empresa alimentaria de mayor solidez es la Pasteurizadora Táchira, segunda productora de queso en Venezuela, creadora del bien conocido Queso Paisa. Además de Pastca existen también paqueñas industrias conservadoras de alimentos que se testacan por su calidad, entre ellas Conservas La Nona, productora de mermeladas y envasadora de vegetales en conserva, también son muy conocidos los productos de dulces típicos de Industrias La Andina y Dulcería Extrafina.\n\nLa ciudad además cuenta con la empresa de loterías más importante del país, la Lotería del Táchira, la cual es propiedad del estado, y que con su popular juego "Kino Táchira" ha hecho millonarios a miles de Venezolanos.Es sede de dos bancos regionales uno privado Banco Sofitasa y otro público Banfoandes al igual es sede de una empresa de Seguros (Seguros los Andes).\n\nTradicionalmente receptora de influencias externas (inmigración colombiana, italiana, española, portuguesa y en menor medida alemana y árabe) la gastronomía propia de San Cristóbal es un collage de platos autóctonos andinos (la pizca andina, las arepas de trigo, los indiecitos de repollo) con variaciones regionales de platos foráneos (mondongo o mute andino, callos con garbanzos). La riqueza de la gastronomía sancristobalense no se limita a los sabores de los fogones caseros, sino que es uno de los lugares de la geografía venezolana en donde es más fácil encontrar comida en la calle, muchas veces en improvisados tarantines y calderos, todos portadores de sabores tradicionales de la ciudad; las morcillas de la Avenida Carabobo o de Santa Teresa, pastelitos en Pueblo Nuevo o Barrio Obrero, chicha y masato en casi cada puesto o quiosco de comida; para que el sancristobalense o el turista disfrute en la mañana o a media tarde del puntal o puntalito, como se le llama en la ciudad a cualquier alimento tomado a deshora. Son reconocidos también los picantes andinos, que no faltan el la mesa del sancristobalense.	San Cristóbal es la segunda ciudad menos pobre de Venezuela después de los municipios Chacao, Baruta y San Antonio de los Altos en el Estado Miranda. Posee un índice de población pobre de 17,05% según el censo del 2001 y según las fuentes del Instituto Nacional de Estadística. [Fuente: INE [1]]\n\nLa situación geográfica de la ciudad, punto de convergencia del tránsito binacional colombo-venezolano y su cercanía a principal zona ganadera del país (norte del Táchira, región sur del lago de Maracaibo y oeste del estado Barinas), han desarrollado la actividad bancaria y financiera de San Cristóbal, el segundo banco del sector público nacional (Banfoandes) y dos importantes instituciones privadas (Sofitasa y BanPro) así como la presencia de la mayor parte de los entes bancarios privados nacionales, colocan a San Cristóbal en una particular situación económica dado el alto flujo de capital que hay en la región, lo cual ha encarecido a sectores como la vivienda y la construcción.\n\nPor otra parte el comercio agrícola y pecuario tiene gran importancia en la ciudad e influye (al contrario del sector vivienda) en una manera muy positiva en los precios de los productos del campo, cuyos costos son menores que los de la media del país.\n\nSan Cristóbal es, principalmente, una ciudad comercial, donde se desarrollan importantes transacciones mercantiles, sin embargo esto no se ha reflejado apropiadamente en la calidad de vida del ciudadano promedio, porque si bien la ciudad tiene uno de los menores índices de pobreza absoluta entre las grandes 