1	20	21	SUCRE	Queniquea 	Pueblo del Táchira que esta situado en el piedemonte andino, en una región montañosa, bajo un relieve accidentado envuelto en una densa niebla que recuerda a los Carpatos, con una vegetación muy rica y variada. Es hoy un Municipio pujante, emprendedor, lleno de vida y de optimismo, con una población que se acerca a los 20.000 habitantes, los cuales corresponden a Queniquea, que es la capital del Municipio Sucre y a sus dos parroquias: San Pablo y Mesa del Tigre. Posee una altura promedio de 1.517 m.s.n.m. y una temperatura media de 17,9° centígrados. Su principal actividad económica es la agrícola, herencia que se remonta al periodo histórico indígena.\n\nGrandes estudiosos como Julio C. Salas y Alfredo Jahn, por mencionar algunos han dado hipótesis a los primeros asentamientos indígenas del Táchira, dando a la región de [[Queniquea la cuna de la civilización Kenike. Don Tulio Febres Cordero es más explicito y señala que todas estas tribus estaban asociadas a la vasta población indígena que tenía su centro principal en la altiplanicie de Cundinamarca, asiento de los Chibchas o Muiscas, cuyo imperio ocupa el tercer lugar en el orden jerárquico de la antigua civilización del nuevo mundo. Y, más recientemente la arqueóloga [[Reina Durán ha señalado que en Queniquea, en la aldea Machado se encuentra el Machu-Pichu tachirense. Lo cierto es que el nombre de Queniquea pervive, y es un nombre indígena y que ya Don Tulio Febres Cordero señala en su lista de poblaciones indígenas del Táchira. La arqueóloga Reina Duran en una clasificación muy interesante que hace sobre las poblaciones indígenas señaló que los quiniqueos pertenecen a la familia Aruaca.\n\nEn ese periodo histórico que se pierde en el tiempo, los indígenas denominados Queniques, vivían de la tranquilidad, sembrando el campo, adorando a sus deidades, hasta que un día el dios del Trueno les envió aquellos seres vestidos de metal. Esto sucedía el día que Juan de Maldonado cruza la ciudad del Espíritu Santo (La grita) y dirigiéndose a la derecha llega a un Valle, el cual bautizara como Valle del Espíritu Santo (donde hoy se asienta San José de Bolívar) habitado por una aldea de nombre Babuquena, esto ocurría el 24 de mayo de 1561, allí Maldonado pernotaría con sus hombres aquella noche, como señala en sus Crónicas Fray Pedro de Aguado. Al día siguiente, Juan de Maldonado se dirige a otra meseta, donde encuentra otra aldea con los indios Queniques, es así como Juan de Maldonado descubre Queniquea el 25 de mayo de 1561. Juan de Maldonado y sus acompañantes debieron quedar admirados ante la belleza de estos paisajes, ya para 1601 el Juez Pedro de Sandes mandaría a construir un Monasterio en el Valle del Espíritu Santo a donde acudirían los indios del Capitán Gabriel de Anguieta del pueblo de Queniquea.	Su principal actividad económica es la agrícola, herencia que se remonta al periodo histórico indígena.	20000	central	limites\n\nnorte: jose maria vargas\nsur: uribante\noeste: andres bello y cardenas\neste: francisco de miranda 	224 km2 	0
1	23	1	ALMIRANTE PADILLA	el toro	El Municipio Almirante Padilla, es uno de los 21 municipios ubicados en el estado Zulia, enVenezuela. Ubicado en la entrada del lago de Maracaibo, Su capital es El Toro.\n\nEs un municipio insular compuesto por las islas que se encuentran en el límite entre el Lago de Marcaibo y el Golfo de Venezuela:\n\nAlgunas de las islas ubicadas en el municipio son:\n\n    * Isla de Toas: Se encuentra al sur de la península de San Carlos, a una distancia de 2,5 kilómetros de ésta y a 5 kilómetros del frente oriental de San Rafael del Moján. Desde esta ciudad se distingue la isla. Cubre una superficie de 3 kilómetros. Existen en ella las salinas de El Toro y Aracho, yacimientos de lignito sulfurosos, arcillas de explotación en el sector sur y un pequeño yacimiento de mineral cuprífero. La presencia de calizas ha permitido su industrialización a fin de obtener cemento. Tiene un pequeño poblado llamado El Toro el cual es la capital del municipio y se puede llegar a ella en lancha.\n\n    * Isla de Pescadores: Está ubicada en la bahía de El Tablazo, formando el limite oriental de la verdadera barra de Maracaibo. Su formación es de material aluvional; sus orillas están cubiertas de manglares. Tiene una superficie de 2 km².\n\n    * Isla Los Pájaros: está al norte de la isla de Pescadores. Su origen es también aluvional y está cubierta de manglares. También se le llama Isla del Diablo.\n\n    * Isla de Zapara: se encuentra en la entrada de la bahía El Tablazo, con una posición sumamente estratégica, por ello se erigió allí una fortaleza durante la Colonia.\n\nTiene una longitud de 7 kilómetros. Está casi toda cubierta por médanos que tienen una altura de hasta 30 metros. También tiene algunos cocoteros y, cerca de su litoral norte, arrecifes.\n\n    * Isla de San Carlos: se encuentran al norte del Zulia separada del municipio Páez por la bahía de Urabá. En ella se encuentra el castillo colonial de San Carlos, patrimonio histórico del Zulia, construido en 1643. Es uno de los atractivos turísticos de la región, existe una ruta turística de ferry que lleva a la isla. Se encuentra al norte de la isla de Toas.\n\n    * Isla Providencia: se encuentra dentro de la bahía del Tablazo, en ella se encontraba un leprosario, hasta que el científico venezolano Dr Jacinto Convit inventó una vacuna contra dicha enfermedad.\n\n    * Isla Barboza.\n\n    * Isla Zaparita.\n\n    * Isla Capitán Chico.\n\n    * Islas los tortuguillos.\n\n    * Entre otras islas.\n\n\nLa principal fuente de ingresos la constituyen los yacimientos minerales de la Isla de Toas tales como las salinas de El Toro y Aracho, yacimientos de lignito sulfurosos, arcillas de explotación en el sector sur y un pequeño yacimiento de mineral cuprífero. La presencia de calizas ha permitido su industrialización a fin de obtener cemento. Además de la actividad turística con un ferry que hace un recorrido por las islas del municipio saliendo de Maracaibo y la actividad pesquera.\n\nLímites\n\nNorte: Golfo de Venezuela.\nSur: Bahia de El Tablazo.\nEste: Golfo de Venezuela.\nOeste: Municipio Páez.\n\n 	La principal fuente de ingresos la constituyen los yacimientos minerales de la Isla de Toas tales como las salinas de El Toro y Aracho, yacimientos de lignito sulfurosos, arcillas de explotación en el sector sur y un pequeño yacimiento de mineral cuprífero. La presencia de calizas ha permitido su industrialización a fin de obtener cemento. Además de la actividad turística con un ferry que hace un recorrido por las islas del municipio saliendo de Maracaibo y la actividad pesquera.	9031	norte	Límites\n\nNorte: Golfo de Venezuela.\nSur: Bahia de El Tablazo.\nEste: Golfo de Venezuela.\nOeste: Municipio Páez.\n\n 	151 km2	0
1	20	22	URIBANTE	pregonante 	Pregonero es la capital del municipio Uribante del Estado Táchira en Venezuela. Fue fundado en la segunda mitad del siglo XVIII por Francisco de Borja y Mora. La población se caracteriza por posee un clima agrable y fresco. Está ubicado cerca de la represa Uribante Caparo. La población vive de la actividad cafetera, ganadería y horticultura. El turismo, con base en las atracciones andinas, tiene posibilidades de desarrollo en Pregonero.\n\nLa población de Pregonero cuenta con diversas potencialidades para el desarrollo de la agricultura, el turismo y la generación de energía eléctrica.\n\nLa población cuenta con 2 hermosas plazas urbanas. La Plaza Bolivar ubicada al frente de la Iglesia Matriz de San Antonio de Padua y la Plaza Miranda al frente de la Iglesia Nuestra Señora del Carmen.\n\nLa Escuela Bolivariana Sánchez Carrero, el Liceo Bolivariano Francisco de Borja y Mora, el Colegio Santa Mariana de Jesús, la Escuela Estatal Jose Ignacio Cardenas y la Escuela Especial son las principales instituciones educativas de la localidad.\n\nEl Estadio Jose Ramon Sanchez García (Mora, no García)es la principal instalación deportiva de este atrayente pueblo andino.\n\nEl primer Alcalde fue el señor Edilio Roa Valero. El primer presidente del Concejo en la epoca democratica fue el señor Horario Contreras.\n\nEl Municipio Uribante limita al norte y al Este con el Estado Merida. Al sur con los Municipios Libertador y Fernandez Feo. Al oeste con los Municipios Cardenas, Sucre, Francisco de Miranda y Jauregui.	La población vive de la actividad cafetera, ganadería y horticultura. El turismo, con base en las atracciones andinas, tiene posibilidades de desarrollo en Pregonero.\n	54365	sureste 	El Municipio Uribante limita al norte y al Este con el Estado Merida. Al sur con los Municipios Libertador y Fernandez Feo. Al oeste con los Municipios Cardenas, Sucre, Francisco de Miranda y Jauregui.	2500 km2 	0
1	21	14	VALERA	valera	El Municipio Valera es uno de los veinte municipios que forman parte del Estado Trujillo en Los Andes de Venezuela. Su capital es la población de Valera. Tiene una extensión de 240 km² y para el censo 2001 del INE su población era de 128.190 habitantes, con una densidad de 534,1 habitantes por Km². El municipio está integrado por seis parroquias, Juan Ignacio Montilla, La Beatriz, La Puerta, Mendoza del Valle de Momboy, Mercedes Díaz y San Luis.\n\nEl turismo y sector terciario son las bases de la economía de Valera, siendo crucial para el comercio de productos regionales para el resto del país y más allá, y también teniendo sitios interesantes para visitar como la Iglesia san Juan Bautista, el Ateneo de Valera, y una de sus festividades más importantes, la Feria de la Paz.\n\nEl Municipio Valera se encuentra ubicado al sur del Estado Trujillo. El municipio cuenta con la ciudad más grande del estado; Valera, que es su capital y también es capital económica de este estado andino venezolano, esta ciudad supera todas las demás en población, siendo la única pasando sobre los 100.000 habitantes en todo el estado. Su altura oscila entre 200 y 500 msnm. dependiendo de su ubicación, siendo la parte más baja una especie de franja pequeña en el municipio que va de suroeste a noroeste, siendo más para el este del municipio las partes más altas.	El turismo y sector terciario son las bases de la economía de Valera, siendo crucial para el comercio de productos regionales para el resto del país y más allá, y también teniendo sitios interesantes para visitar como la Iglesia san Juan Bautista, el Ateneo de Valera, y una de sus festividades más importantes, la Feria de la Paz.	128190	sur 	limites\n\nnorte: escuque\nsur: urdaneta\noeste: monte carmero\neste: valera	240 km2 	0
