1	23	3	CABIMAS	cabimas	El Municipio Cabimas, es uno de los 21 municipios ubicados en el estado Zulia, en Venezuela. Ubicado en la Costa Oriental del Lago de Maracaibo, su capital es la ciudad de Cabimas.\n\nEl municipio Cabimas se encuentra ubicado en la costa oriental del Lago de Maracaibo, al sur de los municipios Santa Rita y Miranda, al oeste del Estado Falcón y al norte de los municipios Simón Bolívar y Lagunillas.\n\nUbicación Astronómica:\n\n    * 10°28’ Lat. N 70°52’ Long. W\n\n    * 10°19’ Lat. N 71°27’ Long. W\n\n    * Capital: Cabimas\n\n    * Superficie: 604 Kms2\n\n    * Población: 268.006 habitantes\n\n    * Densidad: 443,71 hab/kms2\n\n\nLa principal actividad la constituye la insdustria Petrolera, desde el descubrimiento del pozo "Barroso 2" (R4) en 1922. En el se encuentran los campos petrolíferos de La Rosa y Punta Benítez en Tierra, y Ambrosio y La Salina en el Lago, son campos maduros que producen crudo mediano/pesado de la Formación la Rosa de edad Mioceno; el campo Ambrosio también produce crudo condensado y gas de las formaciones Grupo Cogollo de edad Cretácico. El campo la Rosa pasó a ser en el año 2006 la asociación estratégica Petrocabimas, con un 60 % de las acciones para la empresa estatal PDVSA y 40 % para la operadora nacional Suelopetrol, esta última manejó el campo en concesión desde 1996. Tiene los patios de tanques La Salina, Punta Gorda y H7. Cabimas no posee infraestructura para el manejo y procesamiento del gas natutal, así que el gas natural que producen sus pozos se ha desperdiciado durante décadas, siendo incinerado con equipos de venteo. Actualmente existe el proyecto de construir un complejo criogénico. El comercio es otra actividad de Cabimas, con los grandes almacenes fundados y manejados por inmigrantes Sirios, Libaneses, Griegos, Españoles, Italianos, Chinos y Colombianos. Existe una actividad pesquera perjudicada por los crecimientos de la planta Lemna SP en el Lago de Maracaibo, la contaminación del Lago y la inseguridad. Existen algunas fábricas de artículos como bolsas plásticas o otros. No hay una zona industrial. En la zona rural parroquia Arístides Calvani, se practica la agricultura de árboles frutales, y la ganadería. En Cabimas se encuentra la asociación de Ganaderos del Este del Lago (AGEL).\n\nEl clima es caluroso con temperaturas de más de 30ºC durante todo el año, la combustión de gas natural de los pozos petroleros produce grandes cantidades de Dióxido de Carbono (CO2), lo que ocasiona un efecto invernadero, que hace de Cabimas un sitio más caliente que Maracaibo. El clima es seco la mayor parte del año, y durante la temporada de lluvias entre mayo y octubre caen fuertes chubascos.\n\nEl efecto invernadero hace los días nublados más calurosos que los soleados, ya que el CO2 no deja escapar el calor a la atmósfera.\n\nlimites\n\nnorte: santa rita\nsur: simon bolivar\noeste: lago de maracaibo\neste: falcon \n 	La principal actividad la constituye la insdustria Petrolera, desde el descubrimiento del pozo "Barroso 2" (R4) en 1922. En el se encuentran los campos petrolíferos de La Rosa y Punta Benítez en Tierra, y Ambrosio y La Salina en el Lago, son campos maduros que producen crudo mediano/pesado de la Formación la Rosa de edad Mioceno; el campo Ambrosio también produce crudo condensado y gas de las formaciones Grupo Cogollo de edad Cretácico. El campo la Rosa pasó a ser en el año 2006 la asociación estratégica Petrocabimas, con un 60 % de las acciones para la empresa estatal PDVSA y 40 % para la operadora nacional Suelopetrol, esta última manejó el campo en concesión desde 1996. Tiene los patios de tanques La Salina, Punta Gorda y H7. Cabimas no posee infraestructura para el manejo y procesamiento del gas natutal, así que el gas natural que producen sus pozos se ha desperdiciado durante décadas, siendo incinerado con equipos de venteo. Actualmente existe el proyecto de construir un complejo criogénico. El comercio es otra actividad de Cabimas, con los grandes almacenes