1	23	6	JESUS ENRIQUE LOSSADA	La Concepción	El Municipio Jesús Enrique Losadaes uno municipio de los 21 municipios del estado Zulia, en Venezuela, ubicado al noroeste del lago de Maracaibo, con una superficie de 3.101 km² y una población de 83.458 habitantes para 2001.\n\nEl municipio presenta tres tipos de paisajes: plano, con suelos bien drenados sin problemas de salinidad; paisaje de colina, son suelos de textura media susceptibles a la erosión; y paisaje de montaña, son suelos pocos profundos, de escaso desarrollo, lavados y con problemas de fertilidad.\n\nPresenta un clima de Bosque húmedo tropical, Bosque muy húmedo tropical, Bosque húmedo montano bajo. Las precipitaciones se incrementan de norte a sur y de este a oeste con una variación de 550-1500 mm. Es un municipio alto productor de Sorgo Granero para la industria del alimento balanceado.\n\nTámbien presenta producción agrícola animal y actividad petrolera.\n\nEl alcalde del municipio Jesús Enrique Losada para el período 2004-2008 es el señor Mario Urdaneta.\n\nlimites\n\nnorte: mara \nsur: rosario de perija, cuñada de urdaneta\neste: maracaibo\noeste: colombia	Es un municipio alto productor de Sorgo Granero para la industria del alimento balanceado.\n\nTámbien presenta producción agrícola animal y actividad petrolera.	83458	oeste	limites\n\nnorte: mara \nsur: rosario de perija, cuñada de urdaneta\neste: maracaibo\noeste: colombia	3101 km2	0
1	23	16	SUCRE	Bobures	Municipio Sucre, ubicado en el estado Zulia, Venezuela, ubicado en el Sur del Lago de Maracaibo, Su capital es Bobures. Recibe su nombre en honor al prócer Venezolano General Antonio José de Sucre, el Gran Mariscal de Ayacucho.\n\nEl municipio Sucre se encuentra en el extremo sur del Lago de Maracaibo, está dividido en dos partes, la sección oeste tiene límites al oeste con el municipio Francisco Javier Pulgar, al este y al sur con el estado Mérida y al norte con el lago de Maracaibo. La sección este es el pequeño enclave del Estado Zulia entre los estados Trujillo y Mérida, y es donde se encuentra la capital,tiene límites al oeste y al sur con el estado Mérida, al este con el estado Trujillo y al norte con el lago de Maracaibo. Esta división es consecuencia de las salidas al Lago de Maracaibo que se le concedieron a los estados Mérida (La Bolivia) y Trujillo (La Ceiba). Actualmente el estado Mérida reclama la totalidad del municipio Sucre en base a obras que ha realizado en la población de los naranjos. El relieve del municipio Sucre es plano, con un clima húmedo.\n\nEl municipio se dedica a la pesca, además de ser un puerto de exportación y producción de rubros agrícolas, principalmente del plátano.\n\nDestaca el culto a San Benito de Palermo, santo negro del santoral católico, el cual es celebrado con tambores (chimbángeles), ofrendas frutales y procesiones. Todas las poblaciones del municipio tienen su San Benito, costumbre muy arraigada en la población siendo la mayoría descendientes de africanos. Destaca la labor cultural de Juan de Dios Martínez, quien con sus investigaciones y sus actividades como promotor cultural rescató el significado y la dignidad de las fiestas de San Benito, llevando sus investigaciones hasta Palermo (Sicilia) y hasta África (Nigeria, Namibia, Angola), para conocer los orígenes de la cultura de su pueblo. En homenaje a San Benito y al pueblo de Sucre el grupo gaitero Barrio Obrero de Cabimas compuso la canción "Bobures" y el grupo gaitero Gran Coquivacoa de Cabimas compuso la canción San Benito. Existe un estilo propio de gaita zuliana en este municipio conocido como Gaita de Tambora.	El municipio se dedica a la pesca, además de ser un puerto de exportación y producción de rubros agrícolas, principalmente del plátano.	57396	sur 	tiene límites al oeste con el municipio Francisco Javier Pulgar, al este y al sur con el estado Mérida y al norte con el lago de Maracaibo. La sección este es el pequeño enclave del Estado Zulia entre los estados Trujillo y Mérida, y es donde se encuentra la capital,tiene límites al oeste y al sur con el estado Mérida, al este con el estado Trujillo y al norte con el lago de Maracaibo	1252 km2	0
1	23	5	COLON	San Carlos del Zulia	El municipio Colón, es 1 de los 21 municipios del estado nor-occidental venezolano del Zulia. El municipio se ubica al suroeste del estado, y a la vez, tiene 5 parroquias de las más de 80 existentes que tienen los municipios conformantes de este estado venezolano. La capital del municipio es la población de San Carlos del Zulia.\n\n\nEl municipio se ubica al sur-oeste del estado en la ubicación geográfica y en la astronómica se ubica a: 09°14’ Latitud Norte 71°41’ Longitud Oeste / 08°31 Latitud Norte 72°10 Longitud Oeste. Su superficie es de 3.368 km², con una población de 107.821 habitantes y una densidad de 32,0 habitantes porkm² (censo de 2001).\n\nEl municipio tiene límites por:\n\n    * El Norte con: Lago de Maracaibo y Municipio Catatumbo, ambos del estado Zulia.\n\n    * El Este con: Municipio Francisco Javier Pulgar, también del estado Zulia.\n\n    * El Sur con: Los Estados venezolanos de Táchira y Mérida.\n\n    * El Oeste con : Municipio Catatumbo.\n\nLa población del municipio es de 107.821 habitantes 32,0 habitantes por km² según el censo de 2001, la población se centra más que todo en San Carlos del Zulia y Santa Bárbara por ser las poblaciones con mejor estructura urbana, la demás poblaciones son técnicamente rurales, y la población es regular, un 50 a 60% de la población está al norte del municipio y al sur está el restante 40%; aquí, la mayoría de la población es rural.\n\nLa economía principal del municipio es la agricultura, destacando el plátano como el más producido del municipio, además, cabe destacar que el municipio es referencia obligatoria porque es un muy importante productor de alimentos para la región y el país. También hay otros campos económicos importantes como el comercio y en menor desarrollo la industria. El principal atractivo turístico sería el Chama, un río importante para la regíon que baja con aguas blancas andinas hasta el municipio y más allá.	La economía principal del municipio es la agricultura, destacando el plátano como el más producido del municipio, además, cabe destacar que el municipio es referencia obligatoria porque es un muy importante productor de alimentos para la región y el país. También hay otros campos económicos importantes como el comercio y en menor desarrollo la industria. El principal atractivo turístico sería el Chama, un río importante para la regíon que baja con aguas blancas andinas hasta el municipio y más allá.	107821	sur 	El municipio tiene límites por:\n\n    * El Norte con: Lago de Maracaibo y Municipio Catatumbo, ambos del estado Zulia.\n\n    * El Este con: Municipio Francisco Javier Pulgar, también del estado Zulia.\n\n    * El Sur con: Los Estados venezolanos de Táchira y Mérida.\n\n    * El Oeste con : Municipio Catatumbo.\n	3368 km2	0
1	23	15	SANTA RITA	santa rita	El municipio Santa Rita, es 1 de los 21 municipios que conforman al estado venezolano del Zulia. Su Capital es la población de Santa Rita. Su actual alcalde es el señor Alenis Guerrero Urrutia.\n\nEl Municipio Santa Rita del Estado Zulia se encuentra ubicado en la Costa Oriental del Lago de Maracaibo.\n\nSus límites son:\n\n    * Por el Norte con: Municipio Miranda.\n\n    * Por el Este con: Municipio Miranda.\n\n    * Por el Sur con: Municipio Cabimas.\n\n    * Por el Oeste con: Lago de Maracaibo.\n\nEstá conformado en su totalidad por el Cuaternario Cenozoico (último período). No se halla ningún tipo de rocas ígneas o metamórficas, encontrándose parte del Eoceno y Mioceno recubierto en su totalidad por el Cuaternario.\n\nLa distribución de los suelos se caracteriza por ser de origen reciente. Estos son: arcillosos, ondulados, moderadamente erosionados; ondulados excesivamente drenados; escabrosos quebrados en la zona este, específicamente, y arcillosos imperfecta- mente drenados salinosos en la costa del Lago de Maracaibo. Este tipo de suelo permite un mayor desarrollo de la agricultura.\n\nEs un clima cálido y seco, caracterizado por sus escasas precipitaciones y altas temperaturas registradas a lo largo del año. Las lluvias ocurren en dos períodos, mayo y octubre-noviembre.\n\nConformado por dos tipos de zonas de vida; en la parte este se encuentra el bosque seco tropical y a medida que se incrementa el área urbana hacia la costa del Lago, bosque muy seco tropical.\n\nConformado por dos ríos principales: el río Aurare y el río Mene u Olaya al norte, tiene por el oeste la costa del Lago de Maracaibo; además, al sur, una pequeña red de ríos con carácter intermitente\n\nEl potencial económico del municipio lo constituyen la industria petroquímica con plantas como PRALCA, la pesca tanto de peces como de camarones del Lago de Maracaibo, además de su actividad agropecuaria. Posee también las instalaciones del Hipódromo Nacional de Santa Rita, y el peaje del Puente Sobre el Lago de Maracaibo.\n\nEn los últimos años el sector agrícola ha cobrado importancia, destacándose su producción en los siguientes rubros: maíz, sorgo, yuca, plátano (el cual se produce en todo el municipio) y gracias a las condiciones físicas del municipio y a las nuevas tecnologías aplicadas puede ser exportado en grandes cantidades, En el sector ganadero también presenta buenas producciones en los renglones de porcinos, bovinos, aves, leche (bovinos), además de huevos y la producci6n pesquera, que es una de las más significativas a escala regional. La actividad pesquera es muy importante desde el punto de vista del empleo y la producci6n que genera dentro de la econo-mía del municipio. Dentro de las especies predominantes se encuentran: el cangrejo, la corvina y el sábalo.\n\nActualmente presenta problemas debido al proceso de contaminación, lo que ocasiona una disminución en el pro-ceso productivo de tan importante recurso. También se están desarrollando otras industrias en el campo de la química desti-nada a producir alcoholes hidratados y otros productos que cuentan con la inver-sión de capital nacional y extranjero.\n\nEl Municipio Santa Rita posee un gran número de atractivos turísticos, comenzando con el Lago de Maracaibo de gran belleza escénica que bordea gran parte del municipio, 16 Kilómetros de playa, igualmente pueden encontrarse Ciénagas, Islas de gran valor paisajístico, variedad de instalaciones de agua y playa y de otros deportes, recreación (Hipódromo nacional de Santa Rita) equipamiento de alojamiento de otros servicios. De igual manera se realizan durante todo el año importante acontecimientos programados como lo son las fiestas patronales, corrida de toros, clásicos hípicos internacionales, encuentros deportivos regionales y nacionales, toros coleados, piques fangueros, festivales de músicas criolla, etc.\n\nSanta Rita es el de mayor importancia, por su mayor población, por su ubicación y por los servicios básicos que presenta. El resto del municipio no recibe la atención con que cuenta la capital del municipio, por lo que muchos de los pequeños centros poblados presentan deficiencias en el suministro de los servicios. Cuenta con energía eléctrica, que es abastecida por Enelco a todos los sectores del municipio. La red de gas se está implantando, pero es servida a través de cilindros de gas (bombonas). El servicio telefónico suministrado por CANTV está expandiéndose y abarca en la actualidad varios sectores, Entre los servicios que son deficientes se encuentra el aseo urbano, el cual sólo atiende al 60% de la población. El agua es servida por Hidrolago también a un 60% de la población en forma parcial, acentuándose la deficiencia de su suministro en los centros rurales. El correo, en tanto, es otro servicio poco satisfactorio, ya que cuenta con sólo una oficina mal acondicionada para esta actividad.	El potencial económico del municipio lo constituyen la industria petroquímica con plantas como PRALCA, la pesca tanto de peces como de camarones del Lago de Maracaibo, además de su actividad agropecuaria. Posee también las instalaciones del Hipódromo Nacional de Santa Rita, y el peaje del Puente Sobre el Lago de Maracaibo.\n\nEn los últimos años el sector agrícola ha cobrado importancia, destacándose su producción en los siguientes rubros: maíz, sorgo, yuca, plátano (el cual se produce en todo el municipio) y gracias a las condiciones físicas del municipio y a las nuevas tecnologías aplicadas puede ser exportado en grandes cantidades, En el sector ganadero también presenta buenas producciones en los renglones de porcinos, bovinos, aves, leche (bovinos), además de huevos y la producci6n pesquera, que es una de las más significativas a escala regional. La actividad pesquera es muy importante desde el punto de vista del empleo y la producci6n que genera dentro de la econo-mía del municipio. Dentro de las especies predominantes se encuentran: el cangrejo, la corvina y el sábalo.\n\nActualmente presenta problemas debido al proceso de contaminación, lo que ocasiona una disminución en el pro-ceso productivo de tan importante recurso. También se están desarrollando otras industrias en el campo de la química desti-nada a producir alcoholes hidratados y otros productos que cuentan con la inver-sión de capital nacional y extranjero.	44119	noreste	Sus límites son:\n\n    * Por el Norte con: Municipio Miranda.\n\n    * Por el Este con: Municipio Miranda.\n\n    * Por el Sur con: Municipio Cabimas.\n\n    * Por el Oeste con: Lago de Maracaibo.\n	578 km2 	0
1	23	11	MARACAIBO	maracaibo	El Municipio Maracaibo es el municipio más poblado del estado venezolano del Zulia con más de 1 millón de habitantes, lo que lo ubica entre los primeros de Venezuela. Posee 393 km² y está localizado en el lado oeste del Lago de Maracaibo. Su capital es la ciudad de Maracaibo, es el centro económico, financiero, político y militar del estado, de allí su gran importancia. La Autoridad del Municipio Maracaibo es el Alcalde Gian Carlos Di Martino quien gobierna desde el año 2000 hasta la fecha actual ya que, ganó la reelección del 2004 apoyado por partidarios oficialistas.\n\nLas Parroquias de el Municipio Maracaibo son las siguientes:\n\n    * Antonio Borjas Romero.\n    * Bolívar.\n    * Cacique Mara.\n    * Carracciolo Parra Pérez.\n    * Cecilio Acosta.\n    * Cristo de Arranza.\n    * Coquivacoa.\n    * Chiquinquirá.\n    * Francisco Eugenio Bustamante.\n    * Idelfonzo Vásquez.\n    * Juana de Ávila .\n    * Luis Hurtado Higuera.\n    * Manuel Dagnino.\n    * Olegario Villalobos.\n    * Raúl Leoni.\n    * Santa Lucía.\n    * Venancio Pulgar.\n    * San Isidro.\n\nEl Rey de España FELIPE IV, otorgó a la ciudad de Maracaibo su Escudo de Armas, “como símbolo de honor y señorío” mediante Real Cédula del 20 de junio de 1634.\n\nEl texto “muy noble y leal” de la banda que posee el escudo en la columna derecha, es el título otorgado a la ciudad de Maracaibo el 21 de marzo de 1813 por la corte general y extraordinaria de España en virtud de que la ciudad no se plegó al movimiento independentista iniciado en el año 1810.\n\nEl escudo lo forman dos columnas y un navío en medio, como símbolo de la barra del Lago de Maracaibo. Las fechas del escudo de armas del municipio Maracaibo -1634 en la banda desplegada alrededor de la columna derecha y 1865 en la columna izquierda-, indican el año de la concesión del escudo autorizado por el Rey Felipe IV y el año de su readaptación por parte del Concejo Municipal del distrito Maracaibo.\n\nEn fecha 8 de septiembre de 1971 se adoptó el Estandarte de San Sebastián, patrono de la ciudad, como bandera oficial del Municipio Maracaibo, consti¬tuida por los colores blanco y rojo en franjas unidas y horizontales en el orden expresado.\n\nEn ocasión de celebrarse el 24 de agosto de 1977, los 500 años del descubrimiento del Lago de Maracaibo y considerando que este fue elemento definitivo para propiciar el asentamiento de la población que dio origen a la fundación de la ciudad que lleva su nombre, a merced de su comunicación lacustre, se agrega una tercera franja de color azul a la Bandera Oficial del Municipio Maracaibo, que simboliza la nobleza del Lago de Maracaibo y su contribución al mantenimiento del gentilicio de los marabinos.\n\nLa Bandera Oficial queda constituida por los colores blanco, rojo y azul, en franjas unidas iguales y horizontales en el orden expresado de supe¬rior a inferior, simbolizando el color blanco la pureza del santo patrono, el rojo la sangre derramada por el mártir al morir luchando por sus ideales; y el azul, la nobleza del Lago de Maracaibo. En la parte izquierda superior de la franja blanca tiene, a todo color, el Escudo de Armas de la ciudad (Maracaibo, 5 de septiembre de 1986 DECRETO de la Alcaldía de Maracaibo Nº 010)\n\nLímites\n\nNorte: Municipio Mara, Sur: Municipio San Francisco, Este: Lago de Maracaibo, Oeste: Municipio Jesús E. Lossada\n\n 	Maracaibo posee una economía muy dinámica siendo la capital de una de las regiones económicas más importantes de la nación, Zulia, en donde es extraída la mayor parte del petróleo producido en Venezuela.	1428423	centro norte	Límites\n\nNorte: Municipio Mara, Sur: Municipio San Francisco, Este: Lago de Maracaibo, Oeste: Municipio Jesús E. Lossada\n\n 	393 km2 	0
1	4	6	AUT. ROMULO GALLEGOS	Elorza	El Municipio Rómulo Gallegos está ubicado al oeste del Estado Apure, Venezuela limita al norte con los municipios Muñoz y Páez, al sur con el Municipio Pedro Camejo y Colombia, al este con el Municipio Achaguas y al oeste limita con el Municipio Páez y Colombia.\n\nOcupa una superficie de 23.148 km² y tiene una población estimada de 25.000 habitantes (2006)(16.589 segun censo de 2001). Su capital es el poblado de Elorza. El municipio está dividido en dos paroquías, La Trinidad de Orichuna y la parroquía Elorza.\n\nA este municipio se le da la denominación de Rómulo Gallegos en honor al presidente venezolano Rómulo Gallegos (del 15 de febrero de 1948 al 24 de noviembre del mismo año).\n\n Economía \n\nSu economía esta basada en las actividades ganaderas y agrícolas con cultivos de regadío. Sus principales cultivos son caña de azúcar, frijoles y algodón. el folclore es típico del de los LLanos Venezolanos.\n\n	 Economía [editar]\n\nSu economía esta basada en las actividades ganaderas y agrícolas con cultivos de regadío. Sus principales cultivos son caña de azúcar, frijoles y algodón. el folclore es típico del de los LLanos Venezolanos.	25000	oeste	imita al norte con los municipios Muñoz y Páez, al sur con el Municipio Pedro Camejo y Colombia, al este con el Municipio Achaguas y al oeste limita con el Municipio Páez y Colombia.	23148km2	0
1	4	3	MUÑOZ	bruzual	El Municipio Muñoz, es uno de los 7 municipios del Estado Apure, Venezuela cuya capital es la ciudad de Bruzual. Tiene una superficie de 7.925 km² y una población de 24.397 habitantes (censo 2001).\n\nLa cría de reses y aves despunta como actividad económica rural, aunque sobrepasa el sector de comercio, servicios y transporte, gracias al auge que experimentan los centros urbanos.\nLímites\n\nPor el Norte:Con el Estado Barinas, desde la desembocadura del río Suripa en el río Apure siguiendo aguas abajo por este río hasta encontrar la desembocadura del Caño Macanillal en el mismo río Apure.\n\nPor el Sur: Con el Municipio Rómulo Gallegos por el río Arauca desde la desembocadura del Caño Mataparito, siguiendo Aguas Arriba del río Arauca hasta la desembocadura del Caño Perro de Agua y de aquí sigue en línea recta rumbo al Noroeste hasta llegar al nacimiento del Caño Gerónimo en el río Arichuna, punto situado al Norte del vecindario Boca de Chacero donde existe un hito y continuando por el Río Orichuna aguas arriba hasta llegar al paso de Santa Elena, donde se encuentra un hito.\n\nPor el Este: Con el Municipio Achaguas por una línea recta partiendo desde la desembocadura del caño Macanillal y con rumbo Suroeste, terminando en la desembocadura del Caño Mataparito en el río arauca donde existe un hito.\n\nPor el Oeste: Con el Municipio Rómulo Gallegos desde el Hito en el paso Santa Elena en el río Orichuna, por una línea recta rumbo al Noroeste hasta la confluencia del Caño Caicara y el río Buría, continuando en línea recta hacia el Norte y limitando con el Municipio Paez hasta el punto donde nace el caño Matapalan en el Caño Guaritico, desde aqui continúa otra linea recta con rumbo al Noroeste hasta la desembocadura del río Suripa en el río apure, punto de partida.\n\n 	La cría de reses y aves despunta como actividad económica rural, aunque sobrepasa el sector de comercio, servicios y transporte, gracias al auge que experimentan los centros urbanos.	