COPY cugd01_republica (cod_republica, denominacion, caracteristicas, economia, poblacion, moneda, signo_monetario, dimension) FROM stdin;
1	VENEZUELA	OFICIALMENTE REPúBLICA BOLIVARIANA DE VENEZUELA , ES UNA REPúBLICA FEDERAL SITUADA AL NORTE DE AMéRICA DEL SUR, CONSTITUIDA COMO UN ESTADO DEMOCRáTICO Y SOCIAL, DE DERECHO Y DE JUSTICIA,AUTóNOMO Y SOBERANO, CONSAGRADO EN SU ACTA DE INDEPENDENCIA FIRMADA EL 5 DE JULIO DE 1811. SU CAPITAL FEDERAL Y SEDE DE LOS PODERES DE LA NACIóN ES CARACAS.\n\nEL PAíS, ESTRUCTURADO POR 24 ESTADOS Y UN DISTRITO CAPITAL, LIMITA AL NORTE CON EL MAR CARIBE —QUE A SU VEZ INCLUYE LAS FRONTERAS MARíTIMAS CON LA REPúBLICA DOMINICANA, ARUBA, LAS ANTILLAS NEERLANDESAS, PUERTO RICO, LAS ISLAS VíRGENES, MARTINICA, GUADALUPE Y TRINIDAD Y TOBAGO—, AL ESTE CON GUYANA Y PARTE DEL OCéANO ATLáNTICO, AL SURESTE CON BRASIL Y AL SUROESTE CON COLOMBIA. ABARCA UN áREA TOTAL DE 916.445 KM², DISTRIBUIDOS ENTRE SU TERRITORIO CONTINENTAL, LA ISLA DE MARGARITA Y LAS DEPENDENCIAS FEDERALES, CON SU TERRITORIO EMERGIDO MáS SEPTENTRIONAL REPRESENTADO EN LA ISLA DE AVES, POR LO QUE EJERCE SOBERANíA SOBRE 860.000 KM² DEL MENCIONADO MAR BAJO EL CONCEPTO DE ZONA ECONóMICA EXCLUSIVA. VENEZUELA POSEE ADEMáS UN LITIGIO HISTóRICO CON GUYANA EN RELACIóN A 159.500 KM² COMPRENDIDOS EN LA GUAYANA ESEQUIBA AL ESTE DEL PAíS, CATALOGADA COMO ZONA EN RECLAMACIóN POR EL ESTADO VENEZOLANO.\n\nSU TERRITORIO FUE RESIDENCIA DE IMPORTANTES GRUPOS TRIBALES AMERINDIOS COMO LOS CARIBES. FUE AVISTADO POR PRIMERA VEZ POR CRISTóBAL COLóN EN 1498, CON LO QUE SE DIO INICIO A SU COLONIZACIóN Y SU PROCESO DE MESTIZAJE CULTURAL. VENEZUELA FUE EL PRIMER PAíS DE HISPANOAMéRICA EN INICIAR MOVIMIENTOS EMANCIPADORES CONTRA LA CORONA ESPAñOLA, UN PROCESO QUE SE CONSOLIDó CON LA BATALLA DE CARABOBO. TRAS UN LARGO CAPíTULO DE CONFLICTOS CIVILES, LA REPúBLICA HALLó SU VíA HACIA LA MODERNIZACIóN DE LA MANO DE GOBIERNOS NOTORIAMENTE AUTORITARIOS. A MEDIADOS DEL SIGLO XX SE INICIó LA LUCHA POR UN SISTEMA DEMOCRáTICO, QUE SE AFIANZó LUEGO DEL DERROCAMIENTO DEL GENERAL MARCOS PéREZ JIMéNEZ EN 1958. DEBIDO A LA BONANZA PETROLERA, VENEZUELA VIVIó UN PERíODO DE ALTO CRECIMIENTO ECONóMICO, PERO QUE SE VIO INTERRUMPIDO POR LA CRISIS ENERGéTICA DE LOS AñOS 1980, SUSCITANDO UNA ETAPA DE INESTABILIDAD POLíTICA Y SOCIAL ALTERNADA CON ALTIBAJOS FINANCIEROS.\n\nVENEZUELA SE CONSIDERA ACTUALMENTE UN PAíS EN DESARROLLO, CON UNA ECONOMíA BASADA PRIMORDIALMENTE EN LA EXTRACCIóN Y REFINAMIENTO DEL PETRóLEO Y OTROS MINERALES, ASí COMO ACTIVIDADES AGROPECUARIAS E INDUSTRIALES. SE LE RECONOCE TAMBIéN POR SER UNO DE LOS 19 PAíSES CON MAYOR DIVERSIDAD ECOLóGICA DEL MUNDO, CON UNA GEOGRAFíA IRREGULAR QUE COMBINA áREAS TROPICALES, CLIMAS DESéRTICOS, TERRITORIOS SELVáTICOS, EXTENSAS LLANURAS Y AMBIENTES ANDINOS. CUENTA CON EL CONJUNTO DE áREAS PROTEGIDAS MáS EXTENSO DE AMéRICA LATINA, DENOMINADAS ÁREAS BAJO RéGIMEN DE ADMINISTRACIóN ESPECIAL, LAS CUALES ABARCAN APROXIMADAMENTE EL 63% DEL TERRITORIO NACIONAL.[2] SU POBLACIóN, QUE RONDA LOS 28 MILLONES DE HABITANTES,[3] ES AMPLIAMENTE MESTIZA, INTEGRANDO RAZAS INDíGENAS, EUROPEAS, AFRICANAS, Y EN MENOR GRADO ASIáTICAS, SITUACIóN QUE INFLUYE EN SU CULTURA Y SUS MANIFESTACIONES ARTíSTICAS.	CON UNA ECONOMíA BASADA PRIMORDIALMENTE EN LA EXTRACCIóN Y REFINAMIENTO DEL PETRóLEO Y OTROS MINERALES, ASí COMO ACTIVIDADES AGROPECUARIAS E INDUSTRIALES. SE LE RECONOCE TAMBIéN POR SER UNO DE LOS 19 PAíSES CON MAYOR DIVERSIDAD ECOLóGICA DEL MUNDO	28000000	BOLIVAR	BS.F	916.445 KM²
